		["Text_1701"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["WAS"] = "So übernehmt Ihr die Verantwortung für seine Taten, Steinlord. Ich werde Euch zur Rechenschaft ziehen, sobald es seine wahren Absichten zeigt.",
