			["WER"] = "Kommandant Grüntal",
			["ART"] = "YELL",
		},
		["Text_1413"] = {
			["WAS"] = "Ich gebe Euch meine besten Männer. Keine Sorge, Kriegsmaid. Kehrt schnell zu uns zurück. Ich brenne darauf, den Gezeitenjäger zu jagen.",
