		["Text_1687"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Boden der Imposante",
			["WAS"] = "Sucht Ihr Frieden? Gebt die Weltensäule auf und verlasst Tiefenheim. Dies ist unser Reich. Das einzige Willkommen, das Ihr hier findet, ist unter meinem Fuß.",
