		["Text_1929"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Cho''gall",
			["WAS"] = "Ein Sterblicher wagt es, in das Auge zu blicken! (Tapferes kleines Spielzeug!) Ich sehe Euch, kleines Wesen! Ihr wollt also sehen, was das Auge sieht? (Zeig''s uns! Zeig uns alles!)",
