			["WER"] = "Adarrah",
			["ART"] = "SAY",
		},
		["Text_1972"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Der Kampf wird in Kürze beginnen! Doombringêr gegen den wilden Drachenmalorc, Torg Drachenschinder! Ich FINDE jedenfalls, dass er wild ist - es ist schwer zu sagen. Ich habe ihn nur hier reingelassen, weil sie uns ihre alte Arena hier benutzen lassen. Hoffen wir mal auf Blut!",
		},
		["Text_1527"] = {
			["WAS"] = "Wasss für eine unerwartete Überraschung.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Sira''kess",
			["ART"] = "SAY",
		},
		["Text_111"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Bastard der Rotkammgnolle",
			["WAS"] = "Grrr... Frischfleisch!",
		},
		["Text_857"] = {
