			["WER"] = "Lord Walden",
			["ART"] = "YELL",
		},
		["Text_1746"] = {
			["WAS"] = "Spart Euch Euren Dank. Wir greifen den Zwielichthang an, sobald unsere Truppen versammelt sind. Ich erwarte, Euch auf dem Schlachtfeld zu sehen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["ART"] = "SAY",
		},
		["Text_1651"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kies Langfels",
			["WAS"] = "Eins der Katapultteams von Klei ist an der Front steckengeblieben. $N, ich möchte, dass Ihr einige Ersatzteile von ihm besorgt und das Katapult wieder in die Schlacht schickt!",
		},
		["Text_1220"] = {
			["WAS"] = "Erkennen? Was genau?",
