		},
		["Text_2095"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Euer Funkgerät erwacht knisternd zum Leben. Bronzebart",
			["WAS"] = "Was ist das? Vorsicht, da kommt Euch was entgegen!",
		},
		["Text_595"] = {
