			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["WAS"] = "Ihr seid nicht alleine, Tarenar. Ihr habt Euch auf diesem Weg Verbündete gemacht. Und abgesehen davon, seid Ihr auch selbst ein fähiger Paladin.",
