			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kinelory",
			["WAS"] = "Gebt mir Deckung! Ich schaue mal, was ich zwischen all diesem Gerümpel finden kann...",
		},
		["Text_1247"] = {
