			["WAS"] = "Also gut, Gidwin... Tief einatmen...",
		},
		["Text_652"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Adam",
			["WAS"] = "Mit einem Fisch von der Größe deines Mundwerks hätten wir nie wieder Hunger.",
		},
		["Text_1123"] = {
