			["SPRACHE"] = "NULL",
			["WER"] = "Siamat",
			["WAS"] = "Eure Schöpfer haben Euch verraten... und Euer Volk dem Fluch des Fleisches ausgeliefert! Das Geschenk von Lord Todesschwinge macht Euch vollkommen!",
		},
		["Text_2286"] = {
			["WAS"] = "Ein %s erscheint über dem Zirkel, verschwommen und undeutlich.",
