		["Text_1714"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Kieselchen",
			["WAS"] = "Kieselchen läuft sichtlich glücklich im Kreis.",
		},
		["Text_142"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Bürger des Rotkammgebirges",
			["WAS"] = "Einwohner unserer Stadt verschwinden, Solomon. Was gedenkt Ihr diesbezüglich zu unternehmen?",
		},
		["Text_479"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["WAS"] = "Öhm! Ich, äh, weiß es zu schätzen, dass Ihr mich mitnehmt, Fiona. Es ist schön, mal nicht zu Fuß zu gehen.",
		},
		["Text_961"] = {
			["WAS"] = "Eure Zeit ist endlich gekommen, Godfrey!",
			["SPRACHE"] = "NULL",
			["WER"] = "Rudelführer Ivar Blutfang",
			["ART"] = "YELL",
		},
		["Text_2032"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kurdran Wildhammer",
			["WAS"] = "Ein großer Tag, Feuerbart. Der vereinte Wildhammerklan kann niemals aufgehalten werden!",
		},
		["Text_471"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["WAS"] = "Warum soll ich hier oben mit all dem Zeug sitzen?!",
		},
		["Text_2008"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Keegan Feuerbart",
			["WAS"] = "Aye! Wir sind hier, um Euch zu retten!",
		},
		["Text_2030"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Russell Brower",
			["WAS"] = "\"Oh, Fanny, Fanny, sei mein, komm, lass mich dein Manne sein!",
		},
		["Text_962"] = {
			["WAS"] = "Zum Angriff, meine Brüder! Lasst ihn den Zorn des Rudels spüren!",
			["SPRACHE"] = "NULL",
			["WER"] = "Rudelführer Ivar Blutfang",
			["ART"] = "YELL",
		},
		["Text_1371"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["WAS"] = "Duarn - hervorragende Arbeit. Trödelt nicht und verweilt nicht lange in Nespirahs Muschel. Ihr wisst ebenso wie ich um die Gefahren eines zürnenden Halbgottes.",
		},
		["Text_381"] = {
			["WAS"] = "Wir machen uns auf den Weg zu dem Ort, an dem die Goblins angeblich das schwarze Gold gefunden haben. Dieses Gold gehört den Blutsegeln!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ruderer der Blutsegelbukaniere",
			["ART"] = "SAY",
		},
		["Text_500"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["WAS"] = "Ka-bumm!",
		},
		["Text_1474"] = {
			["WAS"] = "Jemand muss es töten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ingenieur Hexasept",
			["ART"] = "YELL",
		},
		["Text_1231"] = {
			["WAS"] = "Angetreten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "YELL",
		},
		["Text_250"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Billy",
			["WAS"] = "Und einmal im Lager habe ich einen Fisch gefangen, der größer war als ich selbst!!!",
		},
		["Text_986"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Rasender Worgen",
			["WAS"] = "%s wird wütend!",
		},
		["Text_477"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["WAS"] = "Ach, halt die Klappe, Du Tor. DU wolltest sie vermutlich schon hundertmal küssen.",
		},
		["Text_1061"] = {
			["WAS"] = "Schätze, wir werden diese einfach wegwerfen müssen... WARTET! Ich glaube, ich habe eine Idee.",
			["SPRACHE"] = "NULL",
			["WER"] = "Dr. Hieronymus Blam",
			["ART"] = "SAY",
		},
		["Text_454"] = {
			["WAS"] = "Was hält uns auf, Fiona?",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_221"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lauernder Worgen",
			["WAS"] = "Alles Leid, das ich in meinem Leben erdulden musste, ist EURE SCHULD. ICH SOLLTE EUCH TÖTEN!",
		},
		["Text_2136"] = {
			["WAS"] = "Die Katzenkreatur, die da hinten angekettet ist, sieht aus, als ob sie sich unterhalten möchte. Vielleicht kann sie uns helfen... aber seid vorsichtig.",
			["SPRACHE"] = "NULL",
			["WER"] = "Adarrah",
			["ART"] = "SAY",
		},
		["Text_1631"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Haethen Kaul",
			["WAS"] = "Eine unvorstellbare Macht strömt durch mich in Richtung Tor! Muahahahahahaha!",
		},
		["Text_745"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "König Varian Wrynn",
			["WAS"] = "Muradin, sichert das Deck. Bereitet den Angriff auf den oberen Teil der Zitadelle vor. Ich sende ein weiteres Regiment aus Sturmwind.",
		},
		["Text_1520"] = {
			["WAS"] = "Das U-Boot explodiert! Raus!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "YELL",
		},
		["Text_233"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberstabschef Anders",
			["WAS"] = "Ihr könnt hier nicht reinkommen!",
		},
		["Text_1851"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Thordun Hammerschlag",
			["WAS"] = "Da brat mir doch einer einen gefüllten Kodo! Kurdran Wildhammer in Fleisch und Blut. Er lebt!",
		},
		["Text_806"] = {
			["WAS"] = "Hilfe!!! Ich sagte Euch doch, dass dieser Ort verflucht ist!",
