			["WER"] = "Überwacher der Azsh''ir",
			["ART"] = "EMOTE",
		},
		["Text_583"] = {
			["WAS"] = "Was ist dies für ein Zauber?",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["ART"] = "SAY",
		},
		["Text_1808"] = {
			["WAS"] = "Alle werden sich dem Ruf des Meisters unterwerfen...",
			["SPRACHE"] = "NULL",
			["WER"] = "Wahnsinniger Kultist",
			["ART"] = "SAY",
		},
		["Text_1534"] = {
			["WAS"] = "Kommt, Kinder von Azshara! Endlich beanspruchen wir das Reich des Wassers!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Naz''jar",
			["ART"] = "YELL",
		},
		["Text_777"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Crok Geißelbann",
			["WAS"] = "Genug Geplänkel! Unsere Champions sind hier - helft ihnen, während wir unseren Weg durch die Halle bahnen!",
		},
		["Text_1467"] = {
			["WAS"] = "%s wirft seinen Fisch nach Euch und versucht vor Angst wegzulaufen!",
