			["WER"] = "Kaltlichtjäger",
			["ART"] = "EMOTE",
		},
		["Text_203"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["WAS"] = "Trottmann.",
		},
		["Text_1879"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Flynn Dunwald",
			["WAS"] = "Seid vorsichtig, wenn Ihr nach dem Himmel über diesen Ruinen greift, Mädel. Die Zwielichtdrachen mögen gerne Dinge, die fliegen.",
		},
		["Text_2228"] = {
			["WAS"] = "Gut! Ich bin froh, dass Ihr hier seid, $N. Es gibt viel zu besprechen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Kurdran Wildhammer",
			["ART"] = "SAY",
		},
		["Text_488"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["WAS"] = "Ihr gehört also zum Argentumkreuzzug, wie?",
		},
		["Text_530"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["WAS"] = "Vielleicht hat er Euch deshalb verlassen.",
		},
		["Text_1282"] = {
			["WAS"] = "Ihre Zahl... issst endlosss...",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "YELL",
		},
		["Text_662"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochlord Bolvar Fordragon",
			["WAS"] = "NIEMALS! Ich... werde Euch... niemals... dienen...",
		},
		["Text_1296"] = {
			["WAS"] = "Wer seid Ihr? Was ist das für ein Ort?",
			["SPRACHE"] = "NULL",
			["WER"] = "Gefreiter Pollard",
			["ART"] = "SAY",
		},
		["Text_1925"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Cho''gall",
			["WAS"] = "Was ist mit unseren Agenten in Sturmwind? (Sturmwind! Das Auge, das Auge sieht ins Herz der Stadt.) Bringt mir das Auge.",
		},
		["Text_1742"] = {
			["WAS"] = "Ich schlage folgendes vor: Wir greifen den Schattenhammerkult an und tilgen Todesschwinges Namen aus diesem Reich. Euer Irdener Ring wird mit uns kämpfen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["ART"] = "SAY",
		},
		["Text_1657"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Flint Erzmantel",
			["WAS"] = "$N? Wird ja auch Zeit, dass Ihr kommt. Was hat Euch aufgehalten? Das Leben meines Vaters ist in höchster Gefahr!",
		},
		["Text_1556"] = {
			["WAS"] = "Sie zersplitterte, als Todesschwinge durch den Dom darüber brach und den Riss zwischen den beiden Welten schuf. Ganz Tiefenheim wird nach Azeroth stürzen, wenn wir die Weltensäule nicht wieder zusammensetzen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["ART"] = "SAY",
		},
		["Text_771"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Modermiene",
			["WAS"] = "Papi macht neues Spielzeug aus Euch!",
		},
		["Text_438"] = {
			["WAS"] = "Giddi... Du bist nicht sauer auf mich, oder?",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["ART"] = "SAY",
		},
		["Text_1369"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Stimme von Nespirah",
			["WAS"] = "Ihr könnt nun gehen, Freund. Erunak, der Freund der Tauren, wartet bestimmt draußen mit den Seepferdchen. Tatsächlich sieht es so aus, als sei er bereits schon hier.",
		},
		["Text_1613"] = {
			["WAS"] = "Seid gegrüßt! Bitte schaut Euch um.",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kyra Boucher",
			["ART"] = "SAY",
		},
		["Text_2118"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Klingenschuppe",
			["WAS"] = "%s holt tief Luft...",
		},
		["Text_648"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Adam",
			["WAS"] = "Vielleicht sollten wir zur Brücke gehen und angeln.",
		},
		["Text_664"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Muradin Bronzebart",
			["WAS"] = "Kann das sein, Lord Fordring? Wenn Bolvar lebt, besteht noch Hoffnung auf Frieden zwischen Allianz und Horde. Wir müssen zur Spitze der Zitadelle und den Paladin befreien!",
		},
		["Text_258"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Rhonin",
			["WAS"] = "Bürger von Dalaran! Richtet Eure Blicke gen Himmel und beobachtet aufmerksam!",
		},
		["Text_1511"] = {
			["WAS"] = "Wenn wir den Riss verteidigen sollen, müssen wir es sofort tun!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "SAY",
		},
		["Text_680"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Todeswisper",
			["WAS"] = "Ihr durchblickt den Nebel, der wie ein Schleier auf dieser Welt liegt, und erkennt, wo die wahre Macht liegt.",
		},
		["Text_155"] = {
			["WAS"] = "Ich nehme an, ich brauche noch etwas Übung.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lehrling von Herdweiler",
			["ART"] = "SAY",
		},
		["Text_1470"] = {
