			["WER"] = "Tiefenrufer Azrajar",
			["ART"] = "SAY",
		},
		["Text_355"] = {
			["WAS"] = "Schön, versuchen wir es aufzubrechen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Seewolf MacKinley",
			["ART"] = "SAY",
		},
		["Text_112"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Wache Flippit",
			["WAS"] = "Bleibt wachsam, Priester.",
