		},
		["Text_1396"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Varkul der Unerbittliche",
			["WAS"] = "Männer, Angriff!",
		},
		["Text_1567"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdenruferin Yevaa",
			["WAS"] = "Was haben wir denn da, $N?",
		},
		["Text_1255"] = {
			["WAS"] = "In die Tiefen mit Euch, Bestie!",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_1854"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Feuerbärter Miliz",
			["WAS"] = "Wir halten Euch den Rücken frei.",
		},
		["Text_1782"] = {
			["WAS"] = "Götter des Schattens, Herren des Zwielichts ... gebt mir Kraft!",
			["SPRACHE"] = "NULL",
			["WER"] = "Major Samuelson",
			["ART"] = "YELL",
		},
		["Text_877"] = {
			["WAS"] = "Frostfäuste!",
			["SPRACHE"] = "NULL",
			["WER"] = "Glubtok",
			["ART"] = "YELL",
		},
		["Text_1034"] = {
			["WAS"] = "Nur noch eine Minute! Haltet durch, das Ritual ist gleich vollbracht!",
			["SPRACHE"] = "NULL",
			["WER"] = "Belnistrasz",
			["ART"] = "YELL",
		},
		["Text_889"] = {
