			["ART"] = "YELL",
		},
		["Text_282"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Victor Nefarius",
			["WAS"] = "Für dieses Versagen werdet Ihr eine Ewigkeit lang Mist schaufeln!",
		},
		["Text_243"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Justin",
			["WAS"] = "Es heißt, er könne sich von Zeit zu Zeit in einen Raben verwandeln.",
		},
		["Text_1279"] = {
			["WAS"] = "Nein! Ahhhh...",
			["SPRACHE"] = "NULL",
			["WER"] = "Kampfschwimmer von Sturmwind",
			["ART"] = "YELL",
		},
		["Text_645"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Roman",
			["WAS"] = "Ich habe Wurmstückchen auf meinen Schuhen...",
		},
		["Text_2039"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Keegan Feuerbart",
			["WAS"] = "Gut. Ich danke Euch, Kurdran.",
		},
		["Text_512"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Vex''tul",
			["WAS"] = "Wir sehen uns auf den grünen Felder auf der anderen Seite, $N.",
		},
		["Text_690"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Todeswisper",
			["WAS"] = "Ich erlöse Euch vom Fluch des Fleisches!",
		},
		["Text_720"] = {
