			["SPRACHE"] = "NULL",
			["WER"] = "Todesbringer Saurfang",
			["WAS"] = "Zwerge...",
		},
		["Text_650"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Adam",
			["WAS"] = "Pssst! Du verscheuchst ja die Fische.",
		},
		["Text_1196"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Loramus'' Leichnam",
			["WAS"] = "Beschützt %s, bis das Ritual abgeschlossen ist!",
		},
		["Text_1386"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Wellensprecherin Valoren",
			["WAS"] = "Erunak, schaut Euch das an. Es sieht aus wie ein geeigneter Fokus für die Magier, von denen ich Euch erzählt habe.",
		},
		["Text_984"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Svala Grabesleid",
			["WAS"] = "Euer Ende ist unvermeidlich.",
		},
		["Text_1869"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verletzter Nachzügler des Drachenmals",
			["WAS"] = "Lasst Eure dreckigen Hände von mir, $R.",
		},
		["Text_1738"] = {
			["WAS"] = "Wir wollen den Riss versiegeln, den Todesschwinge Azeroth beigebracht hat. Wir brauchen die Weltensäule, um das Loch hier zu schließen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdenrufer Torunskar",
			["ART"] = "SAY",
		},
		["Text_1729"] = {
			["WAS"] = "Schnell, hinterher!",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdheilerin Norsala",
			["ART"] = "YELL",
		},
		["Text_290"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Victor Nefarius",
			["WAS"] = "Kostet meine Macht!",
		},
		["Text_1411"] = {
			["WAS"] = "Ihr werdet Verstärkung erhalten, Kriegsmaid. Ich hatte bereits vor, einige Kvaldir für Sklavenarbeiten in Nespirah zu sammeln, also kommt Ihr gerade gelegen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Aufseher Idra''kess",
			["ART"] = "SAY",
		},
		["Text_1835"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Ephram Hartstein",
			["WAS"] = "Festhalten, $C. Es dient nur Eurem Schutz.",
