		},
		["Text_2199"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesschwinge",
			["WAS"] = "Der Tod ist endgültig. Ewig. Der Tod ist... mein Reich.",
		},
		["Text_493"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["WAS"] = "Aber ich werde Euch doch nicht einfach nur absetzen, Meister Leuchtfeuer. Wir werden herzlich gern auf Euch warten.",
		},
		["Text_2163"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Adarrah",
			["WAS"] = "Was soll ich nochmal greifen?",
		},
		["Text_956"] = {
			["WAS"] = "Ein nahestehender Steinschläfer erwacht zum Leben!",
			["SPRACHE"] = "NULL",
			["WER"] = "DEBUG Announcer",
			["ART"] = "BOSS",
		},
		["Text_64"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Koltira Todesweber",
			["WAS"] = "Ja, ich weiß. Und glaubt ja nicht, dass ich sanft mit Euch umgehen werde.",
		},
		["Text_1528"] = {
			["WAS"] = "Ihr müssst mir vergeben... ich habe keine Zeit zu spielen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Sira''kess",
			["ART"] = "SAY",
		},
		["Text_1635"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdbrecher Dolomit",
			["WAS"] = "Wir haben Verstärkung! Für den Steinvater!",
		},
		["Text_1455"] = {
			["WAS"] = "Wir nähern uns der Höhle, Kapitän.",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberleutnant Wiley",
			["ART"] = "SAY",
		},
		["Text_1680"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdheilerin Norsala",
			["WAS"] = "Doch nur ein Elementarlord könnte so viele Elementare so schnell binden. Es scheint, als wären wir mit der Steinmutter selbst im Krieg.",
		},
		["Text_305"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Soldat der Gurubashi",
			["WAS"] = "Hierher, Brüder, schnell!",
		},
		["Text_505"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Raymond George",
			["WAS"] = "Gute Arbeit, Helden. Ihr habt meine Kampfprüfung bestanden.",
		},
		["Text_2219"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Obsidia",
			["WAS"] = "Nein! Mein Gelege ist das letzte...! Vater... Ich habe versagt...",
		},
		["Text_1133"] = {
			["WAS"] = "Endlich sagt Ihr was Vernünftiges! Ich nehme den Zwielichtfürsten. Ihr konzentriert Euch auf den kleinen Zwerg.",
			["SPRACHE"] = "NULL",
			["WER"] = "Hansel Bleihand",
			["ART"] = "SAY",
		},
		["Text_1587"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Mylra",
			["WAS"] = "Von potthässlichen Ogern ist da keine Rede.",
		},
		["Text_571"] = {
			["WAS"] = "Zeit zum Spielen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Fleischhaken",
			["ART"] = "YELL",
		},
		["Text_729"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Muradin Bronzebart",
			["WAS"] = "Soldaten, Aufstellung! Sieht aus, als würde die Horde noch einen Anlauf wagen!",
		},
		["Text_300"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Blutfürst Mandokir",
			["WAS"] = "Willkommen in Zul''Gurub, kleines Wesen. Es sieht jetzt vielleicht nicht nach viel aus, aber gebt ihm Zeit...",
		},
		["Text_608"] = {
			["WAS"] = "Die Gerechtigkeit wird obsiegen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["ART"] = "SAY",
		},
		["Text_232"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Bruder Nimetz",
			["WAS"] = "Volltreffer! Seht Euch das an!",
		},
		["Text_914"] = {
			["WAS"] = "Wir werden Euch zerquetschen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Pythas",
			["ART"] = "YELL",
		},
		["Text_573"] = {
			["WAS"] = "Neues Spielzeug!",
			["SPRACHE"] = "NULL",
			["WER"] = "Fleischhaken",
			["ART"] = "YELL",
		},
		["Text_1003"] = {
			["ART"] = "BOSS",
