		["Text_1689"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Quartzsteinling",
			["WAS"] = "Der Steinling klappert dankbar mit seinen Kristallen.",
		},
		["Text_813"] = {
			["WAS"] = "Ihr habt unsere Schätze schon viel zu lange geplündert. Macht Euch bereit, in Euer nasses Grab hinabzufahren!",
			["SPRACHE"] = "NULL",
			["WER"] = "Marodeur der Säbelflossen",
			["ART"] = "YELL",
		},
		["Text_119"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Bürger des Rotkammgebirges",
			["WAS"] = "Meine Frau wird vermisst! Bitte helft mir!",
		},
		["Text_1776"] = {
			["WAS"] = "Ihr seid einer der am grimmigsten aussehenden Krieger, die ich jemals zu Gesicht bekam, $N!",
			["SPRACHE"] = "NULL",
			["WER"] = "Anduin Wrynn",
			["ART"] = "SAY",
		},
		["Text_408"] = {
			["WAS"] = "Blast diese feigen Strolche aus dem Wasser!",
			["SPRACHE"] = "NULL",
			["WER"] = "Baron Revilgaz",
			["ART"] = "YELL",
		},
		["Text_2231"] = {
			["WAS"] = "KÄMPFT WEITER! ICH STEIGE HINAUF UND SPRECHE MIT CHO''GALL!",
			["SPRACHE"] = "NULL",
			["WER"] = "Schädelberster der Berg",
			["ART"] = "YELL",
		},
		["Text_537"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Belagerungsingenieur der Geißel",
			["WAS"] = "Der Pestwald ist zu groß! Euer Freund ist verloren! Ihr werdet ihn niemals finden!",
		},
		["Text_1697"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Felsen der Ausdauernde",
			["WAS"] = "Ihr seid gekommen, Euch zu beweisen, Fleischling? Die Bruchtiefen liegen im Nordosten. Der Stein, den Ihr sucht, ist dort.",
		},
		["Text_2225"] = {
			["WAS"] = "Wir sehen uns dann beim Siegesgipfel!",
			["SPRACHE"] = "NULL",
			["WER"] = "Vandale der Wildhämmer",
			["ART"] = "SAY",
		},
		["Text_927"] = {
			["WAS"] = "%s hat eine entsetzliche Vision. Irgendetwas bewegt sich in dem trüben Wasser.",
			["SPRACHE"] = "NULL",
			["WER"] = "Naralex",
			["ART"] = "EMOTE",
		},
		["Text_444"] = {
			["WAS"] = "<Seufz>... ''Die Kreuzfahrerkameraden''.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_832"] = {
			["WAS"] = "Nun ja, wenigstens konnten wir das Bier retten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hargin Mundar",
			["ART"] = "SAY",
		},
		["Text_96"] = {
			["WAS"] = "Gestaltwandel! Macht Euch bereit für das Mondfeuer!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["ART"] = "SAY",
		},
		["Text_43"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Myra Tyrngaarde",
			["WAS"] = "Frisches Brot zu verkaufen!",
		},
		["Text_2257"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gefangene Klingenmähne",
			["WAS"] = "<Prust!> Ist das alles?",
		},
		["Text_353"] = {
			["WAS"] = "Habt abermals Dank für Eure Hilfe. Möge Euch bei Euren Reisen der Wind immer im Rücken stehen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinzessin Poobah",
			["ART"] = "SAY",
		},
		["Text_870"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Beschützer der Himmelsbrecher",
			["WAS"] = "Himmelsbrecher-Infanterie, Position halten!",
		},
		["Text_2062"] = {
			["WAS"] = "Los geht''s. Haltet Euch fest!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Mylra",
			["ART"] = "SAY",
		},
		["Text_564"] = {
			["WAS"] = "Ewige Pein erwartet euch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Anub''arak",
			["ART"] = "YELL",
		},
		["Text_340"] = {
			["WAS"] = "Arr, meine Herzchen! Ich habe noch einige weitere Schätze in der Gurubashi Arena abzugeben! Ihr müsst nur die von mir in der Mitte der Arena zurückgelassene Truhe öffnen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Störtebrecher",
			["ART"] = "YELL",
		},
		["Text_350"] = {
			["WAS"] = "He! Was macht Ihr dort unten?",
			["SPRACHE"] = "NULL",
			["WER"] = "Bronwyn Hackschlag",
			["ART"] = "YELL",
		},
		["Text_2089"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Erzmagier Pentarus",
			["WAS"] = "Natürlich, Brann. Wir werden den Schild vorübergehend öffnen.",
		},
		["Text_1706"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Kieselchen",
			["WAS"] = "Kieselchen sieht die Kristalle vor sich und eilt aufgeregt auf sie zu.",
		},
		["Text_1138"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["WAS"] = "Ich seh'' Euch in der Hölle wieder.",
		},
		["Text_1054"] = {
			["WAS"] = "Magiekus hat Mogor, den Held der Totschläger, bezwungen! Hoch lebe Magiekus!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["ART"] = "YELL",
		},
		["Text_1895"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Flynn Dunwald",
			["WAS"] = "Heißen wir sie auf die Art der Dunwalds willkommen, Brüder!",
		},
		["Text_1263"] = {
			["WAS"] = "Ihr könnt Euch nicht verssstecken, Atmer!",
			["SPRACHE"] = "NULL",
			["WER"] = "Räuber des Zin''jatar",
			["ART"] = "SAY",
		},
		["Text_852"] = {
			["WAS"] = "Ja! Ich töten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Futterwühler der Tunnelratten",
			["ART"] = "SAY",
		},
		["Text_2073"] = {
			["WAS"] = "Das ekelhafte Ding hat Flecken auf meinen Gewändern gemacht!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Jalara",
			["ART"] = "YELL",
		},
		["Text_838"] = {
			["WAS"] = "Vernichten!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Splittersteintrogg",
			["ART"] = "SAY",
		},
		["Text_1673"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Flint Erzmantel",
			["WAS"] = "Juhu!",
		},
		["Text_328"] = {
			["WAS"] = "Hier bitte. Die Substanz, die Ihr mir mitgebracht habt, ist ungefähr... 150.000 Jahre alt? Wie bitte!? Ich muss einen weiteren Test durchführen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Dask \"der Flachmann\" Gobfizzle",
			["ART"] = "SAY",
		},
		["Text_1722"] = {
			["WAS"] = "Sagt mir Bescheid, wenn ich Euch auf der Suche nach etwas behilflich sein kann, Hexenmeister.",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Edna Mullby",
			["ART"] = "SAY",
		},
		["Text_1558"] = {
			["WAS"] = "Wir haben die Kontrolle über den Tempel übernommen und halten so viel Schaden zurück, wie möglich. Geht hinein und sprecht mit Maruut. Er hat das Sagen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["ART"] = "SAY",
		},
		["Text_1976"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Stellt Euch meine Überraschung vor, als mich das Genie der Verlassenen Calder Gray ansprach und mir vorschlug, einen Kämpfer aus all den Teilen unserer vorherigen Champions zusammenzuflicken... BUCHSTÄBLICH! Wer könnte so eine Gelegenheit ungenutzt verstreichen lassen, CALDERS SCHÖPFUNG herauszufordern?!",
		},
		["Text_1499"] = {
			["WAS"] = "Niemand vermag zu sagen, was sie wollen…",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_691"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Todeswisper",
			["WAS"] = "Die Manabarriere von %s schimmert und löst sich auf!",
		},
		["Text_2109"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Brann Bronzebart",
			["WAS"] = "Was ist mit dem Plattenpanzerprotodrachen und dem Feuerriesen, die in der Nähe gesehen wurden? Glaubt Ihr, dass Eure Magier damit fertig werden?",
		},
		["Text_796"] = {
			["WAS"] = "Brötchen, Teilchen und Brot. Frisch gebacken!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Thomas Müller",
			["ART"] = "SAY",
		},
		["Text_1900"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Eoin Dunwald",
			["WAS"] = "Ich hab jetzt die Nase voll von diesen bierlosen Ungeheuern!",
		},
		["Text_1750"] = {
			["WAS"] = "Therazane hat also den Mut gefunden, uns herauszufordern, ja?",
			["SPRACHE"] = "NULL",
			["WER"] = "Hohepriesterin Lorthuna",
			["ART"] = "SAY",
		},
		["Text_447"] = {
			["WAS"] = "Auf unserer linken Seite kommt gleich ein Turm. Was haltet ihr davon, wenn wir anhalten und ein wenig rasten?",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["ART"] = "SAY",
		},
		["Text_900"] = {
			["WAS"] = "Aaah…Frischfleisch.",
			["SPRACHE"] = "NULL",
			["WER"] = "Admiral Knurrreißer",
			["ART"] = "YELL",
		},
		["Text_1145"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberst Trottmann",
			["WAS"] = "Vergesst nicht, die Verkleidung anzuziehen.",
		},
		["Text_502"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["WAS"] = "Können wir mal ein bisschen langsamer machen?",
		},
		["Text_597"] = {
			["WAS"] = "Der schnellste Weg zu Mal''ganis liegt hinter dem Bücherregal da vorn.",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["ART"] = "SAY",
		},
		["Text_1363"] = {
			["WAS"] = "Ich kann Euch nicht sehen, aber Eure Gegenwart wahrnehmen. Soweit ich es vermag, werde ich es Euch erklären.",
			["SPRACHE"] = "NULL",
			["WER"] = "Stimme von Nespirah",
			["ART"] = "SAY",
		},
		["Text_1957"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Wie dem auch sei, möge der Kampf beginnen!",
		},
		["Text_1903"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Geoffery Tulvan",
			["WAS"] = "Hallo Leute! Ich habe heute Abend eine nicht so überraschende Überraschung für Euch.",
		},
		["Text_2189"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Sanitäter von Hochstade",
			["WAS"] = "Ich mag Euch irgendwie. Versucht, Euch da draußen nicht umbringen zu lassen.",
		},
		["Text_1110"] = {
			["WAS"] = "Wenn Ihr Erfolg habt, wird Eure Suche vielleicht belohnt werden. Wenn Ihr jedoch versagt, werdet Ihr brennen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Abbild von Erzherzog Calcinder",
			["ART"] = "YELL",
		},
		["Text_1676"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdenruferin Yevaa",
			["WAS"] = "$N, Ihr seid zurück! Ist dies das mittlere Fragment?",
		},
		["Text_2097"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Flammenleviathan",
			["WAS"] = "Feindeinheiten erkannt. Bedrohungsbewertung aktiv. Hauptziel erfasst. Neubewertung in T minus 30 Sekunden.",
		},
		["Text_440"] = {
			["WAS"] = "Hör auf damit, Tarenar.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_1529"] = {
			["WAS"] = "In meiner Abwesssenheit werden sich meine Diener... um Euch kümmern.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Sira''kess",
			["ART"] = "SAY",
		},
		["Text_1040"] = {
			["WAS"] = "Horgus wurde getötet! Schöpft neuen Mut, ihr Verteidiger von Darroheim!",
			["SPRACHE"] = "NULL",
			["WER"] = "Verteidiger von Darroheim",
			["ART"] = "YELL",
		},
		["Text_2017"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Russell Brower",
			["WAS"] = "Die Leute riefen \"Fanny\", wenn ihren Namen sie beschworen.",
		},
		["Text_625"] = {
			["WAS"] = "So... köstlich.",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Taldaram",
			["ART"] = "YELL",
		},
		["Text_1385"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Wellensprecherin Valoren",
			["WAS"] = "Vielen Dank.",
		},
		["Text_619"] = {
