			["SPRACHE"] = "NULL",
			["WER"] = "Urahne Nadox",
			["ART"] = "YELL",
		},
		["Text_89"] = {
			["WAS"] = "Kann Zen''Kiki einen kleinen Schubs bekommen?",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["ART"] = "SAY",
		},
		["Text_1671"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Steinvater Erzmantel",
			["WAS"] = "Ich werde dafür sorgen, dass Ihr das zweite Weltensäulenfragment erhaltet.",
		},
		["Text_265"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Donna",
			["WAS"] = "Ich habe Euren Gorilla! Harhar!",
		},
		["Text_1678"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdenruferin Yevaa",
			["WAS"] = "Verstanden. Ich begebe mich sofort dort hin.",
		},
		["Text_1809"] = {
			["WAS"] = "Beißen... Krallen... Greifen... Reißen...",
			["SPRACHE"] = "NULL",
