			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Mylra",
			["WAS"] = "Ich bin eine Tochter des Wildhammerklans und eine Schamanin des Irdenen Rings. Mein Kodex gebietet mir, meine Ahnen und die Elemente zu ehren.",
		},
		["Text_1793"] = {
			["WAS"] = "Ich habe rein gar nichts davon gehört. Ich schwöre!",
			["SPRACHE"] = "NULL",
			["WER"] = "Dockarbeiter von Sturmwind",
			["ART"] = "SAY",
		},
		["Text_337"] = {
			["WAS"] = "Eure Fledermaus und Eure Schlange benötigen also Zanzils Unterstützung? Sehr gut. Ich treffe Euch im Inneren Zul''Gurubs... alter Freund.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zanzil der Ausgestoßene",
			["ART"] = "SAY",
		},
		["Text_1323"] = {
			["WAS"] = "Für den Meister sterbe ich tausende Male... taus...",
			["SPRACHE"] = "NULL",
			["WER"] = "Corla, Botin des Zwielichts",
			["ART"] = "YELL",
		},
		["Text_1014"] = {
			["WAS"] = "Hey, wer nennen Fengus einen Gnoll-Liebhaber?! Bringen die Gefangenen zu de'' König. Ihr schlau sein das bringen Sie mit ihre Waffen, um König zu zeigen wie gefährlich sie sind. Ich gehen sehen, ob Fengus wieder Komisches erzählen, wenn trinken Hauweg! HAR!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hauptmann Krombruch",
			["ART"] = "YELL",
		},
		["Text_2099"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Flammenleviathan",
			["WAS"] = "*Alarm* Versagen der statischen Verteidigungssysteme. Orbitale Gegenmaßnahmen deaktiviert.",
		},
		["Text_2091"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Erzmagier Pentarus",
			["WAS"] = "Magier der Kirin Tor, auf Branns Zeichen hin fahrt Ihr den Schild herunter! Verteidigt diese Plattform und unsere Verbündeten mit Eurem Leben! Für Dalaran!",
		},
		["Text_1897"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Donnelly Dunwald",
			["WAS"] = "Wenn ich mit Euch fertig bin, habt Ihr keinen Zeh mehr übrig, um Euch daraufzustellen!",
		},
		["Text_693"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Todeswisper",
			["WAS"] = "Erfasst Ihr bereits die Nutzlosigkeit Eurer Handlungen?",
		},
		["Text_1969"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Der große Schmelztiegel des Gemetzels erwartet Euch, Titanios. Denkt dran: Sobald der Kampf begonnen hat, müsst Ihr in der Arena bleiben. SIEGT ODER STERBT!",
		},
		["Text_476"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["WAS"] = "Fiona, ich muss dich warnen: Gidwin will nur vorne sitzen, weil er dich küssen will.",
		},
		["Text_724"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesbringer Saurfang",
			["WAS"] = "Ihr seid nichts!",
		},
		["Text_637"] = {
			["WAS"] = "Gul''kafh an''shel. Yoq''al shn ky ywaq nuul.",
			["SPRACHE"] = "NULL",
			["WER"] = "Herold Volazj",
			["ART"] = "YELL",
		},
		["Text_411"] = {
			["WAS"] = "Im Mondlicht verwüsten und toben wir schwer, trinkt aus, Ihr Hunde, ah-uuh!",
			["SPRACHE"] = "NULL",
			["WER"] = "Trunkenbold der Trümmerflut",
			["ART"] = "SAY",
		},
		["Text_1419"] = {
			["WAS"] = "Während Ihr fort wart, haben sie angegriffen... Der Admiral hat es nicht geschafft. Der Rest hat sich in die Höhle zurückgezogen. Das solltet Ihr auch tun.",
			["SPRACHE"] = "NULL",
			["WER"] = "Verletzter Aufklärer",
			["ART"] = "SAY",
		},
		["Text_1822"] = {
			["WAS"] = "Schachmatt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Schwarze Bischof",
			["ART"] = "SAY",
		},
		["Text_1318"] = {
			["WAS"] = "Rom''ogg tut es leid...",
			["SPRACHE"] = "NULL",
			["WER"] = "Rom''ogg Knochenbrecher",
			["ART"] = "YELL",
		},
		["Text_210"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oger der Splitterfäuste",
			["WAS"] = "Ich zerschmettern! Du sterben!",
		},
		["Text_1319"] = {
			["WAS"] = "RAZ QUETSCHT!",
			["SPRACHE"] = "NULL",
			["WER"] = "Raz der Wahnsinnige",
			["ART"] = "YELL",
		},
		["Text_804"] = {
			["WAS"] = "Ich werde jetzt anfangen, Energie aus dem Stein zu ziehen. Eure Aufgabe, $N, ist es, mich zu verteidigen. Dieser Ort ist verflucht... glaubt mir.",
			["SPRACHE"] = "NULL",
			["WER"] = "Professor Prasseltrop",
			["ART"] = "SAY",
		},
		["Text_600"] = {
			["WAS"] = "Lasst uns diese Stelle so schnell wie möglich passieren. Falls uns die Untoten nicht kriegen, dann vielleicht das Feuer.",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["ART"] = "SAY",
		},
		["Text_1288"] = {
			["WAS"] = "Gute Arbeit, $N! Ich kann mir vorstellen, dass Eure Reise über die Wellen von nun an sehr viel ruhiger vonstattengeht.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_2232"] = {
			["WAS"] = "Wir sollten aufbrechen, $N. Die Rampe rauf und dann direkt zu Meister Shaw.",
			["SPRACHE"] = "NULL",
			["WER"] = "Truppenkommandant des SI:7",
			["ART"] = "SAY",
		},
		["Text_1934"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Nivvet Kanalschloss",
			["WAS"] = "Was war das? Oh, nein, der Drachenmalklan ist hier!",
		},
		["Text_712"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochfürst Saurfang",
			["WAS"] = "Raketenschützen, nachladen!",
		},
		["Text_1294"] = {
			["WAS"] = "Wir sind angekommen, $N. Ist er noch am Leben?",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_623"] = {
			["WAS"] = "Eure Überreste werden mir ein Festessen sein!",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Taldaram",
			["ART"] = "YELL",
		},
		["Text_1230"] = {
			["WAS"] = "Zuhören! Unser Schiff sollte gleich hier sein.",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "YELL",
		},
		["Text_773"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Modermiene",
			["WAS"] = "Ich glaub, ich böses Aa gemacht. Es explodiert!",
		},
		["Text_2047"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Grundy MacGraff",
			["WAS"] = "Ich werde euer Lebensblut vernichten, im Namen des Meisters!",
		},
		["Text_912"] = {
			["WAS"] = "%s stößt einen Hilfeschrei aus!",
			["SPRACHE"] = "NULL",
			["WER"] = "Deviatwächter",
			["ART"] = "EMOTE",
		},
		["Text_129"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Magistrat Solomon",
			["WAS"] = "Wir sind erledigt! Ich könnte eigentlich gleich eine Evakuierung ausrufen und Seenhain räumen, bevor die Orcs einmarschieren.",
		},
		["Text_1321"] = {
			["WAS"] = "Schwelgt in seiner Macht! Erhebt Euch als ein Diener der Wut des Meisters!",
			["SPRACHE"] = "NULL",
			["WER"] = "Corla, Botin des Zwielichts",
			["ART"] = "YELL",
		},
		["Text_1486"] = {
			["WAS"] = "Habt Dank, $N. Danke.",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Gefangener der Allianz",
			["ART"] = "SAY",
		},
		["Text_747"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatz",
			["WAS"] = "%s lässt ein lautes Heulen hören!",
		},
		["Text_91"] = {
			["WAS"] = "Es brennt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["ART"] = "SAY",
		},
		["Text_1658"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Pyrium Leitstein",
			["WAS"] = "$N, Ihr solltet wohl über diese Riesen und Steintroggs hinwegfliegen. Versucht nicht durch ihre Reihen zu reiten.",
		},
		["Text_718"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Muradin Bronzebart",
			["WAS"] = "Ein einzelner Orc gegen die Macht der Allianz???",
		},
		["Text_1612"] = {
			["WAS"] = "Zeit für Gnimo, herunterzufahren.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gnimo",
			["ART"] = "SAY",
		},
		["Text_235"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberstabschef Esquivel",
			["WAS"] = "Bei Kurzens Schwert!",
		},
		["Text_1482"] = {
			["WAS"] = "Ihr amüsiert mich, Ihr Schwächling, Alimanium, aber ich werde Euch einen Gefallen tun. Nun lasst uns zu meinem Herren zurückgehen, dort drunten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ick''thys der Unergründliche",
			["ART"] = "YELL",
		},
		["Text_692"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Todeswisper",
			["WAS"] = "Genug! Ich sehe, ich muss die Dinge selbst in die Hand nehmen!",
		},
		["Text_781"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Schwester Svalna",
			["WAS"] = "Jämmerliche Kreaturen! Sterbt!",
		},
		["Text_1637"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verteidiger von Steinruh",
			["WAS"] = "Für Steinruh!",
		},
		["Text_229"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Emerine Junis",
			["WAS"] = "Wenn Ihr nichts einzuwenden habt, werde ich uns zurück zum Rebellenlager teleportieren. Wir werden uns später persönlich bedanken.",
		},
		["Text_377"] = {
			["WAS"] = "Ich würde die Bukaniere niemals verlassen, Ihr walfettschnüffelnder Rockzipfelhänger.",
			["SPRACHE"] = "NULL",
			["WER"] = "Korsar der Blutsegelbukaniere",
			["ART"] = "YELL",
		},
		["Text_827"] = {
			["WAS"] = "Ein unglückliches Missgeschick!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hargin Mundar",
			["ART"] = "SAY",
		},
		["Text_1446"] = {
			["WAS"] = "Ihr marschiert in den Tod! Azshara wird Euch aus den Meeren tilgen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Tiefenlord Zin''jatar",
			["ART"] = "YELL",
		},
		["Text_47"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Zurückgezogene Seele",
			["WAS"] = "Wer seid Ihr? Was habt Ihr mir nur angetan?",
		},
		["Text_638"] = {
			["WAS"] = "Blickt in das Nichts. Es ist die Ewigkeit, in der sie ruhen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Herold Volazj",
			["ART"] = "WHISPER",
		},
		["Text_808"] = {
			["WAS"] = "Ich habe es geschafft! Ich habe die Macht des Steins auf die Brille übertragen! Lasst uns von hier verschwinden!",
			["SPRACHE"] = "NULL",
			["WER"] = "Professor Prasseltrop",
			["ART"] = "SAY",
		},
		["Text_858"] = {
			["WAS"] = "Rrglrglrglrglrgl.",
			["SPRACHE"] = "NULL",
			["WER"] = "Abgesandter der Blaukiemen",
			["ART"] = "SAY",
		},
		["Text_775"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Crok Geißelbann",
			["WAS"] = "Haltet Eure Waffen bereit, Argentumbrüder! Die Vrykul werden die Frostkönigin mit ihrem Leben schützen.",
		},
		["Text_1177"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberster Hexenmeister Xi''lun",
			["WAS"] = "Hergebracht? Aufgewacht? Wovon sprecht Ihr? Seid Ihr von Flammkin angegriffen worden?",
		},
		["Text_11"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Scharlachroter Wahrsager",
			["WAS"] = "Das Licht verdammt jeden, der Böses im Schilde führt. Ihr werdet jetzt sterben!",
		},
		["Text_1819"] = {
			["WAS"] = "Bauer... schlägt... Läufer...",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Schwarze Bischof",
			["ART"] = "SAY",
		},
		["Text_776"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hauptmann Arnath",
			["WAS"] = "Lieber sterbe ich, als einen weiteren Tag Reagenzien für diesen Irren Finkelstein zu besorgen!",
		},
		["Text_749"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fauldarm",
			["WAS"] = "Nein! Ihr tötet Stinki! Ihr jetzt dran!",
		},
		["Text_1653"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Katapultfahrer",
			["WAS"] = "Gehen wir. Haltet uns ja nur diese Steintroggs vom Leib.",
		},
		["Text_1461"] = {
			["WAS"] = "Bah! <hust> Zu starke Rauchentwicklung. <hust> Anscheinend habt Ihr zu viel Schildkrötenöl hinzugefügt! Versucht es noch einmal!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ingenieur Hexasept",
			["ART"] = "SAY",
		},
		["Text_925"] = {
			["WAS"] = "%s wirft sich in unruhigem Schlaf hin und her.",
			["SPRACHE"] = "NULL",
			["WER"] = "Naralex",
			["ART"] = "EMOTE",
		},
		["Text_1033"] = {
			["WAS"] = "Noch zwei Minuten! Wir haben es schon zur Hälfte geschafft, aber Ihr dürft jetzt nicht nachlassen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Belnistrasz",
			["ART"] = "YELL",
		},
		["Text_107"] = {
			["WAS"] = "Hört mit dem Gestupse auf, Mann!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["ART"] = "SAY",
		},
		["Text_1037"] = {
			["WAS"] = "Schließt Euch uns an oder geht für immer unter!",
			["SPRACHE"] = "NULL",
			["WER"] = "Spektraler Verräter",
			["ART"] = "SAY",
		},
		["Text_1172"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "General Thorg''izog",
			["WAS"] = "WAS? Kein besonderer Grund... es ist nur... etwas ist wirklich nicht in Ordnung mit meinem Magen. Ich glaube, es war etwas, was ich gegessen habe.",
		},
		["Text_1047"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Kreuzfahrerlord Valdelmar",
			["WAS"] = "Der Scharlachrote Kreuzzugs ist noch nicht vorüber! Der Untod ist nur ein kleiner Rückschlag!",
		},
		["Text_1989"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Calder Grau",
			["WAS"] = "Nein? Tja... mein Angebot gilt. Kommt einfach jederzeit vorbei und ich werde Euch mit Freuden die Generalüberholung verpassen, von der Ihr immer geträumt habt.",
		},
		["Text_1593"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Mor''norokk der Hasserfüllte",
			["WAS"] = "Was? Was habt Ihr getan? Wisst Ihr, was mir der Zwielichtrat antun wird, wenn sie erfahren, dass ich geredet habe? Lieber sterbe ich!",
		},
		["Text_1078"] = {
			["WAS"] = "Nein, nein, nein, Theldurin. Ihr erzählt die Geschichte falsch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lucien Knobelzang",
			["ART"] = "SAY",
		},
		["Text_1195"] = {
			["ART"] = "WHISPER",
			["SPRACHE"] = "NULL",
			["WER"] = "Portalwache der Horde",
			["WAS"] = "Was glaubt Ihr, was Ihr da tut?",
		},
		["Text_450"] = {
			["WAS"] = "Wir werden kein Pferd verlieren. Sieh sie dir an! Sie sehen noch ganz genauso aus, wie zu dem Zeitpunkt, als wir losgefahren sind.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_87"] = {
			["WAS"] = "Da kommt Zen''Kiki.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["ART"] = "SAY",
		},
		["Text_180"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "John J. Keeshan",
			["WAS"] = "Leinen los, Messner.",
		},
		["Text_2049"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Keely Dunwald",
			["WAS"] = "Schnappt es! Tötet es!",
		},
		["Text_2115"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Erzmagierin Rhydian",
			["WAS"] = "Wir jagen einen alten Gott, Brann.",
		},
		["Text_2200"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesschwinge",
			["WAS"] = "Sieh mich an und sieh den leibhaftigen Tod, den Weltenzerstörer.",
		},
		["Text_310"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["WAS"] = "Wo wollt Ihr hin, kleines Wesen?",
		},
		["Text_1861"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Feuerbärter Miliz",
			["WAS"] = "Ja, Sir!",
		},
		["Text_1112"] = {
			["WAS"] = "Aber.. aber...",
			["SPRACHE"] = "NULL",
			["WER"] = "Dampfschmied der Dunkeleisenzwerge",
			["ART"] = "SAY",
		},
		["Text_480"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["WAS"] = "Wandelt Ihr gewöhnlich allein auf diesen Straßen?",
		},
		["Text_613"] = {
			["WAS"] = "Wenn es sein muss, jage ich Euch bis ans Ende der Welt! Habt Ihr gehört? BIS ANS ENDE DER WELT!",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["ART"] = "SAY",
		},
		["Text_1272"] = {
			["WAS"] = "Auf in die Schlacht, Männer!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "YELL",
		},
		["Text_1668"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Steinvater Erzmantel",
			["WAS"] = "Ihr habt sowohl meinen Sohn als auch mich gerettet.",
		},
		["Text_1211"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Razelikh der Entweiher",
			["WAS"] = "Erlaubt mir, den Prozess ein wenig zu beschleunigen!",
		},
		["Text_761"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Karlishes",
			["WAS"] = "Karlishes bereitet ein Fischmahl zu!",
		},
		["Text_656"] = {
			["ART"] = "YELL",
