			["WER"] = "Lord Mark''gar",
			["WAS"] = "Die Geißel wird über diese Welt kommen wie ein Schwarm aus Tod und Zerstörung!",
		},
		["Text_716"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesbringer Saurfang",
			["WAS"] = "Mit jedem Krieger der Horde, den Ihr getötet habt, mit jedem dieser Allianzhunde, der fiel, wuchsen die Armeen des Lichkönigs. Selbst in diesem Moment erwecken die Val''kyr Eure Gefallenen als Diener der Geißel.",
		},
		["Text_1812"] = {
			["WAS"] = "Die Sonnenfinsternis steht bevor. Dunkelheit kriecht durch Erde und Asche. Die Meere sind blutrot...",
			["SPRACHE"] = "NULL",
			["WER"] = "Stammelnder Kultist",
			["ART"] = "SAY",
		},
		["Text_1136"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Mouton Flammenstern",
			["WAS"] = "Wir Ihr wünscht. Aber sorgt dafür, dass sie nicht zu Schaden kommen.",
		},
		["Text_1977"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Wisst Ihr, was man sagt... Wenn Ihr sie nicht besiegen könnt, schließt Euch Ihnen an. In diesem Fall werdet Ihr diese Wahl nicht haben! Schmelztiegel des Gemetzels, ich finde dich einfach anbetungswürdig.",
		},
		["Text_2104"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Ingenieur der Expedition",
			["WAS"] = "Gebt uns einen Moment, damit wir uns auf den Bau der Geschütze vorbereiten können.",
		},
		["Text_985"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Svala Grabesleid",
			["WAS"] = "Ich bin nicht so weit ge... kommen... um...",
		},
		["Text_1921"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hohepriesterin Azil",
			["WAS"] = "Meinem Tod werden Unzählige folgen. Diese Last müsst Ihr nun tragen.",
		},
		["Text_694"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Todeswisper",
			["WAS"] = "Genau wie der Meister es plante... Euer Ende ist unausweichlich…",
		},
		["Text_1344"] = {
			["WAS"] = "Geist des Lebens, schenkt mir Eure Hilfe!",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdheiler Duarn",
			["ART"] = "YELL",
		},
		["Text_364"] = {
			["WAS"] = "Ihr entdeckt einen Schmutzfleck an Deck!",
			["SPRACHE"] = "NULL",
			["WER"] = "Swabbing Duty Controller",
			["ART"] = "BOSS",
		},
		["Text_1592"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Mylra",
			["WAS"] = "Ach, Ihr wart ja nie in Gefahr, Schätzchen. Meine Freunde unten hätten Euch aufgefangen. Ihr seid lebend viel zu wertvoll.",
		},
		["Text_939"] = {
			["WAS"] = "HA! Lasst es uns wenigstens interessant gestalten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Baron Ashbury",
			["ART"] = "YELL",
		},
		["Text_802"] = {
			["WAS"] = "Nun gut, $N. Folgt mir zu der Höhle. Dort werde ich versuchen, die Macht des Runensteins in diese Brille zu bannen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Professor Prasseltrop",
			["ART"] = "SAY",
		},
		["Text_2203"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Calen",
			["WAS"] = "Lasst sie nicht aus den Augen! Schnell - kommt mit mir!",
		},
		["Text_136"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberst Trottmann",
			["WAS"] = "Wurde gefangen vor fünf Jahren von einem Bataillon stinkender, schweinischer Schwarzfelsorcs knapp fünf Klicks außerhalb der südlichen EMZ.",
		},
		["Text_1376"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Glimmertiefentaucher",
			["WAS"] = "Was zum... Widerlich!",
		},
		["Text_1453"] = {
			["WAS"] = "Die Zange X2 wird in Kürze einlaufen! Erhebt und formiert Euch, Jungs!",
			["SPRACHE"] = "NULL",
			["WER"] = "Chefingenieur Yoon",
			["ART"] = "YELL",
		},
		["Text_2221"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Hauptmann am Gipfel des Sieges",
			["WAS"] = "Aufgepasst!",
		},
		["Text_1507"] = {
			["WAS"] = "Ich fühle Verzweiflung in ihnen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_1910"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Millhaus Manasturm",
			["WAS"] = "Entweder Ihr seid für uns oder gegen uns! Folgt mir, wenn Ihr es wagt!",
		},
		["Text_969"] = {
			["WAS"] = "Mord wird doch niemals alt...",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Godfrey",
			["ART"] = "YELL",
		},
		["Text_1760"] = {
			["WAS"] = "Haltet sie auf! Wir können die Bindung beenden!",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdenrufer Torunskar",
			["ART"] = "YELL",
		},
		["Text_768"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Großer Schlamm",
			["WAS"] = "%s beginnt, instabiler zu werden!",
		},
		["Text_732"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Muradin Bronzebart",
			["WAS"] = "Ich... Ich kann das nicht tun. Kehrt zurück auf Euer Schiff und wir verschonen Euer Leben.",
		},
		["Text_1163"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["WAS"] = "Ihr könnt Euch nicht verstecken. Die Krankheit ist in Euch.",
		},
		["Text_868"] = {
			["WAS"] = "Gut gemacht! Ich bin froh, dass Rache an diesem Verräter geübt wurde. Geht voran und nehmt den Pfad, den Miran in Richtung Osten genommen hat und lasst Ausgrabungsleiter Eisenband wissen, dass wir bereit sind. Ich bin sicher, dass er ebenfalls Arbeit für Euch hat.",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Huldar",
			["ART"] = "SAY",
		},
		["Text_1"] = {
			["WAS"] = "Der Zeppelin zur Kriegshymnenfeste ist gerade angekommen! Alle an Bord in Richtung boreanische Tundra!",
			["SPRACHE"] = "NULL",
			["WER"] = "Grieb Rammrakete",
			["ART"] = "YELL",
		},
		["Text_787"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hauptmann Arnath",
			["WAS"] = "Ihr Narren habt es nie geschafft, vernünftige Fledermausflügel zu besorgen.",
		},
		["Text_1432"] = {
			["WAS"] = "Die Fürstin gab den Befehl, dass Ihr zum Tempel zurückkehrt. Verliert keine Zeit.",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegsmaid der Naz''jar",
			["ART"] = "SAY",
		},
		["Text_2108"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Brann Bronzebart",
			["WAS"] = "Ah! Dann müssen wir uns also mit dem Ding herumschlagen?",
		},
		["Text_1484"] = {
			["WAS"] = "Ich bin befreit! Lasst uns in Neptulons Namen Hallazeal töten, Makson.",
			["SPRACHE"] = "NULL",
			["WER"] = "Rachsüchtiger Strom",
			["ART"] = "YELL",
		},
		["Text_1758"] = {
			["WAS"] = "Aah...",
			["SPRACHE"] = "NULL",
			["WER"] = "Boldrich Steinreißer",
			["ART"] = "SAY",
		},
		["Text_1404"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verletzter freiwilliger Angreifer",
			["WAS"] = "Ihr seid zu gut, um wahr zu sein.",
		},
		["Text_178"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["WAS"] = "Anscheinend müssen wir einen Krieg gewinnen.",
		},
		["Text_736"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hauptmann Grondel",
			["WAS"] = "Die Kälte dieses Ortes lässt mir das Knochenmark gefrieren.",
		},
		["Text_953"] = {
			["WAS"] = "Eindringlinge in der Festung! Zu den Waffen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kommandant Grüntal",
			["ART"] = "YELL",
		},
		["Text_831"] = {
			["WAS"] = "Nicht einmal ein Jahr ist es her, dass der arme, alte Fitzsimmons von uns gegangen ist. Der Alkohol hatte ihn schleichend dahingerafft.",
			["SPRACHE"] = "NULL",
			["WER"] = "Glorin Stahlbraue",
			["ART"] = "SAY",
		},
		["Text_794"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Valithria Traumwandler",
			["WAS"] = "Ich habe ein Portal in den Traum geöffnet. Darin liegt Eure Erlösung, Helden...",
		},
		["Text_1481"] = {
			["WAS"] = "Beine lasst mich jetzt nicht im Stich!",
			["SPRACHE"] = "NULL",
			["WER"] = "Leutnant \"Foxi\" Topper",
			["ART"] = "YELL",
		},
		["Text_2176"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Leutnant von Hochstade",
			["WAS"] = "Erwarten Eure Befehle.",
		},
		["Text_2245"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Plünderer der Klingenmähnen",
			["WAS"] = "%s ist gefesselt!",
		},
		["Text_746"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Muradin Bronzebart",
			["WAS"] = "Sofort, Euer Majestät!",
		},
		["Text_1959"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Der große Schmelztiegel des Gemetzels erwartet Euch, Yôda. Denkt dran: Sobald der Kampf begonnen hat, müsst Ihr in der Arena bleiben. SIEGT ODER STERBT!",
		},
		["Text_1790"] = {
			["WAS"] = "Ihr könnt wahrlich mit Leuten umgehen, $N. Sie fürchten und respektieren Euch.",
			["SPRACHE"] = "NULL",
			["WER"] = "Anduin Wrynn",
			["ART"] = "SAY",
		},
		["Text_1888"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Donnelly Dunwald",
			["WAS"] = "Schnäbelchen! Komm zurück zu Donnelly. Donnelly passt auf dich auf!",
		},
		["Text_367"] = {
			["WAS"] = "Die Flecken erscheinen in immer kürzeren Abständen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Swabbing Duty Controller",
			["ART"] = "BOSS",
		},
		["Text_1513"] = {
			["WAS"] = "Unmöglich, Sir! Die Strömung ist zu stark!",
			["SPRACHE"] = "NULL",
			["WER"] = "Fähnrich Ebbert",
			["ART"] = "SAY",
		},
		["Text_1875"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtsturmbändiger",
			["WAS"] = "Ihr zögert nur das Unvermeidliche hinaus!",
		},
		["Text_891"] = {
			["WAS"] = "NEEEIINNN!!!",
			["SPRACHE"] = "NULL",
			["WER"] = "Goblinhandwerker",
			["ART"] = "YELL",
		},
		["Text_1550"] = {
			["WAS"] = "Ich hoffe, Ihr habt einen starken Magen! Das Reisen durch die Bresche ist nichts für schwache Nerven.",
			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["ART"] = "SAY",
		},
		["Text_1806"] = {
			["WAS"] = "Ich werde zurück in den Thronsaal gehen und ein Auge auf Samuelson werfen, während Ihr mit Mathias sprecht. Seid vorsichtig!",
			["SPRACHE"] = "NULL",
			["WER"] = "Anduin Wrynn",
			["ART"] = "SAY",
		},
		["Text_1348"] = {
			["WAS"] = "Erdheiler Duarn scharrt unbehaglich mit den Füßen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdheiler Duarn",
			["ART"] = "EMOTE",
		},
		["Text_1604"] = {
			["WAS"] = "Schmiedemeister! Ich höre, der Feind hat Eure Operationen sabotiert. Wo ist das Fragment?",
			["SPRACHE"] = "NULL",
			["WER"] = "Hohepriesterin Azil",
			["ART"] = "YELL",
		},
		["Text_1734"] = {
			["WAS"] = "Hier ist also der \"Champion\".",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["ART"] = "SAY",
		},
		["Text_1881"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Cayden Dunwald",
			["WAS"] = "Ich weiß, dass sich noch mehr von Euch in ihren kleinen Löchern verstecken...",
		},
		["Text_991"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Skadi der Skrupellose",
			["WAS"] = "Ihr räudigen Halunken! Eure Leichen werden feine Appetithappen für meinen neuen Drachen abgeben!",
		},
		["Text_371"] = {
			["WAS"] = "Tote stehlen keine Limetten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Limettendieb",
			["ART"] = "SAY",
		},
		["Text_1333"] = {
			["WAS"] = "Ich kann nicht vernichtet werden... Nur... verzö... gert.",
			["SPRACHE"] = "NULL",
			["WER"] = "Aszendentenfürst Obsidius",
			["ART"] = "YELL",
		},
		["Text_1197"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "Dämonisch",
			["WER"] = "Loramus'' Leichnam",
			["WAS"] = "Romathis Zilthuras ",
		},
		["Text_590"] = {
			["WAS"] = "Mal''ganis macht es uns nicht leicht.",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["ART"] = "SAY",
		},
		["Text_1784"] = {
			["WAS"] = "Kann ich Euch bei den Ermittlungen gegen den Schattenhammerklan behilflich sein? Wir müssen meinem Vater nichts sagen...",
			["SPRACHE"] = "NULL",
			["WER"] = "Anduin Wrynn",
			["ART"] = "WHISPER",
		},
		["Text_1273"] = {
			["WAS"] = "Für Sturmwind!",
			["SPRACHE"] = "NULL",
			["WER"] = "Soldat von Sturmwind",
			["ART"] = "YELL",
		},
		["Text_1460"] = {
			["WAS"] = "Die Bestie ist entkommen! Bei Mekkadrills Bart, das ging schnell!",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberleutnant Wiley",
			["ART"] = "SAY",
		},
		["Text_567"] = {
			["WAS"] = "Ahhh... RAAAAAH! Hätte nie gedacht... ich wäre einmal frei von ihm...",
			["SPRACHE"] = "NULL",
			["WER"] = "Anub''arak",
			["ART"] = "YELL",
		},
		["Text_1532"] = {
			["WAS"] = "Hier ist es! Der Eingang zu Neptulons Reich...",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "YELL",
		},
		["Text_2143"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "General Husam",
			["WAS"] = "Siamat darf nicht befreit werden! Kehrt um, es ist noch nicht zu spät!",
		},
		["Text_560"] = {
			["WAS"] = "%s gerät in Raserei!",
			["SPRACHE"] = "NULL",
			["WER"] = "Krik''thir der Torwächter",
			["ART"] = "BOSS",
		},
		["Text_90"] = {
			["WAS"] = "Gestaltwandel! Hier ist es, Mann!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["ART"] = "SAY",
		},
		["Text_824"] = {
			["WAS"] = "Khaz Modan wird fallen! ALLES WIRD IN SEINEM NAMEN VERNICHTET WERDEN!",
			["SPRACHE"] = "NULL",
			["WER"] = "Drungeld Finsterblick",
			["ART"] = "SAY",
		},
		["Text_201"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["WAS"] = "Achtung! SPRENGLADUNG!",
		},
		["Text_1402"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Ingenieur Hexasept",
			["WAS"] = "Jagt sie so richtig in die Luft!",
		},
		["Text_1124"] = {
			["WAS"] = "Auf Euch warten nur noch Schmerzen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Priester Letherio",
			["ART"] = "SAY",
		},
		["Text_1606"] = {
			["WAS"] = "Gut gemacht. Trefft mich im Steinernen Kern, um weitere Befehle zu erhalten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Hohepriesterin Azil",
			["ART"] = "SAY",
		},
		["Text_1422"] = {
			["WAS"] = "Und los gehts!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ingenieur Hexasept",
			["ART"] = "SAY",
		},
		["Text_946"] = {
			["WAS"] = "Zügelt Euren Eifer! Wir sind vor allem hier, weil wir Godfreys Kopf wollen. Genießt die Verderbnisse des Krieges später!",
			["SPRACHE"] = "NULL",
			["WER"] = "Rudelführer Ivar Blutfang",
			["ART"] = "SAY",
		},
		["Text_1025"] = {
			["WAS"] = "Oha!",
			["SPRACHE"] = "NULL",
			["WER"] = "Wache Slip''kik",
			["ART"] = "SAY",
		},
		["Text_666"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Muradin Bronzebart",
			["WAS"] = "Macht die Himmelsbrecher für den Angriff auf die Zitadelle bereit!",
		},
		["Text_1735"] = {
			["WAS"] = "So klein. So zart. Ein Wunder, dass Ihr hier unten so lange überlebt habt, Fleischling.",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["ART"] = "SAY",
		},
		["Text_1448"] = {
			["WAS"] = "Vorwärts! Haltet die Brücke!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Naz''jar",
			["ART"] = "SAY",
		},
		["Text_1494"] = {
			["WAS"] = "Munition bereit!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ingenieur Hexasept",
			["ART"] = "SAY",
		},
		["Text_1450"] = {
			["WAS"] = "Vernichtet sie alle! Keine Gnade, meine Brüder!",
			["SPRACHE"] = "NULL",
			["WER"] = "Tiefenlord Zin''jatar",
			["ART"] = "YELL",
		},
		["Text_1829"] = {
			["WAS"] = "Flintlocke, wenn wir doch schon eine riesige Kanone haben, warum feuern wir dann nicht eine... Kanonenkugel ab?",
			["SPRACHE"] = "NULL",
			["WER"] = "\"Doc\" Schweitzer",
			["ART"] = "SAY",
		},
		["Text_1646"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Katapultfahrer",
			["WAS"] = "Wie fühlt sich das an, Steintroggabschaum?!",
		},
		["Text_1601"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Versklavter Minenarbeiter",
			["WAS"] = "Ich hörte, dass der Schmiedemeister Aufzeichnungen über seine Treffen in einem Buch im Turm aufbewahrt, der das Lager überschaut.",
		},
		["Text_1122"] = {
			["WAS"] = "Ihr werdet ein gutes Opfer für Ragnaros abgeben.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtverehrer",
			["ART"] = "SAY",
		},
		["Text_225"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Osborn Grausikus",
			["WAS"] = "Woo hoo.",
		},
		["Text_228"] = {
			["ART"] = "SAY",
