			["SPRACHE"] = "NULL",
			["WER"] = "Nimmersatt",
			["WAS"] = "%s bekommt allmählich wirklich Hunger!",
		},
		["Text_2255"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gefangene Klingenmähne",
			["WAS"] = "Uff! Ich nichts sagen!",
		},
		["Text_1951"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Cliff Donnermar",
			["WAS"] = "Colin versammelt die Einwohner Donnermars für einen schonungslosen Angriff auf Stopfwampes Anhöhe.",
		},
		["Text_1771"] = {
			["WAS"] = "Sammelt Eure Verletzten ein und dankt mir dadurch, dass Ihr geht.",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["ART"] = "SAY",
		},
		["Text_919"] = {
			["WAS"] = "Ich muss die notwendigen Vorbereitungen treffen, bevor das Erweckungsritual beginnen kann. Ihr müsst mich beschützen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Muyoh",
			["ART"] = "SAY",
		},
		["Text_137"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberst Trottmann",
			["WAS"] = "Gefoltert und als lebendes Urinal für junge Orckrieger missbraucht. FÜNF JAHRE LANG.",
		},
		["Text_997"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "König Ymiron",
			["WAS"] = "Björn vom Schwarzen Sturm! Beehrt mich nun mit Eurer Anwesenheit!",
		},
		["Text_675"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Mark''gar",
			["WAS"] = "Der einzige Ausweg ist der Tod!",
		},
		["Text_2238"] = {
			["WAS"] = "Jämmerliches Fleisch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Cho''gall",
			["ART"] = "YELL",
		},
		["Text_140"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberst Trottmann",
			["WAS"] = "Er ist am Leben und hat die vergangenen fünf Monate als Verbannter in Seenhain verbracht. Oder habt Ihr es nicht gewusst? Genug geredet. Wir müssen Leute retten!",
		},
		["Text_1225"] = {
			["WAS"] = "Härtester Kampf meines Lebens...",
			["SPRACHE"] = "NULL",
			["WER"] = "Soldat von Sturmwind",
			["ART"] = "SAY",
		},
		["Text_2289"] = {
			["WAS"] = "%s erscheint mit einem ohrenbetäubenden Schrei über Euch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Blaithe",
			["ART"] = "EMOTE",
		},
		["Text_114"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Bürger des Rotkammgebirges",
			["WAS"] = "Ohne Gerechtigkeit kein Friede!",
		},
		["Text_795"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Valithria Traumwandler",
			["WAS"] = "Meine Kraft kehrt zurück. Macht weiter, Helden!",
		},
		["Text_2034"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kurdran Wildhammer",
			["WAS"] = "Zweifelt niemals daran. Hier, erlaubt mir, Euch ein Hochzeitsgeschenk zu überreichen.",
		},
		["Text_329"] = {
			["WAS"] = "Jin''do der Verhexer! Es ist schon eine Weile her, dass ich diese Maske sah.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zanzil der Ausgestoßene",
			["ART"] = "SAY",
		},
		["Text_156"] = {
			["WAS"] = "Ihr habt gewonnen. Dieses Mal.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lehrling von Herdweiler",
			["ART"] = "SAY",
		},
		["Text_1616"] = {
			["WAS"] = "$C, hier herüber.",
			["SPRACHE"] = "NULL",
			["WER"] = "Schiefer Treibsand",
			["ART"] = "SAY",
		},
		["Text_1115"] = {
			["WAS"] = "Warum musste es... ein stinkender Oger sein...",
			["SPRACHE"] = "NULL",
			["WER"] = "Dampfschmied der Dunkeleisenzwerge",
			["ART"] = "SAY",
		},
		["Text_949"] = {
			["WAS"] = "Verlasst sofort diesen verwünschten Ort!",
			["SPRACHE"] = "NULL",
			["WER"] = "Baron Silberlein",
			["ART"] = "YELL",
		},
		["Text_673"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Mark''gar",
			["WAS"] = "%s erschafft einen wirbelnden Knochensturm!",
		},
		["Text_1552"] = {
			["WAS"] = "Es geht los! Haltet Euch fest!",
			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["ART"] = "YELL",
		},
		["Text_2056"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Die entfesselte Bestie",
			["WAS"] = "Uulwi gag erh''ongg w''ssh.",
		},
		["Text_1351"] = {
			["WAS"] = "Nun seht zzzu, wie ich das Ritual vollende und die Bestie auf Euch hetzzze!",
			["SPRACHE"] = "NULL",
			["WER"] = "Aufseher Idra''kess",
			["ART"] = "YELL",
		},
		["Text_1573"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erster Maat Mürrisch",
			["WAS"] = "Habt Dank... Das gibt uns ein paar weitere Stunden, in denen wir nicht auf die Felsen laufen. Danach gibt''s keine Garantie.",
		},
		["Text_1681"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Mylra",
			["WAS"] = "Hatte schon geglaubt, man hätte uns hier draußen vergessen. Danke für die Hilfeleistung!",
		},
		["Text_2037"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kurdran Wildhammer",
			["WAS"] = "Ich lasse keinen Einspruch gelten, das Ei gehört Euch. Ich möchte, dass Ihr erkennt, wie sehr mir diese Verbindung am Herzen liegt.",
		},
		["Text_2211"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["WAS"] = "Unmöglich!",
		},
		["Text_1074"] = {
			["WAS"] = "Schlag ins Gesicht!",
			["SPRACHE"] = "NULL",
			["WER"] = "Theldurin der Verirrte",
			["ART"] = "SAY",
		},
		["Text_278"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Feuerwache Glutseher",
			["WAS"] = "Ha! Ha! Ha! Danke, dass Ihr mich befreit habt, ihr Dummköpfe. Ich werde es Euch vergelten, indem ich Euch das Fleisch von den Knochen brenne.",
		},
		["Text_1462"] = {
			["WAS"] = "Ihr habt Recht, viel zu schwach. Es braucht mehr Schiffshalteröl. Versucht es noch einmal!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ingenieur Hexasept",
			["ART"] = "SAY",
		},
		["Text_1840"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gestrandetes Besatzungsmitglied",
			["WAS"] = "Wie ein Engel...",
		},
		["Text_1148"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gemeißelter Golem",
			["WAS"] = "Besiegt. Schamstufe: Hoch. Passe Strategie für zukünftige Schlachten an.",
		},
		["Text_1624"] = {
			["WAS"] = "Steine der Erde, gehorcht dem Ruf des Schattenhammers!",
			["SPRACHE"] = "NULL",
			["WER"] = "Schamane der Schwärze",
			["ART"] = "SAY",
		},
		["Text_321"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["WAS"] = "Wenn Ihr die NERVEN habt, zurückzukommen, solltet Ihr besser vorbereitet sein. Denn Jin''do hat eine Überraschung für Euch...",
		},
		["Text_1769"] = {
			["WAS"] = "Ich danke Euch, Steinmutter. Es war eine Ehre...",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdheilerin Norsala",
			["ART"] = "SAY",
		},
		["Text_1188"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kasim Sharim",
			["WAS"] = "Das Blutritual ist nun abgeschlossen... und nun kann ich erkennen, wo die drei Amulette Euch erwarten.",
		},
		["Text_1801"] = {
			["WAS"] = "He, $N, wir dürfen meinem Vater nichts von diesem Hinterhalt erzählen. Wenn er von diesem Anschlag auf mich erfährt, erlaubt er mir nie wieder, die Burg zu verlassen...",
			["SPRACHE"] = "NULL",
			["WER"] = "Anduin Wrynn",
			["ART"] = "SAY",
		},
		["Text_314"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["WAS"] = "Ihr habt Glück, dass ich Euch nicht jetzt sofort tötet... sondern dass ich größere Pläne mit Euch habe.",
		},
		["Text_2223"] = {
			["WAS"] = "Ich muss hier mal was klarstellen... Wir sind nicht Euer Kutschierdienst!",
			["SPRACHE"] = "NULL",
			["WER"] = "Vandale der Wildhämmer",
			["ART"] = "SAY",
		},
		["Text_1574"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Geist eines erschlagenen Besatzungsmitglieds",
			["WAS"] = "Ich hörte, wie sie zu ihren dunklen Göttern beten, als alles schwarz wurde... Es ist das Werk des Schattenhammerkults!",
		},
		["Text_971"] = {
			["WAS"] = "Seid gegrüßt, Bürger. Ich rate Euch, zuerst mit Wachhauptmann Parker zu sprechen. Er ist im Moment oben auf dem Turm.",
			["SPRACHE"] = "NULL",
			["WER"] = "Garnisonswachmann des Rotkammgebirges",
			["ART"] = "SAY",
		},
		["Text_196"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["WAS"] = "Das Rotkammgebirge wird sich erholen, aber die Orcs bestimmt nicht...",
		},
		["Text_1575"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Geist eines erschlagenen Besatzungsmitglieds",
			["WAS"] = "Sie haben unsere Vorräte vergiftet... Wir hatten die ganze Zeit Kultisten an Bord...",
		},
		["Text_1889"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Donnelly Dunwald",
			["WAS"] = "Komm zurück, Schnäbelchen! Tu dir nicht weh!",
		},
		["Text_1970"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Hier sind wir wieder, meine Damen und Herren. Der epische Kampf um Leben und Tod im Schmelztiegel des Gemetzels! In dieser Runde kämpft Titanios gegen... einen dicker, fetter Oger? Wartet, ernsthaft?! Das ist alles, was uns so kurzfristig eingefallen ist? Wofür bezahle ich Euch?",
		},
		["Text_1168"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Drachenlord Neeralak",
			["WAS"] = "Ich werde die schlafenden Wichtel wohl einfach... hier liegen lassen? Sind das überhaupt... Wichtel?",
		},
		["Text_1544"] = {
			["WAS"] = "Wir haben eine tragische Niederlage erlitten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_1757"] = {
			["WAS"] = "Todesschwinge wird sich mit Eurer Steinmutter vergnügen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Boldrich Steinreißer",
			["ART"] = "SAY",
		},
		["Text_167"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Renegat des Schwarzfels",
			["WAS"] = "Lok maka zaga Makogg kag kil Moth''kazoroth ",
		},
		["Text_1710"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Haethen Kaul",
			["WAS"] = "Das Tor der Titanen ist beinahe geöffnet. Wir werden den Tol''vir helfen, die Pyramide in Uldum umzufunktionieren und somit allem Leben in Azeroth ein Ende zu setzen!",
		},
		["Text_936"] = {
			["WAS"] = "Der Hund starrt verständnislos auf die Wand...",
			["SPRACHE"] = "NULL",
			["WER"] = "Tollwütiger Mastiff",
			["ART"] = "EMOTE",
		},
		["Text_964"] = {
			["WAS"] = "Ich weiß nicht, warum die Tür verschlossen ist, Helden. Mein Rudel sollte sich inzwischen um Godfrey gekümmert haben...",
			["SPRACHE"] = "NULL",
			["WER"] = "Rudelführer Ivar Blutfang",
			["ART"] = "SAY",
		},
		["Text_1117"] = {
			["WAS"] = "Ich kann meine Beine nicht mehr spüren...",
			["SPRACHE"] = "NULL",
			["WER"] = "Dampfschmied der Dunkeleisenzwerge",
			["ART"] = "SAY",
		},
		["Text_2252"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gefangene Klingenmähne",
			["WAS"] = "Ich sage nichts!",
		},
		["Text_569"] = {
			["WAS"] = "Oh nein! Abenteurer, etwas Schreckliches ist geschehen! Einer meiner Kollegen ist vom ewigen Drachenschwarm gefangengenommen worden und sie tun ihm furchtbare Dinge an! Arthas hat noch immer die höchste Priorität, doch könntet Ihr helfen, den Wächter der Zeit zu retten, wenn Ihr schnell genug handelt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Chromie",
			["ART"] = "WHISPER",
		},
		["Text_563"] = {
			["WAS"] = "%s kommt durch den Tunnel!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hadronox",
			["ART"] = "BOSS",
		},
		["Text_1563"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Magmazahn",
			["WAS"] = "NEEEIIIN! Sagt Goldmine, dass er ein toter Goblin ist! Unser Vertrag ist abgelaufen.",
		},
		["Text_1129"] = {
			["WAS"] = "Ich wusste, dass die Thoriumbruderschaft durchkommen würde!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sklavenarbeiter",
			["ART"] = "SAY",
		},
		["Text_293"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Solakar Feuerkrone",
			["WAS"] = "Ich bin hier! Jetzt, ihr elenden kleinen Würmer, werdet ihr für euer Eindringen bezahlen!",
		},
		["Text_1393"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Naz''jar",
			["WAS"] = "Lady Vashj ähnelt ihrer Mutter gar nicht. Kein Wunder, dass sie die Stadt vor langem verließ.",
		},
		["Text_1259"] = {
			["WAS"] = "Ihr dient, oder Ihr sterbt, Weichhaut!",
			["SPRACHE"] = "NULL",
			["WER"] = "Räuber des Zin''jatar",
			["ART"] = "SAY",
		},
		["Text_2165"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Budd",
			["WAS"] = "SEHT MICH AN!!! ICH BIN EIN MANATAURUS!!!",
		},
		["Text_1967"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Der große Schmelztiegel des Gemetzels erwartet Euch, Chloris. Denkt dran: Sobald der Kampf begonnen hat, müsst Ihr in der Arena bleiben. SIEGT ODER STERBT!",
		},
		["Text_788"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Crok Geißelbann",
			["WAS"] = "Ich lenke sie ab. Schickt unsere Brüder zurück ins Grab, dann helft mir, sie zu töten!",
		},
		["Text_126"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Gebändigter Schluchtettin",
			["WAS"] = "TSCHÜSS VATI!",
		},
		["Text_2038"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kurdran Wildhammer",
			["WAS"] = "Und wie sehr der Allianz die Angelegenheiten des Wildhammerklans am Herzen liegen!",
		},
		["Text_1097"] = {
			["WAS"] = "Seht Ihr? Nicht töten Spinne für Gift. Einfach reiten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lunk",
			["ART"] = "SAY",
		},
		["Text_222"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oliver Harris",
			["WAS"] = "Nur wenn Ihr ihn laufen lasst, werdet Ihr Euch von den Bestien unterscheiden, mein Freund.",
		},
		["Text_48"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Zurückgezogene Seele",
			["WAS"] = "Verschwindet von hier!",
		},
		["Text_346"] = {
			["WAS"] = "Zanzil! Macht mit Venoxis kurzen Prozess und dann reden wir über Eure Fehlschläge.",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["ART"] = "YELL",
		},
		["Text_1763"] = {
			["WAS"] = "Ma''haat, vernichtet dieses Gesindel. Ich kümmere mich um die Priesterin.",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["ART"] = "YELL",
		},
		["Text_1203"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kasim Sharim",
			["WAS"] = "Nieder mit dem König!",
		},
		["Text_1292"] = {
			["WAS"] = "Was bringt Ihr uns? Kostbarkeiten von der Erdoberfläche?",
			["SPRACHE"] = "NULL",
			["WER"] = "Hamsterer der Gilblin",
			["ART"] = "SAY",
		},
		["Text_1085"] = {
			["WAS"] = "Juchhe! Martek hat mich ausgewählt!",
			["SPRACHE"] = "NULL",
			["WER"] = "$Renverehrerin",
			["ART"] = "SAY",
		},
		["Text_706"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochfürst Saurfang",
			["WAS"] = "Das ist nicht Euer Kampf, Zwerg. Zieht Euch zurück oder wir müssen Euer Schiff zerstören.",
		},
		["Text_819"] = {
			["WAS"] = "Kagg zugas kil Kagg kaz Kaz''goth''no Makogg osh''kazil Ogerin ",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Zenturio des Drachenmals",
			["ART"] = "SAY",
		},
		["Text_1023"] = {
			["WAS"] = "Verdammt sollt ihr alle sein, sterbliche Wesen! All meine Rachepläne, all mein Hass... ich werde mich rächen...",
			["SPRACHE"] = "NULL",
			["WER"] = "Balnazzar",
			["ART"] = "SAY",
		},
		["Text_1262"] = {
			["WAS"] = "Kommt, Weichhaut. Wir haben Arbeit für Euch.",
			["SPRACHE"] = "NULL",
			["WER"] = "Räuber des Zin''jatar",
			["ART"] = "SAY",
		},
		["Text_416"] = {
			["WAS"] = "Verräter! Eher sterbe ich, bevor ich Euch mein Schiff überlasse!",
			["SPRACHE"] = "NULL",
			["WER"] = "Flottenmeister Firallon",
			["ART"] = "YELL",
		},
		["Text_1408"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verletzter freiwilliger Angreifer",
			["WAS"] = "Wie es aussieht, stehe ich erneut in Eurer Schuld.",
		},
		["Text_207"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Barkeeper Hann",
			["WAS"] = "Tretet vor und befeuchtet Eure Kehle.",
		},
		["Text_679"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Todeswisper",
			["WAS"] = "Ihr fandet hierher, weil Ihr zu denen gehört, die in einer mit Blindheit gestraften Welt sehen können.",
		},
		["Text_1553"] = {
			["WAS"] = "Sieht aus, als hättet Ihr es geschafft. Gut!",
			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["ART"] = "SAY",
		},
