			["ART"] = "SAY",
		},
		["Text_224"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Ratsherr Mühlenstein",
			["WAS"] = "Im Wald wimmelt es nur so von Worgen und Ghulen. Es muss etwas geschehen!",
		},
		["Text_298"] = {
			["WAS"] = "Willkommen. Kann ich Euch bei der Suche nach etwas behilflich sein?",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kyra Boucher",
			["ART"] = "SAY",
		},
		["Text_653"] = {
			["WAS"] = "Als der Anführer der Sonnenhäscher erfüllt es mich mit großem Stolz, Xaylor als den neuen Träger von Quel''Delar präsentieren zu können!",
			["SPRACHE"] = "NULL",
			["WER"] = "Erzmagier Aethas Sonnenhäscher",
			["ART"] = "YELL",
		},
		["Text_1770"] = {
			["WAS"] = "Ihr habt Euer Wort gehalten, Erdheilerin. Deswegen werde ich Euch verschonen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["ART"] = "SAY",
		},
		["Text_1144"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Thelaron Düsternadel",
			["WAS"] = "Das... Das ist perfekt! Diese Verkleidung wird mein Meisterwerk!",
		},
		["Text_194"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Jorgensen",
			["WAS"] = "Ab und zu treffen wir auf einen einzelnen Orc, der zwischen uns und dem Sieg steht. In solchen Situationen verwendet man am besten Chloroform. Denkt aber daran, dass wir beim Einsatz von Chloroform hinter dem Feind stehen müssen.",
		},
		["Text_1330"] = {
			["WAS"] = "Ihr sucht Antworten? So holt sie Euch! Dies ist Eure Antwort auf das Leben!",
			["SPRACHE"] = "NULL",
			["WER"] = "Aszendentenfürst Obsidius",
			["ART"] = "YELL",
		},
		["Text_449"] = {
			["WAS"] = "Das hier ist ein heißes Pflaster, Gidwin. Ich will nicht riskieren, ein Pferd zu verlieren.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["ART"] = "SAY",
		},
		["Text_566"] = {
			["WAS"] = "Uunak-hissss tik-k-k-k-k!",
			["SPRACHE"] = "NULL",
			["WER"] = "Anub''arak",
			["ART"] = "YELL",
		},
		["Text_1667"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Flint Erzmantel",
			["WAS"] = "Dieser Held hier vertritt den Irdenen Ring. Sie brauchen das mittlere Fragment.",
		},
		["Text_3"] = {
			["WAS"] = "Der Zeppelin nach Unterstadt ist soeben eingetroffen! Wer nach Tirisfal will, sollte an Bord gehen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Frezza",
			["ART"] = "YELL",
