			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["ART"] = "SAY",
		},
		["Text_721"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesbringer Saurfang",
			["WAS"] = "BEI DER MACHT DES LICHKÖNIGS!",
