		},
		["Text_62"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Thassarian",
			["WAS"] = "Aber Ihr müsst Euch über eins bewusst sein, Koltira: Wir sind nicht länger Brüder. Ihr seid jetzt ein Mitglied der Horde und ich gehöre der Allianz an.",
