			["WER"] = "Donna",
			["ART"] = "SAY",
		},
		["Text_117"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Nida",
			["WAS"] = "Ich beherrsche die Katzensprache. Effsee sagte danke.",
		},
		["Text_1349"] = {
			["WAS"] = "Nichts geschieht... Etwas muss mich daran hindern, mit ihr zu sprechen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdheiler Duarn",
			["ART"] = "SAY",
		},
		["Text_586"] = {
			["WAS"] = "Mal''Ganis scheint mehr als nur die Geißel in seinem Arsenal zu haben. Wir sollten uns beeilen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["ART"] = "SAY",
		},
		["Text_262"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Rhonin",
			["WAS"] = "Er fand eine Welt vor, deren Völker nicht mehr den Blaupausen der Titanen entsprachen. Eine Welt, in der nicht alles nach Plan gelaufen war.",
		},
		["Text_695"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verteidiger der Himmelsbrecher",
			["WAS"] = "Ihr seid genau im rechten Moment gekommen, Helden. Die Orgrims Hammer ist bereits abgeflogen. Schnell, zur Himmelsbrecher! Eilt Euch und ihr könnt sie einholen.",
		},
		["Text_829"] = {
			["WAS"] = "Das Auge von Paleth wurde schon vor langer Zeit wiedergewonnen und gereinigt, $C. Wir dachten, der Fluch wäre aufgehoben.",
			["SPRACHE"] = "NULL",
			["WER"] = "Glorin Stahlbraue",
			["ART"] = "SAY",
		},
		["Text_875"] = {
			["WAS"] = "Glubtok zeigt Euch arkane Macht!",
			["SPRACHE"] = "NULL",
			["WER"] = "Glubtok",
			["ART"] = "YELL",
		},
		["Text_2230"] = {
			["WAS"] = "DA IST NICHTS AUSSER DIESEM NEBEL!",
			["SPRACHE"] = "NULL",
			["WER"] = "Schädelberster der Berg",
			["ART"] = "YELL",
		},
		["Text_2154"] = {
