			["SPRACHE"] = "NULL",
			["WER"] = "Siamat",
			["WAS"] = "Der Himmel... lockt…",
		},
		["Text_2126"] = {
			["WAS"] = "Nein, nein, dummer $R...",
			["SPRACHE"] = "NULL",
			["WER"] = "Adarrah",
			["ART"] = "SAY",
		},
		["Text_1805"] = {
			["WAS"] = "Das stimmt alles nicht. Hierunter befindet sich nichts über den Schattenhammerklan. Worauf spielt Samuelson an?",
