			["ART"] = "SAY",
		},
		["Text_748"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Modermiene",
			["WAS"] = "Was? Schatz? NEEEEEIIIINN!!!",
		},
		["Text_2025"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Russell Brower",
			["WAS"] = "Feuerbart und seine Fanny sind zusammen, im Speziellen wie im Allgemeinen.",
		},
		["Text_1885"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Cayden Dunwald",
			["WAS"] = "Auf Caydens Axt steht Euer Name!",
		},
		["Text_1359"] = {
			["WAS"] = "Kil Gesh maka Rath''is ",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Versklavter Perlenminenarbeiter der Horde",
			["ART"] = "SAY",
		},
		["Text_216"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Lauernder Worgen",
			["WAS"] = "Bibbers...",
		},
		["Text_1365"] = {
			["WAS"] = "Sie bauen meine Perlen ab, malträtieren meinen Körper mit Schnitten und quälen meinen Geist. Ich kann förmlich spüren, wie mein Wille bricht, Fremdlinge... sie wollen mich im Krieg verwenden!",
			["SPRACHE"] = "NULL",
			["WER"] = "Stimme von Nespirah",
			["ART"] = "SAY",
		},
		["Text_1960"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Der Schattenhammer: immer erfreut, den örtlichen ruchlosen Intrigen zu dienen, jederzeit, überall. Und heute ist keine Ausnahme! Unser letzter Kämpfer grüßt aus der Bastion des Zwielichts! Oder der Zwielichtbastion... ach, wen interessiert''s!",
		},
		["Text_1713"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Gorgonit",
			["WAS"] = "Die Augen von %s beginnen zu glühen. In Deckung, schnell!",
		},
		["Text_414"] = {
			["WAS"] = "So wittern, markieren, zerfetzen wir sie, singt mit, ihr Hunde, ah-uuuh!",
			["SPRACHE"] = "NULL",
			["WER"] = "Trunkenbold der Trümmerflut",
			["ART"] = "SAY",
		},
		["Text_124"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gebändigter Schluchtettin",
			["WAS"] = "Wohin werfen? AUF BRÜCKE WERFEN?",
		},
		["Text_1791"] = {
			["WAS"] = "Warum fragt Ihr mich? Ich schleppe bloß Kisten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Dockarbeiter von Sturmwind",
			["ART"] = "SAY",
		},
		["Text_2241"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Managespenst",
			["WAS"] = "%s zerbirst und überschüttet die Umgebung mit arkanem Überschuss!",
		},
		["Text_81"] = {
			["WAS"] = "Schneidet es heraus!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["ART"] = "SAY",
		},
		["Text_849"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Amnennar der Kältebringer",
			["WAS"] = "Zu mir, meine Diener!",
		},
		["Text_179"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Danforth",
			["WAS"] = "HIER KOMMT DER SCHMERZ!",
		},
		["Text_1171"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberster Hexenmeister Xi''lun",
			["WAS"] = "Wir sind fast bereit, diesen Kampf zu beginnen, Brüder. Thorg''izog, was ist los? Warum bedeckt Ihr Euer Hinterteil auf diese Art und Weise?",
		},
		["Text_1745"] = {
			["WAS"] = "Genau das werden wir also tun. Ihr habt unseren Dank, Steinmutter.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdenrufer Torunskar",
			["ART"] = "SAY",
		},
		["Text_581"] = {
			["WAS"] = "Ah, Ihr seid endlich da, Prinz Arthas. Ihr kommt gerade noch rechtzeitig.",
			["SPRACHE"] = "NULL",
			["WER"] = "Bürger von Stratholme",
			["ART"] = "SAY",
		},
		["Text_1218"] = {
			["WAS"] = "Wenn Ihr mich fragt... die Bestie ist verrückt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Soldat von Sturmwind",
			["ART"] = "SAY",
		},
		["Text_2181"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Leutnant von Hochstade",
			["WAS"] = "Es ist nie einfach ganz einfach, oder? Aber ist schon in Ordnung, wir sind vorbereitet.",
		},
		["Text_439"] = {
			["WAS"] = "Erinnerst du dich noch, als wir Kinder waren, Gidwin? Wir haben den ganzen Tag gespielt, dass wir gegen die Trolle kämpfen oder die Murlocs oder die Mädchen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["ART"] = "SAY",
		},
		["Text_1510"] = {
			["WAS"] = "Wir können die Naga so nicht zurückschlagen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "SAY",
		},
		["Text_758"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fauldarm",
			["WAS"] = "Tot, tot, tot!",
		},
		["Text_1565"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Tiefensteinelementar",
			["WAS"] = "Die, die nicht zur Erde gehören, müssen vernichtet werden!",
		},
		["Text_2107"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Erzmagierin Rhydian",
			["WAS"] = "Nicht im Geringsten. Ich vermute, es hat etwas mit dem riesigen, mechanischen Konstrukt zu tun, dass unsere Späher vor dem Tor entdeckt haben.",
		},
		["Text_1817"] = {
			["WAS"] = "Schach!",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Schwarze Bischof",
			["ART"] = "SAY",
		},
		["Text_1936"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Fanny Donnermar",
			["WAS"] = "NIEMAND vergreift sich an MEINER Stadt, Orc!",
		},
		["Text_1181"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Dämonisch",
			["WER"] = "Oberster Hexenmeister Xi''lun",
			["WAS"] = "Manno gul Tichar maladath ",
		},
		["Text_1293"] = {
			["WAS"] = "Lebt wohl, Freund! Eine erfolgreiche Schatzsuche!",
			["SPRACHE"] = "NULL",
			["WER"] = "Budd",
			["ART"] = "SAY",
		},
		["Text_1703"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["WAS"] = "Solltet Ihr uns verraten, so gibt es kein Entkommen für Euch. Ich werde Euch so langsam zerquetschen, dass Ihr jeden einzelnen Knochen brechen hört.",
		},
		["Text_206"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Schankwart Smitts",
			["WAS"] = "Diese dunkle Besudelung ist absolut schlecht fürs Geschäft.",
		},
		["Text_475"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["WAS"] = "Ich weiß, ich habe dir den Vordersitz versprochen, Giddy, aber wir haben einen älteren Gast. Tut mir leid.",
		},
		["Text_133"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Magistrat Solomon",
			["WAS"] = "Welche Hoffnung, Oberst? Was könnte uns schon vor diesem drohenden Sturmangriff bewahren?",
		},
		["Text_53"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Dunkelmeister Gandling",
			["WAS"] = "Bereitet Euch auf Euren Tod vor, $R!",
		},
		["Text_1044"] = {
			["WAS"] = "Papa!",
			["SPRACHE"] = "NULL",
			["WER"] = "Pamela Rotpfad",
			["ART"] = "SAY",
		},
		["Text_2295"] = {
			["WAS"] = "Es ist Eure Entscheidung, $N. Marion hat ihr Schicksal selbst gewählt, als sie den heiligen Schrein Avianas angegriffen hat.",
			["SPRACHE"] = "NULL",
			["WER"] = "Thisalee Krähe",
			["ART"] = "SAY",
		},
		["Text_2294"] = {
			["WAS"] = "Hab ich Euch, Piepmatz! Nun fangt an zu zwitschern, oder ich mache ein halbes Hähnchen aus Euch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Thisalee Krähe",
			["ART"] = "SAY",
		},
		["Text_2293"] = {
			["WAS"] = "Weg von da, $C!",
			["SPRACHE"] = "NULL",
			["WER"] = "Marion Wurmschwinge",
			["ART"] = "SAY",
		},
		["Text_1694"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Quartzsteinling",
			["WAS"] = "Der Steinling entfernt sich rasch, höchst erfreut über seine neugewonnene Freiheit.",
		},
		["Text_1882"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Cayden Dunwald",
			["WAS"] = "Das ist alles? Ihr müsst doch mehr haben!",
		},
		["Text_12"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Bestrahlter Plünderer",
			["WAS"] = "%s gerät in Raserei!",
		},
		["Text_624"] = {
			["WAS"] = "Euer Herzschlag ist... Musik in meinen Ohren.",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Taldaram",
			["ART"] = "YELL",
		},
		["Text_1940"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Fanny Donnermar",
			["WAS"] = "So isses, Orc! Ich werd'' Euch die Tattoos vom Leib prügeln!",
		},
		["Text_2285"] = {
			["WAS"] = "Die Uralten Wächter kommen zurück. Cenarius, Aviana, Goldrinn... ich kann ihre Anwesenheit spüren. Wir müssen sie unbedingt in diese Welt geleiten. Ihre baldige Hilfe ist unverzichtbar.",
			["SPRACHE"] = "NULL",
			["WER"] = "Ysera",
			["ART"] = "SAY",
		},
		["Text_2284"] = {
			["WAS"] = "Innerhalb des Traums machte ich eine wichtige Entdeckung. Der Riss, der die Grenzen dieser Welt schwächt, hat die Rückkehr mächtiger Verbündeter beschleunigt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Ysera",
			["ART"] = "SAY",
		},
		["Text_1622"] = {
			["WAS"] = "Vielleicht wollt Ihr dreckigen Tiere ein weiteres Mal den Staub schmecken!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sully Kniescheibler",
			["ART"] = "YELL",
		},
		["Text_628"] = {
			["WAS"] = "Noch immer Hunger. Noch... immer... Durst.",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Taldaram",
			["ART"] = "YELL",
		},
		["Text_389"] = {
			["WAS"] = "Lasst uns diese Ninjas außer Gefecht setzen, Chef. Ich sehe bereits einige von ihnen vor uns.",
			["SPRACHE"] = "NULL",
			["WER"] = "\"Blindauge\" Drederick McGumm",
			["ART"] = "SAY",
		},
		["Text_2283"] = {
			["WAS"] = "Ich fürchte um Alysra. Fandrals Verderbnis reichte weiter als alles, was ich im Alptraum sah. Und doch können wir uns damit nicht aufhalten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Ysera",
			["ART"] = "SAY",
		},
		["Text_2279"] = {
			["WAS"] = "Zurück!!!",
			["SPRACHE"] = "NULL",
			["WER"] = "Galrond von der Klaue",
			["ART"] = "YELL",
		},
		["Text_1974"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "WHOA! Ruft das Reinigungspersonal! Den Herausforderer haben sie ganz schön zugerichtet!",
		},
		["Text_2277"] = {
			["WAS"] = "Hier drüben, $N!",
			["SPRACHE"] = "NULL",
			["WER"] = "Feendrache",
			["ART"] = "SAY",
		},
		["Text_739"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "König Varian Wrynn",
			["WAS"] = "Ich... Ich war nicht an der Pforte des Zorns, doch ich habe gehört, dass Euer Sohn ehrenvoll kämpfte. Er starb den Tod eines Helden. Er verdient das Begräbnis eines Helden.",
		},
		["Text_1276"] = {
			["WAS"] = "Macht Euch bereit, Männer!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "YELL",
		},
		["Text_2275"] = {
			["WAS"] = "Man hat mich entdeckt? Zeit zu sterben!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtentzünder",
			["ART"] = "SAY",
		},
		["Text_970"] = {
			["WAS"] = "Ich danke Euch für den sauberen Tod. Ich hätte es ganz anders gemacht...",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Godfrey",
			["ART"] = "YELL",
		},
		["Text_1926"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtdiener",
			["WAS"] = "Unsere Agenten wurden enttarnt und getötet, Meister.",
		},
		["Text_2177"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Scharfschütze von Hochstade",
			["WAS"] = "Gesichtet.",
		},
		["Text_2273"] = {
			["WAS"] = "Sie dort drüben verstecken! Schnell!",
			["SPRACHE"] = "NULL",
			["WER"] = "Feendrache",
			["ART"] = "SAY",
		},
		["Text_812"] = {
			["WAS"] = "Alle Mann auf Kampfposition! Naga im Anmarsch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Wank O''Breen",
			["ART"] = "YELL",
		},
		["Text_2270"] = {
			["WAS"] = "Wir suchen jetzt nach Bösen, ja?",
			["SPRACHE"] = "NULL",
			["WER"] = "Feendrache",
			["ART"] = "SAY",
		},
		["Text_2269"] = {
			["WAS"] = "Yor-guul mak!",
			["SPRACHE"] = "NULL",
			["WER"] = "Svala Grabesleid",
			["ART"] = "YELL",
		},
		["Text_382"] = {
			["WAS"] = "Ich steuere, Ihr übernehmt die dicke Emma. Und macht Euch nicht ins Hemd... Ich reduziere das Tempo, wenn wir näher herankommen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ruderer der Blutsegelbukaniere",
			["ART"] = "SAY",
		},
		["Text_1463"] = {
			["WAS"] = "Wir kommen der Sache näher... doch es qualmt noch etwas zu sehr. Lasst beim nächsten Mal das Schildkrötenöl weg. <hust> Zu starke Rauchentwicklung. Versucht es noch einmal!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ingenieur Hexasept",
			["ART"] = "SAY",
		},
		["Text_2239"] = {
			["WAS"] = "Es sieht so aus, als bestände unsere Gruppe nur aus Euch, mir und den zwei Mitgliedern drüben in der Mine. Lasst uns schnell handeln, $N, bevor wir entdeckt werden.",
			["SPRACHE"] = "NULL",
			["WER"] = "Meister Mathias Shaw",
			["ART"] = "SAY",
		},
		["Text_2237"] = {
			["WAS"] = "(Macht dem ein Ende! Macht ihnen ein Ende!)",
			["SPRACHE"] = "NULL",
			["WER"] = "Cho''gall",
			["ART"] = "YELL",
		},
		["Text_2235"] = {
			["WAS"] = "Soldaten der Allianz! So tapfer, so hochmütig. (Husch, husch, husch, Sterbliche!) Eure Anzahl ist klein und Ihr seid zu spät. (Hilflos und hoffnungslos, hilflos und hoffnungslos.)",
			["SPRACHE"] = "NULL",
			["WER"] = "Cho''gall",
			["ART"] = "YELL",
		},
		["Text_2260"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Tortusk",
			["WAS"] = "Diese Länder werden unser sein!",
		},
		["Text_308"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Soldat der Gurubashi",
			["WAS"] = "Aaaaahhh!",
		},
		["Text_183"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["WAS"] = "Danforth, berichtet.",
		},
		["Text_2229"] = {
			["WAS"] = "WAS WAR DAS?!",
			["SPRACHE"] = "NULL",
			["WER"] = "Schädelberster der Berg",
			["ART"] = "YELL",
		},
		["Text_398"] = {
			["WAS"] = "Verteidigt Eure Stellungen, Männer! Wir können sie überdauern.",
			["SPRACHE"] = "NULL",
			["WER"] = "Baron Revilgaz",
			["ART"] = "YELL",
		},
		["Text_1720"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Tawn Winterfels",
			["WAS"] = "Verstanden. Ich begebe mich sofort dorthin.",
		},
		["Text_2129"] = {
			["WAS"] = "Zum Angriff!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sultan Oogah",
			["ART"] = "YELL",
		},
		["Text_2220"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Unheilsflamme",
			["WAS"] = "Gut gemacht. Findet Lirastrasza und lasst sie wissen, dass wir erfolgreich waren.",
		},
		["Text_2243"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Okla",
			["WAS"] = "Kann ich noch mehr Steine für meine Halskette sammeln gehen, Papa?",
		},
		["Text_393"] = {
			["WAS"] = "Ich mache Euch fertig, Ihr Kanonenkugelzielscheibe!",
			["SPRACHE"] = "NULL",
			["WER"] = "Korsar der Blutsegelbukaniere",
			["ART"] = "YELL",
		},
		["Text_1081"] = {
			["WAS"] = "Versteckt Ihr Euch in dieser Wolke?",
			["SPRACHE"] = "NULL",
			["WER"] = "Lucien Knobelzang",
			["ART"] = "SAY",
		},
		["Text_685"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Todeswisper",
			["WAS"] = "Diejenigen, die sich ihm widersetzen, werden restlos zerstört! Diejenigen aber, die ihm dienen - ganz und bedingungslos - werden Macht jenseits Eures Horizonts erfahren.",
		},
		["Text_981"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Abbild von Arthas",
			["WAS"] = "Eure erste Prüfung wartet. Vernichtet die Eindringlinge.",
		},
		["Text_2212"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Calen",
			["WAS"] = "Sterblicher, nehmt Euch der Drachenkönigin an. Tragt sie in Sicherheit. Jetzt. LAUFT! Bringt sie hier weg!",
		},
		["Text_629"] = {
			["WAS"] = "Ihr seid weit gereist und habt viele Risiken auf Euch genommen, um hier zu sein. Eure Ergebenheit soll belohnt werden.",
			["SPRACHE"] = "NULL",
			["WER"] = "Jedoga Schattensucher",
			["ART"] = "YELL",
		},
		["Text_2149"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochprophet Barim",
			["WAS"] = "Der Himmel nehme Euch auf!",
		},
		["Text_660"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Lichkönig",
			["WAS"] = "Doch Ihr verdient diese Ehre nicht mehr. Bald schon habe ich einen neuen Champion.",
		},
		["Text_1659"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Reaktiviertes Kriegskonstrukt",
			["WAS"] = "Vernichten.",
		},
		["Text_2209"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["WAS"] = "Doch es ist vorbei. Nun können wir daran gehen, die Schrecken, die er entfesselte, zurückzudrängen.",
		},
		["Text_2079"] = {
			["WAS"] = "Iso''raths Magen beginnt zu rumoren als das Gehirn angegriffen wird!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gehirn von Iso''rath",
			["ART"] = "BOSS",
		},
		["Text_1560"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Magmazahn",
			["WAS"] = "Tiefenheim? Ich hasse diesen Ort. Augenblick... Ihr seid nicht Initiand Goldmine!",
		},
		["Text_1827"] = {
			["WAS"] = "Was immer Ihr tut... Nicht. Ohnmächtig. Werden.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fargo Flintlocke",
			["ART"] = "SAY",
		},
		["Text_2112"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Erzmagierin Rhydian",
			["WAS"] = "Wir können uns an ihnen vorbei schleichen. Wenn wir das Konstrukt vor dem Tor ausschalten können, sollten wir hineingelangen können.",
		},
		["Text_2072"] = {
			["WAS"] = "Danke, dass Ihr mich gerettet habt! Als Ihr das Bewusstsein verloren habt, dachte ich schon, dass wir erledigt wären!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Mylra",
			["ART"] = "YELL",
		},
		["Text_2206"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["WAS"] = "Der Erdenwächter... er ist tot.",
		},
		["Text_1280"] = {
			["WAS"] = "Gebt nicht auf! Kämpft! Kämpft für die Allianz!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "YELL",
		},
		["Text_2204"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["WAS"] = "Neltharion! Sieh dich an. Deformiert. Entstellt. Du bist nur noch ein Schatten deiner selbst.",
		},
		["Text_1374"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Überwacher der Azsh''ir",
			["WAS"] = "Ein Überwacher der Azsh''ir hat Euch entdeckt!",
		},
		["Text_565"] = {
			["WAS"] = "Auum na-l ak-k-k-k, isshhh.",
			["SPRACHE"] = "NULL",
			["WER"] = "Anub''arak",
			["ART"] = "YELL",
		},
		["Text_2195"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesschwinge",
			["WAS"] = "Lebensbinderin! Glaubst du, du könntest mich herumkommandieren? Ich habe eine Welt zu zerstören.",
		},
		["Text_323"] = {
			["WAS"] = "He $N!",
			["SPRACHE"] = "NULL",
			["WER"] = "Linzi Hackschlag",
			["ART"] = "WHISPER",
		},
		["Text_2061"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtfessler",
			["WAS"] = "Beißen... kratzen... krallen... reißen...",
		},
		["Text_909"] = {
			["WAS"] = "Ich werde alles weiter beobachten, während wir die Todesminen säubern. Hoffentlich dient sie uns bald wieder als die berühmte Goldmine, die sie einst war. Was das Schicksal des Herrschers angeht...",
			["SPRACHE"] = "NULL",
			["WER"] = "Leutnant Horatio Laine",
			["ART"] = "SAY",
		},
		["Text_2190"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Calen",
			["WAS"] = "$N! Ich bin froh, dass Ihr es geschafft habt.",
		},
		["Text_2202"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesschwinge",
			["WAS"] = "So sieh meine neuen Gaben, gewährt von den wahren Herren der Welt.",
		},
		["Text_1128"] = {
			["WAS"] = "Ich werde niemals von hier fortgehen! Was soll ich denn da draußen?",
			["SPRACHE"] = "NULL",
			["WER"] = "Sklavenarbeiter",
			["ART"] = "SAY",
		},
		["Text_2094"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Euer Funkgerät erwacht knisternd zum Leben. Bronzebart",
			["WAS"] = "Ihr habt es geschafft! Ihr habt die Verteidigung von Ulduar überwunden. Wir werden gleich da sein, um...",
		},
		["Text_544"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Magmadar",
			["WAS"] = "%s ist erschöpft!",
		},
		["Text_1599"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Versklavter Minenarbeiter",
			["WAS"] = "Der Schmiedemeister trifft sich mit den Anführern des Schattenhammerklans. Ihr könnt mir vertrauen - ich habe ein paar Gerüchte für altbackenes Brot im Tauschhandel erworben.",
		},
		["Text_2098"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Flammenleviathan",
			["WAS"] = "%s verfolgt Izma.",
		},
		["Text_2187"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Demolierer von Hochstade",
			["WAS"] = "Bis dann mal wieder!",
		},
		["Text_1546"] = {
			["WAS"] = "Thrall muss von den heutigen Ereignissen erfahren.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_386"] = {
			["WAS"] = "Wir sind da! Feuer frei!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ruderer der Blutsegelbukaniere",
			["ART"] = "YELL",
		},
		["Text_1337"] = {
			["WAS"] = "Also vergesst Eure Vorstellungen von versunkenen Städten, außergewöhnlichen Reisen und dem Ausgraben der Welt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Harrison Jones",
			["ART"] = "SAY",
		},
		["Text_1285"] = {
			["WAS"] = "Meine Herrin wird mir meine Mühen sssicher danken.",
			["SPRACHE"] = "NULL",
			["WER"] = "Entführer des Zin''jatar",
			["ART"] = "SAY",
		},
		["Text_442"] = {
			["WAS"] = "Du weißt verdammt gut, wie der war.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_35"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Ongo''longo",
			["WAS"] = "NICHT MEHR! ONGOLONGO GEHEN NACH HAUSE!",
		},
		["Text_1607"] = {
			["WAS"] = "Aber sicher, Gnädigste. Sofort!",
			["SPRACHE"] = "NULL",
			["WER"] = "Millhaus Manasturm",
			["ART"] = "SAY",
		},
		["Text_580"] = {
			["WAS"] = "Folgt mir, ich kenne den Weg.",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["ART"] = "SAY",
		},
		["Text_2068"] = {
			["WAS"] = "So tut doch etwas und hört auf, nichtsnutzig herumzustehen, $R. Meine Verbündeten geben ihr Leben für Euch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Thrall",
			["ART"] = "SAY",
		},
		["Text_751"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fauldarm",
			["WAS"] = "Papi, das war ich!",
		},
		["Text_2179"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Leutnant von Hochstade",
			["WAS"] = "Brecht den Torstein heraus. Macht dieses Ding auf.",
		},
		["Text_322"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hexendoktor Unbagwa",
			["WAS"] = "Macht Euch alle bereit! Hier kommen die Affen!",
		},
		["Text_1248"] = {
			["WAS"] = "Jeder Orc, den Ihr heute tötet, wird sie ehren -- und jeden Soldaten, der vor Euch kam.",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "SAY",
		},
		["Text_2142"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "General Husam",
			["WAS"] = "Murkash!",
		},
		["Text_2166"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Adarrah",
			["WAS"] = "Halt deine verdammte Klappe, Budd! HALT DIE KLAPPE!",
		},
		["Text_779"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Crok Geißelbann",
			["WAS"] = "Holt sie zu uns, wir unterstützen Euch!",
		},
		["Text_1919"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hohepriesterin Azil",
			["WAS"] = "Die Welt wird aus Flammen neu entstehen!",
		},
		["Text_2044"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Fanny Donnermar",
			["WAS"] = "Ja, ich will.",
		},
		["Text_655"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochlord Tirion Fordring",
