			["WAS"] = "Die Wildheit von Todesschwinge überkommt ihn und wir, die Rotdrachen müssen diese Gelegenheit nutzen, ihm die Schwarzdrachen unter ihm zu stehlen. Wir werden die Schwarzdrachen wieder zu dem machen, was sie ursprünglich sein sollten: Die Wächter der Erde.",
