			["SPRACHE"] = "NULL",
			["WER"] = "Koltira Todesweber",
			["WAS"] = "Ja, vielleicht... aber nicht heute. Da die Geißel besiegt ist, plane ich, meine Truppen zurückzuziehen und sie neu zu formieren.",
