			["SPRACHE"] = "NULL",
			["WER"] = "Krakauer",
			["WAS"] = "Wartet, bis diese Orcs eine von uns verpasst bekommen haben. Die Kompanie Bravo IST WIEDER DA!",
		},
		["Text_1702"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["WAS"] = "Und Ihr, Fleischling, bedenkt für einen Moment, dass Ihr an diesem Ort vollkommen von Stein umschlossen seid. Der Boden selbst, auf dem Ihr lauft, gehorcht meinem Willen.",
		},
		["Text_1057"] = {
			["WAS"] = "Wie ich erwartet habe. Ihr könnt gehen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gezhe",
			["ART"] = "SAY",
		},
		["Text_737"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Crok Geißelbann",
			["WAS"] = "Unsere Champions haben bei dem Kampf, diesen Geißeltransporter zu aktivieren, viel Blut gelassen. Wir müssen bereit sein, diesen Gefallen zu erwidern. Folgt mir, Männer!",
		},
		["Text_1161"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Unteroffizier des Schwarzfels",
			["WAS"] = "Ist das eine Maske, die Ihr da tragt, Soldat?",
		},
		["Text_833"] = {
