		["Text_2121"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Angeheuerter Ingenieur",
			["WAS"] = "Nicht die Bohne. Ich verstehe einfach nicht, wie dieses Ding funktioniert.",
		},
		["Text_683"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Todeswisper",
			["WAS"] = "Je eher Ihr Euren Zustand als Defekt anerkennt, desto eher werdet Ihr ihn überwinden können.",
		},
		["Text_175"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Jorgensen",
			["WAS"] = "Habt Ihr Keeshan einmal beim Töten eines Orcs erlebt? Ein unvergesslicher Anblick, meine Dame.",
		},
		["Text_487"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["WAS"] = "Wo wir dabei sind: Wenn jemand von Euch gerne etwas repariert hätte, lasst es mich wissen. Ich bin Euch gerne zu Diensten.",
		},
		["Text_301"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Blutfürst Mandokir",
			["WAS"] = "Ahh... es tut gut, zu Hause zu sein.",
		},
		["Text_757"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fauldarm",
			["WAS"] = "Ich fühl mich nicht gut...",
		},
		["Text_805"] = {
			["WAS"] = "%s beginnt mit der Brille vor dem Stein herumzutüfteln.",
			["SPRACHE"] = "NULL",
			["WER"] = "Professor Prasseltrop",
			["ART"] = "EMOTE",
		},
		["Text_100"] = {
			["WAS"] = "Ich brauche ein wenig Zeit, diese Proben zu untersuchen, Kassi. Ich spreche wieder mit Euch, wenn ich mit meiner Analyse fertig bin.",
			["SPRACHE"] = "NULL",
			["WER"] = "Außenagent Kaartish",
			["ART"] = "SAY",
		},
		["Text_1551"] = {
			["WAS"] = "Hoffentlich können Thrall und die anderen ihn lange genug aufhalten, damit wir ihn reparieren können!",
			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["ART"] = "SAY",
		},
		["Text_880"] = {
			["WAS"] = "ARKANE MACHT!",
			["SPRACHE"] = "NULL",
			["WER"] = "Glubtok",
			["ART"] = "YELL",
		},
		["Text_1210"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Razelikh der Entweiher",
			["WAS"] = "Du musst es also schon spüren... die dämonische Energie, die dein Herz durchdringt, deine Lungen, deine Seele...",
		},
		["Text_640"] = {
			["WAS"] = "Sie sterben nicht; sie leben nicht. Sie stehen außerhalb des Kreislaufs.",
			["SPRACHE"] = "NULL",
			["WER"] = "Herold Volazj",
			["ART"] = "WHISPER",
		},
		["Text_1711"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Haethen Kaul",
			["WAS"] = "Wir haben lange und schwer für unseren Fürsten Todesschwinge gearbeitet. Weihen wir uns ihm ganz in seinem Namen, auf dass wir uns bis ans Ende aller Tage in seinen Flammen wärmen!",
		},
		["Text_192"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Jorgensen",
			["WAS"] = "Manchmal gehen Ablenkungsmanöver auch ins Auge und lassen die Orcs misstrauisch werden. In diesen Fällen suchen sie aktiv nach uns. Am besten haltet Ihr Euch von allen Orcs, die Verstohlenheit entdeckt haben, fern.",
		},
		["Text_1517"] = {
			["WAS"] = "Erhebt Euch. Wir haben keine Zeit, unsere Wunden zu lecken!",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_125"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gebändigter Schluchtettin",
			["WAS"] = "Okay! Ich werfen ins Wasser.",
		},
		["Text_1589"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Mylra",
			["WAS"] = "Ihr könnt damit anfangen, uns zu sagen, wo das Fragment der Weltensäule ist. Mein Greif hat es langsam satt, Euch herumzuschleppen.",
		},
		["Text_304"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Braddok",
			["WAS"] = "Ich folgere daraus, dass Ihr sterben müsst!",
		},
		["Text_2096"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Euer Funkgerät erwacht knisternd zum Leben. Bronzebart",
			["WAS"] = "Schnell! Ausweichen! Ausweichen!",
		},
		["Text_1877"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Greifenreiter der Mullans",
			["WAS"] = "Gute Arbeit, Mädel! Nun greift ihren Anführer an!",
		},
		["Text_499"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Raymond George",
			["WAS"] = "Lasst die Prüfungen beginnen. Erhebt Euch, Champions! Erhebt Euch und stellt diese drei im Kampf!",
		},
		["Text_1965"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Hier sind wir wieder, meine Damen und Herren. Der epische Kampf um Leben und Tod im Schmelztiegel des Gemetzels! In dieser Runde kämpft Bossus gegen... einen dicker, fetter Oger? Wartet, ernsthaft?! Das ist alles, was uns so kurzfristig eingefallen ist? Wofür bezahle ich Euch?",
		},
		["Text_2183"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Demolierer von Hochstade",
			["WAS"] = "Bin dran.",
		},
		["Text_13"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Bestrahlter Plünderer",
			["WAS"] = "Das Blut von %s spritzt in die Luft!",
		},
		["Text_1207"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Loramus Thalipedes",
			["WAS"] = "RAKH''LIKH! Komm und erblicke den Untergang!",
		},
		["Text_871"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erleuchter der Himmelsbrecher",
			["WAS"] = "Aye aye!",
		},
		["Text_835"] = {
			["WAS"] = "Fragt mich niemals, was Ihr mir wirklich gebracht habt, $C. Vergesst besser, dass all dies hier jemals passiert ist.",
			["SPRACHE"] = "NULL",
			["WER"] = "Glorin Stahlbraue",
			["ART"] = "SAY",
		},
		["Text_1990"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Dieser Kampf wird auf jeden Fall KURZ sein! Okay, okay, ich bin ja schon fertig. Möge das Blutbad beginnen!",
		},
		["Text_1475"] = {
			["WAS"] = "Ihr Dummköpfe hört auf so herumzurennen! Stellt Euch dem Gegner!",
			["SPRACHE"] = "NULL",
			["WER"] = "Jorlan Wahrklinge",
			["ART"] = "YELL",
		},
		["Text_2292"] = {
			["WAS"] = "Bringt die anderen in die Brutstätte der Feuerlande! Bald werden wir die Himmel beherrschen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Vision von Sethria",
			["ART"] = "SAY",
		},
		["Text_967"] = {
			["WAS"] = "Ivars Rudel hat grauenhaft versagt, deshalb sendet er nun Söldner. Unwichtig. Eure Reise endet in Todesqualen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Godfrey",
			["ART"] = "YELL",
		},
		["Text_1524"] = {
			["WAS"] = "Wir müssen uns beeilen! Die Elementare können der Belagerung nicht länger standhalten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_1310"] = {
			["WAS"] = "DAS FEUER WIRD EUCH LÄUTERN!!!!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ragnaros",
			["ART"] = "YELL",
		},
		["Text_672"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Mark''gar",
			["WAS"] = "Dranbleiben!",
		},
		["Text_1286"] = {
			["WAS"] = "Wir hatten großes Glück, dass wir entkommen konnten, $N. Folgt mir.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_1907"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Marodeur des Drachenmals",
			["WAS"] = "Gul''nat kil Tago Goth'' kil Kil''azi''ag ",
		},
		["Text_1820"] = {
