		["Text_1838"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gestrandetes Besatzungsmitglied",
			["WAS"] = "Sie ist wunderschön...",
		},
		["Text_901"] = {
			["WAS"] = "Spürt Ihr den Schauer auf Eurem Rücken? Nebel zieht auf…",
			["SPRACHE"] = "NULL",
			["WER"] = "Admiral Knurrreißer",
			["ART"] = "YELL",
		},
		["Text_99"] = {
			["WAS"] = "Miau!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["ART"] = "SAY",
		},
		["Text_772"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Großer Schlamm",
			["WAS"] = "|TInterface\\Icons\\spell_shadow_unstableaffliction_2.blp:16|t%s beginnt |cFFFF0000''Instabile Schlammexplosion''|r zu wirken!",
		},
		["Text_1130"] = {
			["WAS"] = "Niemals! Ich liebe es, für die Dunkeleisenzwerge zu arbeiten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sklavenarbeiter",
			["ART"] = "SAY",
		},
		["Text_1826"] = {
			["WAS"] = "Also dann. Ich hasse lange Flüge. Also werde ich die Nachbrenner auch noch zuschalten und unseren gesamten Spritvorrat auf einmal entzünden.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fargo Flintlocke",
			["ART"] = "SAY",
		},
		["Text_1441"] = {
			["WAS"] = "Kvaldir strömen über die Brücke! Kriegsmaid, Lady Naz''jar ruft Euch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Tiefenpirscher Azjentus",
			["ART"] = "SAY",
		},
		["Text_1890"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Donnelly Dunwald",
			["WAS"] = "Schnäbelchen! Wo bist du, Schnäbelchen?",
		},
		["Text_482"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["WAS"] = "Wenn es Euch nichts ausmacht, dass ich frage: Was tut Ihr, dass Ihr so viel laufen müsst?",
		},
		["Text_1400"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Aufklärer der Allianz",
			["WAS"] = "Sie greifen immer häufiger an. Ihr solltet in Bewegung bleiben.",
		},
		["Text_1496"] = {
			["WAS"] = "Welche Rolle spielt Neptulon in dieser Sache, Schamane?",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "SAY",
		},
		["Text_1184"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "General Thorg''izog",
			["WAS"] = "Schnell, alle zu den Drachen! An alle Truppen: zu den Drachen! Die Drachen werden uns retten!",
		},
		["Text_733"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "König Varian Wrynn",
			["WAS"] = "Haltet ein, Muradin. Lasst einen trauernden Vater durch.",
		},
		["Text_1884"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Cayden Dunwald",
			["WAS"] = "Mehr habt Ihr nicht drauf?!",
		},
		["Text_173"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Messner",
			["WAS"] = "Ich müsste einmal die Toilette benutzen...",
		},
		["Text_2046"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Grundy MacGraff",
			["WAS"] = "... kraft des Blutes und des Schattens!",
		},
		["Text_147"] = {
			["WAS"] = "Wir gewinnen diese Schlacht, $N. Solange diese Bauern die Verlassenen weiter an ihren Flanken drangsalieren, werden wir sie besiegen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Thassarian",
			["ART"] = "SAY",
		},
		["Text_1489"] = {
			["WAS"] = "Ich bin befreit! Lasst uns in Neptulons Namen Hallazeal töten, $N.",
			["SPRACHE"] = "NULL",
			["WER"] = "Rachsüchtiger Strom",
			["ART"] = "YELL",
