		},
		["Text_778"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Schwester Svalna",
			["WAS"] = "Ihr mögt mit mir gekämpft haben, Crok, aber nun seid Ihr nicht mehr als ein Verräter. Kommt, Euer zweiter Tod erwartet Euch!",
		},
		["Text_1258"] = {
			["WAS"] = "Sssie wird Euch finden...",
			["SPRACHE"] = "NULL",
			["WER"] = "Räuber des Zin''jatar",
			["ART"] = "SAY",
		},
		["Text_36"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Ongo''longo",
			["WAS"] = "MICKRIGE TROLLE HALTEN ONGOLONGO NICHT AUF!",
		},
		["Text_578"] = {
			["WAS"] = "Ihr beschleunigt nur den... Plan des Meisters...",
			["SPRACHE"] = "NULL",
			["WER"] = "Salramm der Fleischformer",
			["ART"] = "YELL",
		},
		["Text_373"] = {
			["WAS"] = "Ich würde niemals die Seiten wechseln, Ihr blassnasiger Murloc!",
			["SPRACHE"] = "NULL",
			["WER"] = "Korsar der Blutsegelbukaniere",
			["ART"] = "YELL",
		},
		["Text_1813"] = {
			["WAS"] = "Nichts, nichts, wir sind nichts. Der Greifer berührt unsere Herzen und ballt die Faust.",
			["SPRACHE"] = "NULL",
			["WER"] = "Stammelnder Kultist",
			["ART"] = "SAY",
		},
		["Text_714"] = {
			["ART"] = "WHISPER",
			["SPRACHE"] = "NULL",
			["WER"] = "$N",
			["WAS"] = "Raketenpack deaktiviert. Zum Aktivieren näher an Zafod Bummbox herangehen.",
		},
		["Text_707"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Muradin Bronzebart",
			["WAS"] = "Nicht mein Kampf? Ich weiß nicht, für wen Ihr Euch haltet, aber ich habe eine Rechnung mit Arthas offen und Ihr haltet mich nicht auf! FEUER FREI! FEUER! FEUER!",
		},
		["Text_1797"] = {
			["WAS"] = "Wer meint Ihr - wartet - $N, hinter Euch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Anduin Wrynn",
			["ART"] = "SAY",
		},
		["Text_432"] = {
			["WAS"] = "Ich bin mir ziemlich sicher, dass es sechs waren.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_483"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["WAS"] = "Ich betreue die fünf Argentumtürme. Hauptsächlich Reparaturen und Instandhaltungen und ein paar kleinere Magiearbeiten.",
		},
		["Text_1619"] = {
			["WAS"] = "NEEEEIIIIN...nicht schon wieder!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lavinius",
			["ART"] = "YELL",
		},
		["Text_2014"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Russell Brower",
			["WAS"] = "In Donnermar, so klingt die Sage in meinen Ohren",
		},
		["Text_1535"] = {
			["WAS"] = "Auf, meine Naga! Heißt den mächtigen Gezeitenjäger in Azeroth willkommen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Naz''jar",
			["ART"] = "YELL",
		},
		["Text_1021"] = {
			["WAS"] = "Für Euch gibt es keine Fluchtmöglichkeit. Der Kreuzzug wird alle vernichten, die die Besudelung der Geißel tragen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Auferstandener Mönch",
			["ART"] = "SAY",
		},
		["Text_1141"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Thelaron Düsternadel",
			["WAS"] = "Wir werden mehr Schlamm benötigen, um Eure Verkleidung anständig färben zu können.",
		},
		["Text_516"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["WAS"] = "Nein, er würde niemals sein Gebetsbuch einfach so zurücklassen! Er hatte seine Nase immer tief in das Buch gesteckt, um sich weiterzubilden.",
		},
		["Text_383"] = {
			["WAS"] = "Sie greifen von beiden Seiten an! Schickt sie in ihr nasses Grab!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ruderer der Blutsegelbukaniere",
			["ART"] = "YELL",
		},
		["Text_478"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["WAS"] = "Stimmt nicht!",
		},
		["Text_519"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["WAS"] = "Ein Paladin wie Gidwin gibt einen guten Todesritter ab. Das weiß jedes Mitglied der Geißel, das mächtig genug ist, ihn zu besiegen.",
		},
		["Text_275"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Feuerwache Glutseher",
			["WAS"] = "%s kommt allmählich wieder zu Kräften!",
		},
		["Text_1182"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberster Hexenmeister Xi''lun",
			["WAS"] = "Und nun benutzt schnell die Kugel der Herrschaft, bevor sich der Grubenlord gegen uns richtet!",
		},
		["Text_2248"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Karu",
			["WAS"] = "Du sollst deine Aufgaben machen!",
		},
		["Text_267"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Gil",
			["WAS"] = "Ich will den Magierturm sehen.",
		},
		["Text_1116"] = {
			["WAS"] = "Bitte schön.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lunk",
			["ART"] = "SAY",
		},
		["Text_1548"] = {
			["WAS"] = "Erunak! Neeeiiin!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Taylor",
			["ART"] = "YELL",
		},
		["Text_280"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Victor Nefarius",
			["WAS"] = "Vorzüglich... es scheint, als wären die lästigen Insekten gerade rechtzeitig eingetroffen, um meiner Legion als Nahrung zu dienen. Willkommen, sterbliche Wesen!",
		},
		["Text_22"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kinelory",
			["WAS"] = "Gut, dann lasst uns beginnen. Je länger wir hier sind, desto mehr Schaden können die Untoten im Hügelland anrichten.",
		},
		["Text_1756"] = {
			["WAS"] = "Ich hab'' langsam genug von Euch, Freundchen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zoltrik Drachenbann",
			["ART"] = "YELL",
		},
		["Text_1036"] = {
			["WAS"] = "Darroheim wird fallen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Spektraler Verräter",
			["ART"] = "SAY",
		},
		["Text_1842"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Ephram Hartstein",
			["WAS"] = "Da! Sie zeigt sich. Zum Angriff!",
		},
		["Text_330"] = {
			["WAS"] = "Was führt Euch in meinen Teil des Schlingendorntals? Ich bin es nicht gewohnt, Besucher aus dem zu hoch geschätzten Zul''Gurub zu empfangen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zanzil der Ausgestoßene",
			["ART"] = "SAY",
		},
		["Text_1192"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Kasim Sharim",
			["WAS"] = "Schnell, $N! Uns bleibt nicht viel Zeit bis Razelikhs Rückkehr.",
		},
		["Text_1498"] = {
			["WAS"] = "Die Lords der Elementarebenen sind Wesen des reinen Chaos, Kapitän.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_1636"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verteidiger von Steinruh",
			["WAS"] = "Für den Steinvater!",
		},
		["Text_1993"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["WAS"] = "Aus der nähergelegenen, geschundenen Landschaft stammend, die einst Gilneas war, erhebt sich unser Champion! Haltet Eure Hose gut fest, Doombringêr, oder wollt Ihr, dass dieser Mann über Eure persönliche Kimme zielt?",
		},
		["Text_1554"] = {
			["WAS"] = "Dies ist der Tempel der Erde, das wichtigste Gebäude in Tiefenheim.",
			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["ART"] = "SAY",
		},
		["Text_636"] = {
			["WAS"] = "Die, die sich an verlorenen Seelen laben, kennen nur den Hunger.",
			["SPRACHE"] = "NULL",
			["WER"] = "Herold Volazj",
			["ART"] = "WHISPER",
		},
		["Text_1373"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["WAS"] = "Folgt mir jetzt!",
		},
		["Text_352"] = {
			["WAS"] = "Ich habe kein Geld! Geht weg!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ephram \"Das Waschbrett\" Mondsturz",
			["ART"] = "YELL",
		},
		["Text_347"] = {
			["WAS"] = "Hakkar wird ungeduldig. Und ich ebenfalls.",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["ART"] = "SAY",
		},
		["Text_1406"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verletzter freiwilliger Angreifer",
			["WAS"] = "Genau das wollte ich hören. Danke.",
		},
		["Text_957"] = {
			["WAS"] = "Selbst hier werde ich von Narren heimgesucht!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Walden",
			["ART"] = "YELL",
		},
		["Text_1796"] = {
			["WAS"] = "An diesem Altar wurden einige Rituale durchgeführt. Es sieht aus wie das heidnische Initiationsritual, von dem mir Valen einst erzählte. Blutig. Ekelerregend.",
			["SPRACHE"] = "NULL",
			["WER"] = "Anduin Wrynn",
			["ART"] = "SAY",
		},
		["Text_1618"] = {
			["WAS"] = "Ich Euch kennen? Egal. Ich brechen Eure Knochen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lavinius",
			["ART"] = "YELL",
		},
		["Text_738"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochfürst Saurfang",
			["WAS"] = "Ich werde Eure... Güte nicht vergessen. Ich danke Euch, Hoheit.",
		},
		["Text_342"] = {
			["WAS"] = "Zeit hier abzuhauen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zanzil der Ausgestoßene",
			["ART"] = "YELL",
		},
		["Text_1764"] = {
			["WAS"] = "Ihr hättet die Zeichen der Zeit erkennen sollen, als wir Euren Steilhang zerstörten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["ART"] = "YELL",
		},
		["Text_1226"] = {
			["WAS"] = "Wenn wir diese Insel verlieren, ist Sturmwind so gut wie verloren... das weiß die Horde.",
			["SPRACHE"] = "NULL",
			["WER"] = "Soldat von Sturmwind",
			["ART"] = "SAY",
		},
		["Text_431"] = {
			["WAS"] = "Schön. Ich habe fünf Zombies getötet. Und es waren große Zombies. Wie viele Untote hast du geschafft?",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["ART"] = "SAY",
		},
		["Text_1564"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Tiefensteinelementar",
			["WAS"] = "Im Reich der Erde habt Ihr nichts verloren!",
		},
		["Text_319"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Blutfürst Mandokir",
			["WAS"] = "Ich habe einen neuen Käfig aufgebaut, und wir verfügen über viele Wege, um... ihr beizubringen, dass sie nicht wieder fliehen soll.",
		},
		["Text_1180"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberster Hexenmeister Xi''lun",
			["WAS"] = "Ihr seid beide Versager. Aber es ist nicht so wichtig: Mit einem Grubenlord auf unserer Seite benötigen wir weder Fußsoldaten NOCH Drachen. Seht!",
		},
		["Text_302"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Blutfürst Mandokir",
			["WAS"] = "Von Eurer Art sind viele hier, doch ich würde mir keine Sorgen um die Konkurrenz machen. Ihr entstammt dem Geschlecht Ohgans, meinem ältesten Freund. Ihr seht also... unsere Seelen sind verbunden, Eure und meine.",
		},
		["Text_699"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Beschützer der Himmelsbrecher",
			["WAS"] = "Hauptmann Muradin wartet an Bord der Himmelsbrecher. Wir sichern das Gebiet, bis Ihr startbereit seid.",
		},
		["Text_1724"] = {
			["WAS"] = "Glaube, ich laufe langsam eine Rille in die Pflastersteine.",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Alte Emma",
			["ART"] = "SAY",
		},
		["Text_2161"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Adarrah",
			["WAS"] = "Das ist der dämlichste... halbgarste... und lächerlichste Plan, den du je hattest, Budd!",
		},
		["Text_1894"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Eoin Dunwald",
			["WAS"] = "Und wo wollt Ihr wohl hin, Kleiner?!",
		},
		["Text_407"] = {
			["WAS"] = "AAAAAAAAAAAHH!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zitterhand Phillipe",
			["ART"] = "YELL",
		},
		["Text_361"] = {
			["WAS"] = "Das genügt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Flottenmeister Seehorn",
			["ART"] = "SAY",
		},
		["Text_782"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Crok Geißelbann",
			["WAS"] = "Schnell, weiter!",
		},
		["Text_793"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Valithria Traumwandler",
			["WAS"] = "Helden, helft mir. Ich... Ich kann sie nicht mehr lange aufhalten. Ihr müsst meine Wunden heilen!",
		},
		["Text_1493"] = {
			["WAS"] = "Kalibriere Lunte...",
			["SPRACHE"] = "NULL",
			["WER"] = "Ingenieur Hexasept",
			["ART"] = "SAY",
		},
		["Text_1594"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Mylra",
			["WAS"] = "Interessant. Von diesem Zwielichtrat hatte ich bis jetzt nicht gehört.",
		},
		["Text_415"] = {
			["WAS"] = "Seid vorsichtig dort draußen, $N. Ihr solltet nicht zu lange auf diesem Schiff bleiben... noch ein paar Kanonenkugeln mehr und sie sinkt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Baron Revilgaz",
			["ART"] = "SAY",
		},
		["Text_1695"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtdämmerungswächter",
			["WAS"] = "Bei den Elementen, dieser hier ist noch größer als der Letzte!",
		},
		["Text_29"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kinelory",
			["WAS"] = "Okay, dann mal raus hier, und zwar schnell! Nehmt die Beine in die Hand, ich werde jetzt losrennen.",
		},
		["Text_559"] = {
			["WAS"] = "Dies ist das Reich der Geißel. Nur den Toten wird Einlass gewährt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Krik''thir der Torwächter",
			["ART"] = "YELL",
		},
		["Text_1858"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Feuerbärter",
			["WAS"] = "Wir werden weitere Eimer bringen.",
		},
		["Text_988"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Skadi der Skrupellose",
			["WAS"] = "Welche Hunde wagen es, hier einzudringen? Auf sie, meine Brüder! Ein Fest für den, der mir ihre Köpfe bringt!",
		},
		["Text_905"] = {
			["WAS"] = "Ihr werdet sie... nicht finden... bis es zu spät ist...",
			["SPRACHE"] = "NULL",
			["WER"] = "Admiral Knurrreißer",
			["ART"] = "YELL",
		},
		["Text_702"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Muradin Bronzebart",
			["WAS"] = "Was in aller Welt ist das? Mein Fernglas, Matrose!",
		},
		["Text_1795"] = {
			["WAS"] = "Was ist das hier für ein Ort? Igitt, und dieser Geruch...",
			["SPRACHE"] = "NULL",
			["WER"] = "Anduin Wrynn",
			["ART"] = "SAY",
		},
		["Text_1863"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Greifenreiter der Mullans",
			["WAS"] = "Das ist SICHERLICH ein Wortgefecht!",
		},
		["Text_249"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Adam",
			["WAS"] = "Lügner!",
		},
		["Text_959"] = {
			["WAS"] = "Diese kindischen Bemühungen enden hier!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Walden",
			["ART"] = "YELL",
		},
		["Text_1346"] = {
			["WAS"] = "Diese Aufgabe ist genau das Richtige für Euch, Duarn. Ich muss mich um die Angelegenheiten draußen kümmern.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erunak Steinsprecher",
			["ART"] = "SAY",
		},
		["Text_461"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Spektraler Verräter",
			["WAS"] = "Eure Seele ist verloren!",
		},
		["Text_847"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Koristrasza",
			["WAS"] = "Eure Anwesenheit ist hier nicht erwünscht, Amnennar.",
		},
		["Text_1504"] = {
			["WAS"] = "Hätt'' ich bloß nicht gefragt...",
			["SPRACHE"] = "NULL",
			["WER"] = "Fähnrich Ebbert",
			["ART"] = "SAY",
		},
		["Text_1874"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtsturmbändiger",
			["WAS"] = "Der Wind wird Eure Schreie weit tragen...",
		},
		["Text_1904"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Schamane der Schwärze",
			["WAS"] = "Das Ende aller Dinge steht uns bevor!",
		},
		["Text_430"] = {
			["WAS"] = "Wer sagt, dass du die Wette gewonnen hast? Wir haben die Strichlisten noch nicht verglichen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_1868"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verletzter Nachzügler des Drachenmals",
			["WAS"] = "Schmeckt meine Axt, Feigling!",
		},
		["Text_527"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["WAS"] = "Ich, fähig? Nein, nein, Gidwin war der gute Paladin. Er ist derjenige, der jede Nacht stundenlang wachblieb und übte...",
		},
		["Text_825"] = {
			["WAS"] = "DIE FLAMMEN SOLLEN EUCH VERSCHLINGEN! UNS ALLE SOLLEN SIE VERSCHLINGEN!",
