			["WER"] = "Tarenar Sonnenhieb",
			["WAS"] = "Der Argentumkreuzzug kann noch ein wenig länger auf uns warten. Abgesehen davon... Unser Gast will die Karawane vielleicht auch bald verlassen.",
		},
		["Text_230"] = {
			["WAS"] = "In Ordnung, wir geben noch dies hier hinzu...",
