			["WER"] = "Bruder Nimetz",
			["ART"] = "SAY",
		},
		["Text_287"] = {
			["WAS"] = "DAS KANN NICHT SEIN!!! Rend, kümmert Euch um diese Insekten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Victor Nefarius",
			["ART"] = "YELL",
		},
		["Text_253"] = {
			["WAS"] = "Genug der Spielereien. Es ist an der Zeit für etwas praxisorientierte Anleitung!",
			["SPRACHE"] = "NULL",
			["WER"] = "Aufseher Stillwasser",
			["ART"] = "YELL",
		},
		["Text_403"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Zitterhand Phillipe",
			["WAS"] = "ALLE HERHÖREN! JETZT DÜRFT IHR IN PANIK VERFALLEN!",
		},
		["Text_485"] = {
