			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["ART"] = "SAY",
		},
		["Text_499"] = {
			["WAS"] = "Lasst die Prüfungen beginnen. Erhebt Euch, Champions! Erhebt Euch und stellt diese drei im Kampf!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Raymond George",
			["ART"] = "SAY",
		},
		["Text_134"] = {
			["WAS"] = "Er diente 248 Einsätze in Folge während des Ersten, Zweiten und Dritten Krieges.",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberst Trottmann",
			["ART"] = "SAY",
		},
		["Text_50"] = {
			["WAS"] = "Ihr  $R? Ihr werdet für Eure Einmischung bezahlen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zurückgezogene Seele",
			["ART"] = "YELL",
		},
		["Text_72"] = {
			["WAS"] = "Gory gibt auf! Ihr Bauern kämpft besserer!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gory",
			["ART"] = "SAY",
		},
		["Text_151"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Aradne",
			["WAS"] = "Ihr habt bereits verloren.",
		},
		["Text_109"] = {
			["WAS"] = "Willkommen im Rotkammgebirge, $C!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Wache Flippit",
			["ART"] = "SAY",
		},
		["Text_186"] = {
			["WAS"] = "Es gibt zwei Möglichkeiten, hinter die feindlichen Linien zu gelangen, Johnny. Drei, wenn Ihr Euren Tod einkalkuliert.",
			["SPRACHE"] = "NULL",
			["WER"] = "Krakauer",
			["ART"] = "SAY",
		},
		["Text_174"] = {
			["WAS"] = "Wisst Ihr, dass die Schwarzfelsorcs ständig über Höllschreis Rückkehr zur Horde sprachen? Was hat das zu bedeuten? Ist Höllschrei nicht tot?",
			["SPRACHE"] = "NULL",
			["WER"] = "Jorgensen",
			["ART"] = "SAY",
		},
		["Text_132"] = {
			["WAS"] = "Bitte helft mir! Ich bin der letzte meiner Familie. Alle anderen wurden entführt!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Bürger des Rotkammgebirges",
			["ART"] = "SAY",
		},
		["Text_482"] = {
			["WAS"] = "Wenn es Euch nichts ausmacht, dass ich frage: Was tut Ihr, dass Ihr so viel laufen müsst?",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_317"] = {
