			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["ART"] = "SAY",
		},
		["Text_223"] = {
			["WAS"] = "Ihr habt einiges wiedergutzumachen, Bibbers. Ich lasse Euch nicht so einfach davonkommen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sven Yorgen",
			["ART"] = "SAY",
		},
		["Text_426"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["WAS"] = "Ihr könnt Euch übrigens gerne jegliche Vorräte leihen, die ihr in der Karawane findet... Solange Ihr sie zurückbringt, wenn Ihr fertig seid!",
		},
		["Text_507"] = {
