			["WER"] = "Brückentagelöhner Alex",
			["ART"] = "SAY",
		},
		["Text_137"] = {
			["WAS"] = "Gefoltert und als lebendes Urinal für junge Orckrieger missbraucht. FÜNF JAHRE LANG.",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberst Trottmann",
			["ART"] = "SAY",
