			["SPRACHE"] = "NULL",
			["WER"] = "Schildträger von Herdweiler",
			["WAS"] = "Guten Tag.",
		},
		["Text_356"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Seewolf MacKinley",
			["WAS"] = "%s versucht, Maurys Klumpfuß zu öffnen...",
		},
		["Text_208"] = {
			["WAS"] = "Fürchtet Euch nicht. Die Nachtwache wird das Land früh genug von dieser üblen Besudelung befreien.",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kommandantin Althea Schwarzhaupt",
			["ART"] = "SAY",
		},
		["Text_145"] = {
			["WAS"] = "Wofür zahlen wir Steuern, wenn Eure Wachen nicht einmal Gnolle fernhalten können?",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Bürger des Rotkammgebirges",
			["ART"] = "SAY",
		},
		["Text_238"] = {
			["WAS"] = "So tut doch was.",
			["SPRACHE"] = "NULL",
			["WER"] = "Osborn Grausikus",
			["ART"] = "SAY",
		},
		["Text_343"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Zanzil der Ausgestoßene",
			["WAS"] = "Ihr habt noch nicht genug, was? Schade, denn ich habe dieses Mal einen stärkeren Trank angerührt! Venoxis wird leben!",
		},
		["Text_114"] = {
			["WAS"] = "Ohne Gerechtigkeit kein Friede!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Bürger des Rotkammgebirges",
			["ART"] = "SAY",
		},
		["Text_332"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["WAS"] = "Die Gurubashi machen schlimme Zeiten durch. Ich lebe und Mandokir ist zurückgekehrt... doch die übrigen von uns sind fort.",
		},
		["Text_44"] = {
			["WAS"] = "Ihr  Mensch? Ihr werdet für Eure Einmischung bezahlen!",
