			["WER"] = "Zanzil der Ausgestoßene",
			["WAS"] = "Neeeiiin! Zanzil ist ein Versager...",
		},
		["Text_455"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["WAS"] = "Warum sind wir noch nicht weg? Ich ziehe alleine los, wenn wir nicht bald loslegen.",
