			["WAS"] = "In Ordnung, hier bin ich!",
		},
		["Text_70"] = {
			["WAS"] = "Sagt ''Hallo!'' zu meinen kleinen Freunden!",
			["SPRACHE"] = "NULL",
			["WER"] = "Pusillin",
			["ART"] = "SAY",
		},
		["Text_538"] = {
			["WAS"] = "Ihr seid närrisch, $R! Ihr sucht den Zwerg? Baroness Anastari hält ihn wohl versteckt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Belagerungsingenieur der Geißel",
			["ART"] = "SAY",
		},
		["Text_278"] = {
			["WAS"] = "Ha! Ha! Ha! Danke, dass Ihr mich befreit habt, ihr Dummköpfe. Ich werde es Euch vergelten, indem ich Euch das Fleisch von den Knochen brenne.",
			["SPRACHE"] = "NULL",
			["WER"] = "Feuerwache Glutseher",
			["ART"] = "YELL",
		},
		["Text_175"] = {
			["WAS"] = "Habt Ihr Keeshan einmal beim Töten eines Orcs erlebt? Ein unvergesslicher Anblick, meine Dame.",
			["SPRACHE"] = "NULL",
			["WER"] = "Jorgensen",
			["ART"] = "SAY",
		},
		["Text_404"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Baron Revilgaz",
			["WAS"] = "Ich sage, versenkt sie alle!",
		},
		["Text_524"] = {
			["WAS"] = "Beides sind Orte des Bösen. Ich habe sie auf meinen Reisen gemieden, wann immer es ging.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_220"] = {
			["WAS"] = "Ihr brachtet die Worgen nach Dämmerwald! Ihr habt die dunklen Reiter zu meinem Hof geführt und Euch versteckt, während sie meine Familie ermordeten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lauernder Worgen",
			["ART"] = "SAY",
		},
		["Text_321"] = {
			["WAS"] = "Wenn Ihr die NERVEN habt, zurückzukommen, solltet Ihr besser vorbereitet sein. Denn Jin''do hat eine Überraschung für Euch...",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["ART"] = "YELL",
		},
		["Text_143"] = {
			["WAS"] = "Wenn Ihr nichts gegen diese Gnolle unternehmt, tun wir es!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Bürger des Rotkammgebirges",
			["ART"] = "SAY",
		},
		["Text_301"] = {
			["WAS"] = "Ahh... es tut gut, zu Hause zu sein.",
			["SPRACHE"] = "NULL",
			["WER"] = "Blutfürst Mandokir",
			["ART"] = "SAY",
		},
		["Text_314"] = {
			["WAS"] = "Ihr habt Glück, dass ich Euch nicht jetzt sofort tötet... sondern dass ich größere Pläne mit Euch habe.",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["ART"] = "SAY",
		},
		["Text_192"] = {
			["WAS"] = "Manchmal gehen Ablenkungsmanöver auch ins Auge und lassen die Orcs misstrauisch werden. In diesen Fällen suchen sie aktiv nach uns. Am besten haltet Ihr Euch von allen Orcs, die Verstohlenheit entdeckt haben, fern.",
			["SPRACHE"] = "NULL",
			["WER"] = "Jorgensen",
			["ART"] = "SAY",
		},
		["Text_125"] = {
			["WAS"] = "Okay! Ich werfen ins Wasser.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gebändigter Schluchtettin",
			["ART"] = "SAY",
		},
		["Text_361"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Flottenmeister Seehorn",
			["WAS"] = "Das genügt.",
		},
		["Text_427"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["WAS"] = "Beifahrer!",
		},
		["Text_196"] = {
			["WAS"] = "Das Rotkammgebirge wird sich erholen, aber die Orcs bestimmt nicht...",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["ART"] = "SAY",
		},
		["Text_111"] = {
			["WAS"] = "Grrr... Frischfleisch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Bastard der Rotkammgnolle",
			["ART"] = "SAY",
		},
		["Text_458"] = {
			["WAS"] = "Hurra! Meine Puppe!",
			["SPRACHE"] = "NULL",
			["WER"] = "Pamela Rotpfad",
			["ART"] = "SAY",
		},
		["Text_193"] = {
			["WAS"] = "Einmal erzählte mir Keeshan, dass er fünf wie mich auf einen Streich erledigen könne. Warum bin ich so schwach?",
			["SPRACHE"] = "NULL",
			["WER"] = "Jorgensen",
			["ART"] = "SAY",
		},
		["Text_167"] = {
			["WAS"] = "Lok maka zaga Makogg kag kil Moth''kazoroth ",
