		["Text_390"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "\"Blindauge\" Drederick McGumm",
			["WAS"] = "Ich sollte auf die Purpurschleier zurückkehren. Ich sehe Euch dort.",
		},
		["Text_164"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Lehrling von Herdweiler",
			["WAS"] = "Macht Euch bereit, denn jetzt komm'' ich!",
