			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Edna Mullby",
			["WAS"] = "Seid gegrüßt.",
		},
		["Text_273"] = {
			["WAS"] = "%s beginnt, einen Veteranen der Schwarzfaustlegion zu beschwören!",
			["SPRACHE"] = "NULL",
			["WER"] = "Beschwörer der Schwarzfaustlegion",
			["ART"] = "EMOTE",
		},
		["Text_526"] = {
			["WAS"] = "Ihr seid nicht alleine, Tarenar. Ihr habt Euch auf diesem Weg Verbündete gemacht. Und abgesehen davon, seid Ihr auch selbst ein fähiger Paladin.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["ART"] = "SAY",
		},
		["Text_302"] = {
			["WAS"] = "Von Eurer Art sind viele hier, doch ich würde mir keine Sorgen um die Konkurrenz machen. Ihr entstammt dem Geschlecht Ohgans, meinem ältesten Freund. Ihr seht also... unsere Seelen sind verbunden, Eure und meine.",
			["SPRACHE"] = "NULL",
			["WER"] = "Blutfürst Mandokir",
			["ART"] = "SAY",
		},
		["Text_45"] = {
			["WAS"] = "Narr!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zurückgezogene Seele",
			["ART"] = "YELL",
		},
		["Text_293"] = {
			["WAS"] = "Ich bin hier! Jetzt, ihr elenden kleinen Würmer, werdet ihr für euer Eindringen bezahlen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Solakar Feuerkrone",
			["ART"] = "YELL",
		},
		["Text_306"] = {
			["WAS"] = "Es brennt! Beeilt Euch, Mann!",
			["SPRACHE"] = "NULL",
			["WER"] = "Soldat der Gurubashi",
			["ART"] = "YELL",
		},
		["Text_6"] = {
			["WAS"] = "Schmerzgeläutert!",
			["SPRACHE"] = "NULL",
			["WER"] = "Befrager Vishas",
			["ART"] = "YELL",
		},
		["Text_166"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["WAS"] = "Der Tauren sagt, dass sie mir beibringt, wie man heilt, wenn wir gute Arbeit leisten! Gehen wir, Mann!",
		},
		["Text_116"] = {
			["WAS"] = "Vergesst es, Solomon. Ich finde meine Familie allein.",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Bürger des Rotkammgebirges",
			["ART"] = "SAY",
		},
		["Text_424"] = {
