			["WAS"] = "Kalte Logik befand unseren Planeten nicht der Rettung würdig. Jedoch trägt Logik nicht der Macht des freien Willens Rechnung. Es ist an uns, zu beweisen, dass diese Welt es wert ist, gerettet zu werden.",
			["SPRACHE"] = "NULL",
			["WER"] = "Rhonin",
			["ART"] = "YELL",
		},
		["Text_74"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["WAS"] = "Bereit, Mann!",
		},
		["Text_527"] = {
			["WAS"] = "Ich, fähig? Nein, nein, Gidwin war der gute Paladin. Er ist derjenige, der jede Nacht stundenlang wachblieb und übte...",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["ART"] = "SAY",
		},
		["Text_525"] = {
			["WAS"] = "Ich bin mir nicht sicher, ob ich bereit bin, alleine dorthin zu gehen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["ART"] = "SAY",
		},
		["Text_523"] = {
			["WAS"] = "Wenn wir ihn finden wollen, sind wir auf dem richtigen Weg. Es ist wahrscheinlich, dass er nach Stratholme gebracht wurde oder vielleicht auch in den Pestwald.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_418"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Thassarian",
			["WAS"] = "Für die Allianz!",
		},
		["Text_520"] = {
			["WAS"] = "Es ist wahrscheinlich, dass er irgendwo gefangengehalten wird und sein Todesritual erwartet.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_519"] = {
			["WAS"] = "Ein Paladin wie Gidwin gibt einen guten Todesritter ab. Das weiß jedes Mitglied der Geißel, das mächtig genug ist, ihn zu besiegen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_518"] = {
			["WAS"] = "Ein Grund mehr, zu glauben, dass er noch lebt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_22"] = {
			["WAS"] = "Gut, dann lasst uns beginnen. Je länger wir hier sind, desto mehr Schaden können die Untoten im Hügelland anrichten.",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kinelory",
			["ART"] = "SAY",
		},
		["Text_335"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["WAS"] = "Ich entsinne mich, was Ihr mit Euren Elixieren zu leisten vermögt. Würdet Ihr mit Euren Elixieren einem alten Freund weiterhelfen?",
		},
		["Text_149"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Aradne",
			["WAS"] = "Knie nieder, Allianz! Knie vor der Macht der Verlassenen!",
		},
		["Text_131"] = {
			["WAS"] = "Es besteht Hoffnung, Solomon.",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberst Trottmann",
			["ART"] = "SAY",
		},
		["Text_517"] = {
			["WAS"] = "Er hat sich stets weitergebildet, hat immer versucht, sich zu verbessern.",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["ART"] = "SAY",
		},
		["Text_165"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kessellord Rachseele",
			["WAS"] = "$C - ich verschlinge Euer Licht!",
		},
		["Text_516"] = {
			["WAS"] = "Nein, er würde niemals sein Gebetsbuch einfach so zurücklassen! Er hatte seine Nase immer tief in das Buch gesteckt, um sich weiterzubilden.",
			["SPRACHE"] = "NULL",
			["WER"] = "Tarenar Sonnenhieb",
			["ART"] = "YELL",
		},
		["Text_515"] = {
			["WAS"] = "Wir können nicht sicher sein, dass er getötet wurde. Vielleicht ist er von irgendwo fortgelaufen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_128"] = {
			["WAS"] = "Wo ist die Unterstützung, die wir aus Sturmwind angefordert haben?",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Bürger des Rotkammgebirges",
			["ART"] = "SAY",
		},
		["Text_514"] = {
			["WAS"] = "Es ist nicht deine Schuld, Tarenar. Er ist aus freien Stücken fortgelaufen. Niemand von uns könnte ihn aufhalten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["ART"] = "SAY",
		},
		["Text_512"] = {
			["WAS"] = "Wir sehen uns auf den grünen Felder auf der anderen Seite, $N.",
			["SPRACHE"] = "NULL",
			["WER"] = "Vex''tul",
			["ART"] = "SAY",
		},
		["Text_201"] = {
			["WAS"] = "Achtung! SPRENGLADUNG!",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["ART"] = "SAY",
		},
		["Text_511"] = {
			["WAS"] = "Ich muss nun fort. Ich habe keinen Grund hier zu bleiben. Ich bin vielleicht untot, aber meinen Willen habe ich noch.",
			["SPRACHE"] = "NULL",
			["WER"] = "Vex''tul",
			["ART"] = "SAY",
		},
		["Text_2"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Snurk Zasterwill",
			["WAS"] = "Der Zeppelin nach Grom''gol ist soeben eingetroffen! Wer in das Schlingendorntal will, sollte an Bord gehen!",
		},
		["Text_182"] = {
			["WAS"] = "Wir sind hier, alle raus!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "John J. Keeshan",
			["ART"] = "SAY",
		},
		["Text_68"] = {
			["WAS"] = "Verfolgt mich wenn Ihr wollt! Rennt wenn Ihr Euch schert.",
			["SPRACHE"] = "NULL",
			["WER"] = "Pusillin",
			["ART"] = "SAY",
		},
		["Text_510"] = {
			["WAS"] = "Ich reiße Euch die Augäpfel raus, Schwächling...",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegsherr Thresh''jin",
			["ART"] = "YELL",
		},
		["Text_224"] = {
			["WAS"] = "Im Wald wimmelt es nur so von Worgen und Ghulen. Es muss etwas geschehen!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Ratsherr Mühlenstein",
			["ART"] = "SAY",
		},
		["Text_285"] = {
			["WAS"] = "Bitte lasst mich in den Kampf ziehen, Sire! Ich werde ihnen mit bloßen Händen den Rücken brechen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegshäuptling Rend Schwarzfaust",
			["ART"] = "YELL",
		},
		["Text_377"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Korsar der Blutsegelbukaniere",
			["WAS"] = "Ich würde die Bukaniere niemals verlassen, Ihr walfettschnüffelnder Rockzipfelhänger.",
		},
		["Text_470"] = {
			["WAS"] = "Das erscheint kaum gerecht!!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_453"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["WAS"] = "Da sind wir!",
		},
		["Text_358"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Negolash",
			["WAS"] = "Hmmm... ICH RIECHE ESSEN!",
		},
		["Text_159"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Lehrling von Herdweiler",
			["WAS"] = "Gut gekämpft.",
		},
		["Text_508"] = {
			["WAS"] = "Die Geißel wird sich wieder erheben, unter einem neuen Meister... Ix''lar!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ix''lar der Unterfürst",
			["ART"] = "YELL",
		},
		["Text_313"] = {
			["WAS"] = "NIEMAND entkommt aus Zul''Gurub! Nicht wenn Jin''do aufpasst!",
			["SPRACHE"] = "NULL",
			["WER"] = "Schatten des Verhexers",
			["ART"] = "YELL",
		},
		["Text_506"] = {
			["WAS"] = "Habt Ihr das gesehen, Tarenar?",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_480"] = {
			["WAS"] = "Wandelt Ihr gewöhnlich allein auf diesen Straßen?",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["ART"] = "SAY",
		},
		["Text_7"] = {
			["WAS"] = "Garstige Geheimnisse!",
			["SPRACHE"] = "NULL",
			["WER"] = "Befrager Vishas",
			["ART"] = "YELL",
		},
		["Text_247"] = {
			["WAS"] = "Nee!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Adam",
			["ART"] = "SAY",
		},
		["Text_504"] = {
			["WAS"] = "Eure Aufwärmphase ist vorüber. Jetzt beginnt die echte Prüfung!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Raymond George",
			["ART"] = "SAY",
		},
		["Text_194"] = {
			["WAS"] = "Ab und zu treffen wir auf einen einzelnen Orc, der zwischen uns und dem Sieg steht. In solchen Situationen verwendet man am besten Chloroform. Denkt aber daran, dass wir beim Einsatz von Chloroform hinter dem Feind stehen müssen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Jorgensen",
			["ART"] = "SAY",
		},
		["Text_503"] = {
			["WAS"] = "Ich kann es nicht glauben, dass wir tatsächlich für den Kreuzzug kämpfen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_121"] = {
			["WAS"] = "UND HOCH!",
			["SPRACHE"] = "NULL",
			["WER"] = "Brückentagelöhner Alex",
			["ART"] = "SAY",
		},
		["Text_500"] = {
			["WAS"] = "Ka-bumm!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_496"] = {
			["WAS"] = "Zu Fuß, wie...?",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_494"] = {
			["WAS"] = "NEEEEEEEIN! Wieder aufgehalten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_493"] = {
			["WAS"] = "Aber ich werde Euch doch nicht einfach nur absetzen, Meister Leuchtfeuer. Wir werden herzlich gern auf Euch warten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["ART"] = "SAY",
		},
		["Text_408"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Baron Revilgaz",
			["WAS"] = "Blast diese feigen Strolche aus dem Wasser!",
		},
		["Text_41"] = {
			["WAS"] = "Licht, gib mir Kraft!",
			["SPRACHE"] = "NULL",
			["WER"] = "Herod",
			["ART"] = "YELL",
		},
		["Text_158"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Lehrling von Herdweiler",
			["WAS"] = "Mama hatte recht... Ich werde es NIE in den Argentumkreuzzug schaffen.",
		},
		["Text_449"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["WAS"] = "Das hier ist ein heißes Pflaster, Gidwin. Ich will nicht riskieren, ein Pferd zu verlieren.",
		},
		["Text_69"] = {
			["WAS"] = "STIRB! Du bringst Pusillin zum weinen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Pusillin",
			["ART"] = "SAY",
		},
		["Text_20"] = {
			["WAS"] = "Explosionen! MEHR Explosionen! Ich brauche mehr Explosionen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Robogenieur Thermadraht",
			["ART"] = "YELL",
		},
		["Text_490"] = {
			["WAS"] = "Gewiss. Ich komme nicht mehr so oft raus bis zum Hoffnungsvollen Licht, aber wenn Ihr dort eintrefft, sagt Max Tyrosus, dass ich Euch geschickt habe.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_489"] = {
			["WAS"] = "Könntet Ihr da vielleicht ein gutes Wort für uns einlegen? Wir wollen dem Orden beitreten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gidwin Goldzopf",
			["ART"] = "SAY",
		},
		["Text_127"] = {
			["WAS"] = "Die Gnolle waren nie zuvor so angriffslustig. Was geht hier vor, Solomon? Sagt es uns!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Bürger des Rotkammgebirges",
			["ART"] = "SAY",
		},
		["Text_64"] = {
			["WAS"] = "Ja, ich weiß. Und glaubt ja nicht, dass ich sanft mit Euch umgehen werde.",
			["SPRACHE"] = "NULL",
			["WER"] = "Koltira Todesweber",
			["ART"] = "SAY",
		},
		["Text_3"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Frezza",
			["WAS"] = "Der Zeppelin nach Unterstadt ist soeben eingetroffen! Wer nach Tirisfal will, sollte an Bord gehen!",
		},
		["Text_487"] = {
			["WAS"] = "Wo wir dabei sind: Wenn jemand von Euch gerne etwas repariert hätte, lasst es mich wissen. Ich bin Euch gerne zu Diensten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_235"] = {
			["WAS"] = "Bei Kurzens Schwert!",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberstabschef Esquivel",
			["ART"] = "SAY",
		},
		["Text_138"] = {
			["WAS"] = "JOHN J. KEESHAN.",
			["SPRACHE"] = "NULL",
			["WER"] = "Oberst Trottmann",
			["ART"] = "SAY",
		},
		["Text_483"] = {
			["WAS"] = "Ich betreue die fünf Argentumtürme. Hauptsächlich Reparaturen und Instandhaltungen und ein paar kleinere Magiearbeiten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_481"] = {
			["WAS"] = "Ja, in der Tat. Obwohl es einfacher war, als ich noch jünger war. Heutzutage muss man besser aufpassen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_472"] = {
			["WAS"] = "Weil du so mutig bist, Schatz.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["ART"] = "SAY",
		},
		["Text_305"] = {
			["WAS"] = "Hierher, Brüder, schnell!",
			["SPRACHE"] = "NULL",
			["WER"] = "Soldat der Gurubashi",
			["ART"] = "YELL",
		},
		["Text_505"] = {
			["WAS"] = "Gute Arbeit, Helden. Ihr habt meine Kampfprüfung bestanden.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Raymond George",
			["ART"] = "SAY",
		},
		["Text_465"] = {
			["WAS"] = "Ihr dürft uns nicht enttäuschen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Poltergeist von Darroheim",
			["ART"] = "SAY",
		},
		["Text_188"] = {
			["WAS"] = "Jorgensen, was könnt Ihr uns über Renders Tal sagen?",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["ART"] = "SAY",
		},
		["Text_479"] = {
			["WAS"] = "Öhm! Ich, äh, weiß es zu schätzen, dass Ihr mich mitnehmt, Fiona. Es ist schön, mal nicht zu Fuß zu gehen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argus Leuchtfeuer",
			["ART"] = "SAY",
		},
		["Text_185"] = {
			["WAS"] = "Krakauer?",
			["SPRACHE"] = "NULL",
			["WER"] = "John J. Keeshan",
			["ART"] = "SAY",
		},
		["Text_379"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Korsar der Blutsegelbukaniere",
			["WAS"] = "Zieht Eure eigene Waffe, Ihr harpyienliebender Schurke!",
		},
		["Text_402"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Baron Revilgaz",
			["WAS"] = "Firallon, kommt heraus und kämpft wie ein Goblin!",
		},
		["Text_229"] = {
			["WAS"] = "Wenn Ihr nichts einzuwenden habt, werde ich uns zurück zum Rebellenlager teleportieren. Wir werden uns später persönlich bedanken.",
			["SPRACHE"] = "NULL",
			["WER"] = "Emerine Junis",
			["ART"] = "SAY",
		},
		["Text_291"] = {
			["WAS"] = "%s wird von seinem Drachen geworfen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegshäuptling Rend Schwarzfaust",
			["ART"] = "EMOTE",
		},
		["Text_252"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Brazie der Botaniker",
			["WAS"] = "Zombies haben Euer Gehirn!",
		},
		["Text_181"] = {
			["WAS"] = "Alles klar, Johnny!",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Messner",
			["ART"] = "SAY",
		},
		["Text_10"] = {
			["WAS"] = "Keine Ruhe... für die wütenden Toten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Blutmagier Thalnos",
			["ART"] = "YELL",
		},
		["Text_15"] = {
			["WAS"] = "Warnung! Warnung! Eindringling! Alarm! Eindringling! Alarm!",
			["SPRACHE"] = "NULL",
			["WER"] = "Mobiles Alarmsystem",
			["ART"] = "YELL",
		},
		["Text_215"] = {
			["WAS"] = "Ich... Ich kann nicht...",
			["SPRACHE"] = "NULL",
			["WER"] = "Bibbers",
			["ART"] = "SAY",
		},
		["Text_475"] = {
			["WAS"] = "Ich weiß, ich habe dir den Vordersitz versprochen, Giddy, aber wir haben einen älteren Gast. Tut mir leid.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fiona",
			["ART"] = "SAY",
		},
		["Text_292"] = {
			["WAS"] = "Euer Sieg wird nicht von langer Dauer sein. Die Tage der Allianz und der Horde sind gezählt! Unser nächstes Zusammentreffen wird unser letztes sein.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Victor Nefarius",
			["ART"] = "YELL",
		},
		["Text_236"] = {
			["WAS"] = "Benötigt Ihr irgendetwas?",
			["SPRACHE"] = "NULL",
			["WER"] = "Emerine Junis",
			["ART"] = "SAY",
		},
		["Text_9"] = {
			["WAS"] = "Wir dürsten nach Rache.",
			["SPRACHE"] = "NULL",
			["WER"] = "Blutmagier Thalnos",
			["ART"] = "YELL",
		},
		["Text_300"] = {
			["WAS"] = "Willkommen in Zul''Gurub, kleines Wesen. Es sieht jetzt vielleicht nicht nach viel aus, aber gebt ihm Zeit...",
			["SPRACHE"] = "NULL",
			["WER"] = "Blutfürst Mandokir",
			["ART"] = "SAY",
		},
		["Text_288"] = {
			["WAS"] = "Mit Vergnügen...",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegshäuptling Rend Schwarzfaust",
			["ART"] = "YELL",
		},
		["Text_126"] = {
			["WAS"] = "TSCHÜSS VATI!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gebändigter Schluchtettin",
			["ART"] = "YELL",
		},
		["Text_266"] = {
			["WAS"] = "Als ob ich auf meine alten Tage nichts Besseres zu tun hätte, als Wassereimer zu schleppen.",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Alte Emma",
			["ART"] = "SAY",
		},
		["Text_298"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kyra Boucher",
