			["WER"] = "Martin Victus",
			["WAS"] = "Mutige Champions, wir schulden Euch unser Leben, unsere Freiheit - Es mag nur eine winzige Geste sein, doch ich schwöre, dass von diesem Tag an jeder um Eure Taten wissen wird, und um den gleißenden Pfad des Lichtes, den Ihr durch diese dunkle Zitadelle gebahnt habt.",
