		},
		["Text_216"] = {
			["WAS"] = "Achtet auf Euren Ton, General. Weder Ihr noch Garrosh müsst Euch Sorgen machen. Die Produktion der Seuche wurde eingestellt, ganz wie befohlen. Wir würden sie nie ohne seine Erlaubnis einsetzen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["ART"] = "SAY",
		},
		["Text_214"] = {
			["WAS"] = "Ihr könnt Garrosh versichern, dass dies nur ein kleiner Rückschlag ist. Unser Sieg in Gilneas wird endgültig sein.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["ART"] = "SAY",
		},
		["Text_94"] = {
			["WAS"] = "Ich spüre Lebende. Seid bereit.",
			["SPRACHE"] = "NULL",
			["WER"] = "Krik''thir der Torwächter",
			["ART"] = "YELL",
		},
		["Text_394"] = {
			["WAS"] = "Das ist einfach zu leicht...",
			["SPRACHE"] = "NULL",
			["WER"] = "Baron Ashbury",
			["ART"] = "YELL",
		},
		["Text_70"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Martin Victus",
			["WAS"] = "Dieser Tag soll dafür in Erinnerung bleiben, dass niemand, nicht einmal der Lichkönig selbst, gegen Allianz und Horde bestehen kann, wenn sie ihre Differenzen...",
		},
		["Text_326"] = {
			["WAS"] = "Vanessa van Cleef ist noch immer irgendwo dort draußen und intrigiert gegen uns. Glücklicherweise ist sie ohne diese Basis praktisch machtlos gegen die Gewalt der Allianz.",
			["SPRACHE"] = "NULL",
			["WER"] = "Leutnant Horatio Laine",
			["ART"] = "SAY",
		},
		["Text_187"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Tobias Dunstmantel",
			["WAS"] = "Es wird geschehen!",
		},
		["Text_414"] = {
			["WAS"] = "Zum Angriff, meine Brüder! Lasst ihn den Zorn des Rudels spüren!",
			["SPRACHE"] = "NULL",
			["WER"] = "Rudelführer Ivar Blutfang",
			["ART"] = "YELL",
		},
		["Text_109"] = {
			["WAS"] = "Helft mir!",
			["SPRACHE"] = "NULL",
			["WER"] = "Bürger von Sturmwind",
			["ART"] = "SAY",
		},
		["Text_139"] = {
			["WAS"] = "Hier drüben, ihr Mistviecher!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lord Darius Crowley",
			["ART"] = "YELL",
		},
		["Text_296"] = {
			["WAS"] = "Die Herrin entlohnt mich gut für Eure Köpfe!",
			["SPRACHE"] = "NULL",
			["WER"] = "Helix Ritzelbrecher",
			["ART"] = "YELL",
		},
		["Text_233"] = {
			["WAS"] = "Sichert die Sparren!",
			["SPRACHE"] = "NULL",
			["WER"] = "Lorna Crowley",
			["ART"] = "YELL",
		},
		["Text_81"] = {
			["WAS"] = "Das Ende der Welt rückt näher, Brüder und Schwestern! Azeroth wird nicht mehr sein!",
			["SPRACHE"] = "NULL",
			["WER"] = "Weltuntergangsverkünder",
			["ART"] = "SAY",
		},
		["Text_93"] = {
			["WAS"] = "$N! Ah, großartig, Euch auf den Beinen zu sehen. Geschäftig wie immer, hm?",
			["SPRACHE"] = "NULL",
			["WER"] = "Linda Ann Kastinglow",
			["ART"] = "SAY",
		},
		["Text_50"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Krick",
			["WAS"] = "Was Ihr sucht ist im Hort des Meisters, doch dafür müsst Ihr an Tyrannus vorbei. In den Hallen der Reflexion werdet Ihr Frostgram finden. Es... es birgt die Wahrheit.",
		},
		["Text_179"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Dunkle Späherin",
			["WAS"] = "Wie habt Ihr...?! Auch egal - ich brauche keine Falle, um Euch zu vernichten.",
		},
		["Text_17"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Vergessener Diener",
			["WAS"] = "Ich... schlecht?",
		},
		["Text_80"] = {
			["WAS"] = "Hört mich, Bürger von Sturmwind! Wir haben lange in Ungewissheit gelebt. Ich bitte Euch, öffnet Eure Augen, so wie ich!",
			["SPRACHE"] = "NULL",
			["WER"] = "Weltuntergangsverkünder",
			["ART"] = "SAY",
		},
		["Text_9"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Besorgter Bürger",
			["WAS"] = "Er ist einfach verschwunden, und ich weiß nicht, was ich tun soll!",
		},
		["Text_323"] = {
			["WAS"] = "Ihr werdet sie... nicht finden... bis es zu spät ist...",
			["SPRACHE"] = "NULL",
			["WER"] = "Admiral Knurrreißer",
			["ART"] = "YELL",
		},
		["Text_115"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Liam Graumähne",
			["WAS"] = "Ich will, dass das ganze Gebiet hier gesichert ist und die Tore immer mit zwei Männern besetzt sind. Niemand kommt rein, niemand raus.",
		},
		["Text_19"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Alistra",
			["WAS"] = "Hmm...",
		},
		["Text_330"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kapitän \"Schatzsucher\" Torgoley",
			["WAS"] = "Ein Lob an alle. Bringt uns heil zum nächsten Hafen.",
		},
		["Text_329"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Bart Tidenwasser",
			["WAS"] = "Was für eine Tragödie, Jungs. Der Fluch von Menethil wird uns alle heimsuchen.",
		},
		["Text_90"] = {
			["WAS"] = "Ich will nicht sterben!",
			["SPRACHE"] = "NULL",
			["WER"] = "Bürger von Sturmwind",
			["ART"] = "SAY",
		},
		["Text_824"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtinitiand",
			["WAS"] = "Der Kerl hat verstanden, worum es geht!",
		},
		["Text_201"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["WAS"] = "Mal''Ganis scheint mehr als nur die Geißel in seinem Arsenal zu haben. Wir sollten uns beeilen.",
		},
		["Text_1173"] = {
			["WAS"] = "Es ist vollbracht! Wir sind fertig.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdenrufer Torunskar",
			["ART"] = "YELL",
		},
		["Text_2"] = {
			["WAS"] = "Der Zeppelin nach Orgrimmar ist soeben angekommen! Wer nach Durotar möchte, sollte an Bord gehen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Nargo Bohrschraub",
			["ART"] = "YELL",
		},
		["Text_92"] = {
			["WAS"] = "Mein Leiden ist ewig!",
			["SPRACHE"] = "NULL",
			["WER"] = "Nachtseele",
			["ART"] = "SAY",
		},
		["Text_79"] = {
			["WAS"] = "Den Verlassenen ist es nicht möglich, sich fortzupflanzen.",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["ART"] = "SAY",
		},
		["Text_68"] = {
			["WAS"] = "Der Zeppelin nach Unterstadt ist soeben angekommen! Wer nach Tirisfal möchte, sollte an Bord gehen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Drenk Spannfunke",
			["ART"] = "YELL",
		},
		["Text_1214"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Harrison Jones",
			["WAS"] = "Hui... ganz ruhig jetzt.",
		},
		["Text_1422"] = {
			["WAS"] = "Borne ras Vrum ",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Kriegsgezeichneter der Wildhämmer",
			["ART"] = "SAY",
		},
		["Text_946"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Spalt Steinbrecher",
			["WAS"] = "In der Tat!",
		},
		["Text_943"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Flint Erzmantel",
			["WAS"] = "Vater! Lasst mich Euch von diesen Fesseln befreien.",
		},
		["Text_666"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Brann Bronzebart",
			["WAS"] = "Ich werde die Schmiede benutzen, um ''ne Ladung Irdene zu erschaffen, die Wache stehen können... Aber unsere größte Herausforderung bleibt bestehen: Loken zu finden und aufzuhalten!",
		},
		["Text_1569"] = {
			["WAS"] = "Ich sehe die hohle Metallhülle eines einst großen Mitstreiters, und die kostbare Gabe der Titanen, verschwendet.",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["ART"] = "SAY",
		},
		["Text_276"] = {
			["WAS"] = "Ich werde mein Gesicht mit Eurem Blut bemalen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ingvar der Brandschatzer",
			["ART"] = "YELL",
		},
		["Text_84"] = {
			["WAS"] = "Kriegshäuptling, ohne diese neuen Verlassenen wird mein Volk aussterben... Unsere Macht in Gilneas und im nördlichen Lordaeron würde schwinden.",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["ART"] = "SAY",
		},
		["Text_313"] = {
			["WAS"] = "Mein verrottetes Fleisch war sowieso nur im Weg!",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Schwarze Ritter",
			["ART"] = "YELL",
		},
		["Text_296"] = {
			["WAS"] = "Ich danke Euch, werter Herold. Ihr seid zu gütig.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argentumbeichtpatin Blondlocke",
			["ART"] = "SAY",
		},
		["Text_1494"] = {
			["WAS"] = "Achtet auf diese Tentakeln! Sie haben eine große Reichweite.",
			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Mylra",
			["ART"] = "SAY",
		},
		["Text_1450"] = {
			["WAS"] = "Wenn ich siegreich zurückkehre, werden wir ja sehen, wen der Drachenmalklan \"Kriegshäuptling\" nennt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Narkrall Harkenklaue",
			["ART"] = "SAY",
		},
		["Text_1373"] = {
			["WAS"] = "Das ist Wahnsinn!",
			["SPRACHE"] = "NULL",
			["WER"] = "Unterhändler der Horde",
			["ART"] = "SAY",
		},
		["Text_380"] = {
			["WAS"] = "Ranulf aus dem schreienden Abgrund! Erstickt diese Maden in dunkelster Nacht!",
			["SPRACHE"] = "NULL",
			["WER"] = "König Ymiron",
			["ART"] = "YELL",
		},
		["Text_932"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Pyrium Leitstein",
			["WAS"] = "$N, Ihr solltet wohl über diese Riesen und Steintroggs hinwegfliegen. Versucht nicht durch ihre Reihen zu reiten.",
		},
		["Text_1122"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fungumant Glop",
			["WAS"] = "Pilze werden groß und stark. Zu groß zum Zerstampfen! So stark, sie stampfen zurück!",
		},
		["Text_225"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["WAS"] = "Ihr habt Euch gut geschlagen. Alles, was Mal''Ganis zurückgelassen hat, gehört Euch. Es ist Eure Belohnung. Ich muss jetzt die Expedition nach Nordend planen.",
		},
		["Text_934"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Reaktiviertes Kriegskonstrukt",
			["WAS"] = "Tötet den Mystiker, der Euch am nächsten ist.",
		},
		["Text_409"] = {
			["WAS"] = "Wir werden dies hier und jetzt beenden, Helden der Kirin Tor!",
			["SPRACHE"] = "NULL",
			["WER"] = "Cyanigosa",
			["ART"] = "YELL",
		},
		["Text_370"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Novos der Beschwörer",
			["WAS"] = "%s ruft um Hilfe!",
		},
		["Text_1515"] = {
			["WAS"] = "Flüstern... Flüstern... Ich kann das Flüstern hören...",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtentführer",
			["ART"] = "SAY",
		},
		["Text_801"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kugel des Aufstiegs",
			["WAS"] = "Fließen Flüsse gegen den Strom?",
		},
		["Text_1383"] = {
			["WAS"] = "Vielleicht. Vielleicht würden wir auch siegen, doch zu welchem Preis? Möglicherweise hat $N einen besseren Plan...",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegsfürst Krogg",
			["ART"] = "SAY",
		},
		["Text_1339"] = {
			["WAS"] = "Angriff!! Bombardiert sie, sie können nicht manövrieren!",
			["SPRACHE"] = "NULL",
			["WER"] = "Garrosh Höllschrei",
			["ART"] = "YELL",
		},
		["Text_61"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Loken",
			["WAS"] = "Mein Tod... kündet vom Ende dieser Welt.",
		},
		["Text_1048"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Höllschreis Vorhut",
			["WAS"] = "Hier, Krieger. Esst dies.",
		},
		["Text_268"] = {
			["WAS"] = "%s erhebt sich vom Boden!",
			["SPRACHE"] = "NULL",
			["WER"] = "Vrykulskelett",
			["ART"] = "EMOTE",
		},
		["Text_1264"] = {
			["WAS"] = "Neferset wird fallen! ANGRIFF!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochkommandant Kamses",
			["ART"] = "YELL",
		},
		["Text_556"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Krick",
			["WAS"] = "%s fängt an, schnell explosive Minen herbeizuzaubern!",
		},
		["Text_41"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Leywächter Eregos",
			["WAS"] = "Genießt den Flug!",
		},
		["Text_244"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Grauf",
			["WAS"] = "Skadi der Skrupellose ist innerhalb der Reichweite der Harpunenkanonen!",
		},
		["Text_158"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Argentumbauarbeiter",
			["WAS"] = "Sind dabei, den Turm und die Mauer zu reparieren! Haltet uns die fiesen Kerle vom Leib!",
		},
		["Text_525"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Geißelfürst Tyrannus",
			["WAS"] = "Eindringlinge im Territorium des Meisters. Schlagt Alarm!",
		},
		["Text_929"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kies Langfels",
			["WAS"] = "Eins der Katapultteams von Klei ist an der Front steckengeblieben. $N, ich möchte, dass Ihr einige Ersatzteile von ihm besorgt und das Katapult wieder in die Schlacht schickt!",
		},
		["Text_1015"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtdämmerungswächter",
			["WAS"] = "Wir werden angegriffen! Zu den Waffen!",
		},
		["Text_982"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Millhaus Manasturm",
			["WAS"] = "Aber sicher, Gnädigste. Sofort!",
		},
		["Text_1425"] = {
			["WAS"] = "Nova bor Wirsh UDEN ",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Dillan MacHurley",
			["ART"] = "YELL",
		},
		["Text_170"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Schwarze Ritter",
			["WAS"] = "Ich werde Euch nicht enttäuschen, Meister!",
		},
		["Text_634"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Krystallus",
			["WAS"] = "Zerstören...",
		},
		["Text_1238"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Caimas der Grubenmeister",
			["WAS"] = "Lockt Caimas über die Krokodileier ohne selbst auf sie zu treten!",
		},
		["Text_685"] = {
			["WAS"] = "Zurück! Seine Flammen sind zu stark!",
			["SPRACHE"] = "NULL",
			["WER"] = "Galrond von der Klaue",
			["ART"] = "YELL",
		},
		["Text_915"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verteidiger von Steinruh",
			["WAS"] = "Für Steinvater Erzmantel!",
		},
		["Text_1362"] = {
			["WAS"] = "Ich... Ich kann Euch nichts von unseren Vorräten abgeben! Unser Kriegshäuptling... Er würde...",
			["SPRACHE"] = "NULL",
			["WER"] = "Gregor",
			["ART"] = "SAY",
		},
		["Text_39"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Leywächter Eregos",
			["WAS"] = "Es ist ein weiter Weg nach unten...",
		},
		["Text_658"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Brann Bronzebart",
			["WAS"] = "Ihr habt Recht, damit kann ich auch später noch weitermachen. Ich glaube, es ist an der Zeit herauszufinden, was sich hinter der Tür neben dem Eingang befindet. Ich werde mal hübsch leise rüberschleichen. Trefft mich bei der Tür und ich werde uns reinlassen.",
		},
		["Text_770"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Aessina",
			["WAS"] = "Lasst ihn gedeihen. Vertreibt diejenigen, die ihn verletzen könnten. Tut dies in meinem Namen.",
		},
		["Text_1580"] = {
			["WAS"] = "Sterblicher, nehmt Euch der Drachenkönigin an. Tragt sie in Sicherheit. Jetzt. LAUFT! Bringt sie hier weg!",
			["SPRACHE"] = "NULL",
			["WER"] = "Calen",
			["ART"] = "SAY",
		},
		["Text_1394"] = {
			["WAS"] = "$N! Der Kriegshäuptling! Er lebt! Man hat ihn vor der Küste gefunden. Kommt heraus, schnell! Die Stadt gehört uns!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegsfürst Krogg",
			["ART"] = "SAY",
		},
		["Text_446"] = {
			["WAS"] = "Ich werde Euch das Fleisch von den Knochen reißen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Herzog Singen",
			["ART"] = "YELL",
		},
		["Text_1358"] = {
			["WAS"] = "Wendet Euch wegen eines Bootes zur Küste an mich, $N!",
			["SPRACHE"] = "NULL",
			["WER"] = "Horzog",
			["ART"] = "SAY",
		},
		["Text_871"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Cenarius",
			["WAS"] = "%s wird von Ragnaros angegriffen. Heilt ihn!",
		},
		["Text_66"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Maid von Drak''Mar",
			["WAS"] = "Es war die letzten Jahre viel zu einsam an diesem See. Die Reisenden haben aufgehört zu kommen, und stattdessen hat das Böse Besitz von diesen Wassern ergriffen.",
		},
		["Text_212"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Chronolord Epoch",
			["WAS"] = "Bringen wir es zu Ende.",
		},
		["Text_1628"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Lirastrasza",
			["WAS"] = "$N, seid Ihr das? Bitte befreit mich von diesen Ketten.",
