			["WER"] = "Gurgthock",
			["ART"] = "YELL",
		},
		["Text_665"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Brann Bronzebart",
			["WAS"] = "Loken?! Das ist doch einfach lästig... Wir haben vielleicht die Eisenzwerge ausgeschaltet, doch ich möchte wetten, dass es irgendwo noch eine weitere Maschine gibt, die am laufenden Band massenweise Eisenvrykul ausspuckt.",
		},
		["Text_1377"] = {
			["WAS"] = "Ruft die anderen zusammen. Wir werden Höllschreis Horde niederschlagen und ihre Leichen ins Meer werfen...",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegshäuptling Mor''ghor",
			["ART"] = "SAY",
		},
		["Text_1096"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Naz''jar",
			["WAS"] = "Ulthok, haltet sie auf...",
