		["Text_484"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Großmagistrix Telestra",
			["WAS"] = "Nun bringen wir''s zu Ende!",
		},
		["Text_1008"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Ozruk",
			["WAS"] = "Ein Beschützer ist gefallen. Das Herz der Welt ist entblößt!",
