		},
		["Text_1352"] = {
			["WAS"] = "Der Zeppelin des Kriegshäuptlings brennt! Er stürzt ab!",
			["SPRACHE"] = "NULL",
			["WER"] = "Luftsoldat der Kor''kron",
			["ART"] = "SAY",
		},
		["Text_1396"] = {
			["WAS"] = "Kraft und Ehre. Willkommen in der Horde. Euer Volk wird sein Können unter Beweis stellen, wenn wir den Schattenhammer vernichten und die Küste erobern. Doch erst muss ich mich noch um etwas kümmern.",
			["SPRACHE"] = "NULL",
			["WER"] = "Garrosh Höllschrei",
			["ART"] = "SAY",
		},
		["Text_1567"] = {
			["WAS"] = "Der Tod ist endgültig. Ewig. Der Tod ist... mein Reich.",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesschwinge",
			["ART"] = "SAY",
		},
		["Text_1255"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "König Phaoris",
			["WAS"] = "Wir greifen Neferset bei Tagesanbruch an.",
		},
		["Text_1392"] = {
			["WAS"] = "Zaela... Verräterin... habt Ihr Eure Seele der Horde verkauft? Sind wir so verschieden? So geht zu Höllschrei. Ihr werdet sehen, wo Euch das hinführt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegshäuptling Mor''ghor",
			["ART"] = "SAY",
		},
		["Text_877"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Ragnaros",
			["WAS"] = "IHR HABT NUR DAS UNAUSWEICHLICHE VERZÖGERT, CENARIUS. AUS DEN FEUERLANDEN WERDEN MEINE ARMEEN NEU GEBOREN...",
		},
		["Text_501"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Taldaram",
			["WAS"] = "Das Summen von magischer Energie in der Luft wird schwächer...",
		},
		["Text_889"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["WAS"] = "Dies ist der Tempel der Erde, das wichtigste Gebäude in Tiefenheim.",
		},
		["Text_282"] = {
			["WAS"] = "Ihr werdet Euch zuerst drei der Großchampions des Turniers stellen! Diese grimmigen Kämpfer haben alle anderen geschlagen, um ihre Fähigkeiten in der Tjost zu perfektionieren.",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochlord Tirion Fordring",
			["ART"] = "YELL",
		},
		["Text_243"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Skadi der Skrupellose",
			["WAS"] = "Welche Hunde wagen es, hier einzudringen? Auf sie, meine Brüder! Ein Fest für den, der mir ihre Köpfe bringt!",
		},
		["Text_1279"] = {
			["WAS"] = "Wir kümmern uns sofort darum, mein Herr!",
			["SPRACHE"] = "NULL",
			["WER"] = "Goblinischer Belagerungsarbeiter",
			["ART"] = "SAY",
		},
		["Text_645"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Brann Bronzebart",
			["WAS"] = "Ihr wollt es also auf die harte Tour, was? Die hab ich am liebsten!",
		},
		["Text_512"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Jedoga Schattensucher",
			["WAS"] = "Wer von Euch ist ergeben?",
		},
		["Text_690"] = {
			["WAS"] = "Ihr seht gut aus... in einem Eintopf.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtjäger",
			["ART"] = "SAY",
		},
		["Text_720"] = {
			["WAS"] = "Unreinheit! Euer zerbrechliches Fleisch beschmutzt mein Werk.",
			["SPRACHE"] = "NULL",
			["WER"] = "Schmiedemeister Pyrendius",
			["ART"] = "SAY",
		},
		["Text_516"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Jedoga Schattensucher",
			["WAS"] = "Euer Sakrileg kann nicht... ungestraft bleiben.",
		},
		["Text_1302"] = {
			["WAS"] = "In ruhigen Gewässern wäre es garantiert seetüchtig gewesen.",
