			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtrekrut",
			["WAS"] = "Braucht Ihr etwas?",
		},
		["Text_1196"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kavem der Gefühllose",
			["WAS"] = "Wie seid Ihr hierhergekommen? Ich werde Euch vernichten!",
		},
		["Text_1459"] = {
			["WAS"] = "Dann werdet Ihr sterben.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zaela",
			["ART"] = "SAY",
		},
		["Text_917"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Katapultfahrer",
			["WAS"] = "Gehen wir. Haltet uns ja nur diese Steintroggs vom Leib.",
		},
		["Text_1281"] = {
			["WAS"] = "Ich werde Euch helfen, aber seid Euch bewusst, dass Ihr in ein Schlangennest tretet. Ich zeichne Euch eine Karte... Uah! Hinter Euch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Herezegor Flammenhauer",
			["ART"] = "SAY",
		},
		["Text_1024"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Felsen der Ausdauernde",
			["WAS"] = "Ihr seid gekommen, Euch zu beweisen, Fleischling? Die Bruchtiefen liegen im Nordosten. Der Stein, den Ihr sucht, ist dort.",
		},
		["Text_478"] = {
			["WAS"] = "Vladof der Metzger!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zuschauer im Amphitheater",
			["ART"] = "SAY",
		},
		["Text_531"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["WAS"] = "Ihr werdet Euch allein durch diese stinkende Grube kämpfen müssen.",
		},
		["Text_144"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochlord Tirion Fordring",
			["WAS"] = "Wir werden dies mit Ehre tun, Darion. Wir werden uns nicht auf eine Ebene mit der Geißel begeben, um zu siegen. Wenn wir das täten, wären wir kein Stück besser als das Monster, das wir zu zerstören trachten.",
		},
		["Text_290"] = {
