			["SPRACHE"] = "NULL",
			["WER"] = "[ph] Argent Raid Spectator - FX - Horde",
			["ART"] = "EMOTE",
		},
		["Text_1411"] = {
			["WAS"] = "Die Allianz beherrscht nun die Brückenköpfe des Zwielichtufers.",
			["SPRACHE"] = "NULL",
			["WER"] = "Dave''s Industrial Light and Magic Bunny (Small)(Sessile)",
			["ART"] = "BOSS",
		},
		["Text_1185"] = {
			["WAS"] = "Ahoy!",
