			["WER"] = "Budd",
			["ART"] = "SAY",
		},
		["Text_622"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Himmelshäscher Korm Schwarznarbe",
			["WAS"] = "Kommt an Bord, JETZT! Dieser ganze Berghang kann jederzeit runterkommen!",
		},
		["Text_135"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Drakos der Befrager",
			["WAS"] = "Ich verurteile euch zum Tode!",
		},
		["Text_57"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Loken",
			["WAS"] = "Eure Ignoranz reicht tief. Seht ihr nicht, wohin das führt?",
		},
		["Text_1395"] = {
			["WAS"] = "Höllschrei, ich bin Zaela vom Drachenmalklan. Euer Volk hat das meine aus der Tyrannei befreit. Wir stehen Euch zur Verfügung. Befehlt über die Macht des Drachenmals. Für die Horde!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zaela",
			["ART"] = "SAY",
		},
		["Text_1579"] = {
			["WAS"] = "Unmöglich!",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["ART"] = "SAY",
		},
		["Text_261"] = {
			["WAS"] = "Ahhh... RAAAAAH! Hätte nie gedacht... ich wäre einmal frei von ihm...",
			["SPRACHE"] = "NULL",
			["WER"] = "Anub''arak",
			["ART"] = "YELL",
		},
		["Text_1160"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
