		["Text_546"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Schmiedemeister Garfrost",
			["WAS"] = "Garfrost sterbliche Winzlinge leid. Jetzt Eure Knochen einfriert!",
