			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Novos der Beschwörer",
			["WAS"] = "Eure Mühen... sind umsonst.",
		},
		["Text_347"] = {
			["WAS"] = "LEID! SCHMERZ! CHAOS! ERHEBT UND LABET EUCH!",
			["SPRACHE"] = "NULL",
			["WER"] = "Verschlinger der Seelen",
			["ART"] = "YELL",
		},
