			["ART"] = "SAY",
		},
		["Text_661"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Brann Bronzebart",
			["WAS"] = "Das is''n bisschen kniffeliger als vorher... Oh, verdammt... da kommt was!",
		},
		["Text_1526"] = {
			["WAS"] = "Unsere Freundschaft ist VORBEI!",
