			["WER"] = "Bilgewässer Großknecht",
			["ART"] = "SAY",
		},
		["Text_996"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erschöpfte Schildwache der Erdwächter",
			["WAS"] = "Hatte schon geglaubt, man hätte uns hier draußen vergessen. Danke für die Hilfeleistung!",
		},
		["Text_766"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Aessina",
			["WAS"] = "Beschützer der Tiere... Bezwinger der Drachen... Champion der Uralten...",
		},
		["Text_118"] = {
			["WAS"] = "Der Kampf fängt gleich an! Nîghtstorm trifft auf den wilden Grollhuf, Schmetterzehe!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["ART"] = "YELL",
		},
		["Text_267"] = {
			["WAS"] = "%s wirkt Frostgrab auf Priletto.",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Keleseth",
			["ART"] = "BOSS",
		},
		["Text_410"] = {
			["WAS"] = "Vielleicht... haben wir... euch... unterschätzt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Cyanigosa",
			["ART"] = "YELL",
		},
		["Text_113"] = {
			["WAS"] = "Ihr jetzt begegnen wahren Champion! Immer noch wegrennen könnt, Kleiner. Wegrennen, bevor Mogor dezim... zerstö... Wegrennen, bevor Mogor TÖTET!",
			["SPRACHE"] = "NULL",
			["WER"] = "Mogor",
			["ART"] = "YELL",
		},
		["Text_102"] = {
			["WAS"] = "ROKDAR ZERSCHMETTERT WURM Invice!",
			["SPRACHE"] = "NULL",
			["WER"] = "Rokdar der Zerklüftete",
			["ART"] = "YELL",
		},
		["Text_1326"] = {
			["WAS"] = "Ich will keine weiteren Fehler sehen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Krazz",
			["ART"] = "SAY",
		},
		["Text_218"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Arthas",
			["WAS"] = "Das ist genug, wir müssen weiter. Mal''ganis wartet.",
		},
		["Text_336"] = {
			["WAS"] = "Der Argentumkreuzzug und die Ritter der Schwarzen Klinge belagern die Eiskronenzitadelle und bereiten einen massiven Angriff auf die Geißel vor. Unsere Mission ist zwar subtiler, doch ebenso wichtig.",
			["SPRACHE"] = "NULL",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["ART"] = "SAY",
		},
		["Text_910"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Schiefer Treibsand",
			["WAS"] = "$C, hier herüber.",
		},
		["Text_579"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Geißelfürst Tyrannus",
			["WAS"] = "Vielleicht hättet Ihr lieber in den Bergen bleiben sollen!",
		},
		["Text_593"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Falric",
			["WAS"] = "Männer, Frauen, Kinder... Keinen verschonte des Meisters Zorn. Euer Tod ist keine Ausnahme.",
		},
		["Text_599"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Geisterhafter Priester",
			["WAS"] = "Unsere Pein ist ewig.",
		},
		["Text_474"] = {
			["WAS"] = "Nutzloser Bastard! Dann töte ich sie eben alleine!",
			["SPRACHE"] = "NULL",
			["WER"] = "Vladof der Metzger",
			["ART"] = "YELL",
		},
		["Text_1111"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Madenklopfer von Verlok",
			["WAS"] = "Ich... Zerschmettere!",
		},
		["Text_1367"] = {
			["WAS"] = "Sehr geehrter Kriegshäuptling...",
			["SPRACHE"] = "NULL",
			["WER"] = "Unterhändler der Horde",
			["ART"] = "SAY",
		},
		["Text_611"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["WAS"] = "Mauern halten die Bansheekönigin nicht auf. Vernichtet die Untoten, ich reiße die Barriere nieder!",
		},
		["Text_401"] = {
			["WAS"] = "Wasser kann jede Form annehmen, jede Gestalt... kann jedes Hindernis überwinden.",
			["SPRACHE"] = "NULL",
			["WER"] = "Ichoron",
			["ART"] = "YELL",
		},
		["Text_1082"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Legionär Nazgrim",
			["WAS"] = "Wir haben eine Schlacht zu schlagen!",
		},
		["Text_713"] = {
			["WAS"] = "Kommt, Winde, flüster, flüster... Pusten es, pusten es, pusten es fort!",
			["SPRACHE"] = "NULL",
			["WER"] = "Aschenmaul",
			["ART"] = "SAY",
		},
		["Text_1199"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Adarrah",
			["WAS"] = "Aber ich befürchte, es ist der einzige Plan, den wir haben.",
		},
		["Text_37"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Leywächter Eregos",
			["WAS"] = "Ihr dreisten Eindringlinge gehört nicht hierher! Ich werde euch ein Ende bereiten!",
		},
		["Text_495"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Keristrasza",
			["WAS"] = "Tötet mich! Tötet mich! Oder ich schwöre bei der Drachenkönigin, Ihr erblickt das Licht nie wieder!",
		},
		["Text_27"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Magierlord Urom",
			["WAS"] = "Meine Begleiter haben versagt. Vielleicht ist eine andere Demonstration angebracht.",
		},
		["Text_397"] = {
			["WAS"] = "Mein Tod wird diese Invasion nicht aufhalten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Portalwächter",
			["ART"] = "YELL",
		},
		["Text_1401"] = {
			["WAS"] = "Habt Ihr irgendetwas Interessantes gehört, $N? Eure kleine Enthüllung über mich wird Euch gleich das Leben kosten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Sauranok der Mystiker",
			["ART"] = "SAY",
		},
		["Text_1370"] = {
			["WAS"] = "War das eine DROHUNG? Ich kenne Höllschrei noch aus der Scherbenwelt. Ein wimmernder Welpe! Er ist kein Kriegshäuptling.",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegshäuptling Mor''ghor",
			["ART"] = "SAY",
		},
		["Text_1152"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Haethen Kaul",
			["WAS"] = "Was?! Ihr seid gefeit gegen meine Luftmagie?",
		},
		["Text_1439"] = {
			["WAS"] = "Habt Ihr mich jetzt gesehen, Cho''gall? Ich komme, um Euch zu holen! Ich werde Euch den einen Kopf abreißen, während der anderen zusieht.",
			["SPRACHE"] = "NULL",
			["WER"] = "Garona die Halborcin",
			["ART"] = "SAY",
		},
		["Text_1632"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Magmazahn",
			["WAS"] = "IHR SEID ALS NÄCHSTES DRAN, SOBALD ICH EUREN FREUND HIER ERLEDIGT HABE!",
		},
		["Text_1521"] = {
			["WAS"] = "Ich glaube die Explosionen und Schüsse haben uns verraten. Ihr müsst keine Handzeichen geben.",
			["SPRACHE"] = "NULL",
			["WER"] = "Volt",
			["ART"] = "SAY",
		},
		["Text_667"] = {
			["ART"] = "WHISPER",
