			["ART"] = "YELL",
		},
		["Text_816"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gescheiterter Bittsteller",
			["WAS"] = "Hört mich an, Zwielichtfürsten! Nehmt diesen Blutelf als bescheidenes Opfer!",
		},
		["Text_305"] = {
			["WAS"] = "Gut gemacht. Ihr habt Euch heute bewiesen-",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochlord Tirion Fordring",
			["ART"] = "YELL",
		},
		["Text_721"] = {
			["WAS"] = "Eine Vision von Ysera materialisiert sich vor Euch.",
			["SPRACHE"] = "NULL",
			["WER"] = "Vision von Ysera",
			["ART"] = "EMOTE",
		},
		["Text_1644"] = {
			["WAS"] = "Champions, haltet Euch fest, während ich Euch zurück zu Khardros'' Amboss fliege!",
			["SPRACHE"] = "NULL",
			["WER"] = "Mitgenommener roter Drache",
			["ART"] = "WHISPER",
		},
		["Text_188"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Salramm der Fleischformer",
			["WAS"] = "Ah, die Unterhaltung ist da!",
		},
		["Text_1643"] = {
			["WAS"] = "Willkommen, Freund. Lasst uns durch Grim Batol reiten und Todesschwinge einen Schlag versetzen, den er so schnell nicht vergisst!",
			["SPRACHE"] = "NULL",
			["WER"] = "Mitgenommener roter Drache",
			["ART"] = "WHISPER",
		},
		["Text_185"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Ausrufer von Lordaeron",
			["WAS"] = "Truppen der Geißel sind in der Nähe des Brunnens des Königsplatzes gesehen worden!",
		},
		["Text_1642"] = {
			["WAS"] = "Habt Dank für meine Rettung. Helft nun bitte dem Rest meiner Brut!",
			["SPRACHE"] = "NULL",
			["WER"] = "Mitgenommener roter Drache",
			["ART"] = "SAY",
		},
		["Text_1133"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["WAS"] = "Ich bin froh, dass Ihr wenigstens über so viel Scharfsinn verfügt.",
		},
		["Text_1587"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Obsidia",
			["WAS"] = "Nein! Mein Gelege ist das letzte...! Vater... Ich habe versagt...",
		},
		["Text_1641"] = {
			["WAS"] = "Ich bitte Euch Helden, helft meinen Brüdern und wir werden Euch helfen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Mitgenommener roter Drache",
			["ART"] = "SAY",
		},
		["Text_288"] = {
			["WAS"] = "Die Hordezuschauer bejubeln Animà.",
			["SPRACHE"] = "NULL",
			["WER"] = "[ph] Argent Raid Spectator - FX - Horde",
			["ART"] = "EMOTE",
		},
		["Text_1582"] = {
			["WAS"] = "Calen, nein!",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["ART"] = "SAY",
		},
		["Text_1581"] = {
			["WAS"] = "Ich werde den Aspekt des Todes aufhalten. Bringt sie in Sicherheit. GEHT!",
			["SPRACHE"] = "NULL",
			["WER"] = "Calen",
			["ART"] = "SAY",
		},
		["Text_15"] = {
			["ART"] = "WHISPER",
			["SPRACHE"] = "NULL",
			["WER"] = "Rubindrache",
			["WAS"] = "Wirkt Sengende Rache, um den Feinden Schaden zuzufügen, und Ausweichmanöver, sobald ich Schaden erleide. Vergesst nicht, dass ich Ausweichladung aufbauen muss, indem ich Schaden erleide, um Ausweichmanöver auszuführen.",
		},
		["Text_571"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Krick",
			["WAS"] = "Nein, der da! Der da! Nimm den da!",
		},
		["Text_550"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Geißelfürst Tyrannus",
			["WAS"] = "Er wird ersetzt werden. Ihr verschwendet Eure Zeit.",
		},
		["Text_1631"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Magmazahn",
			["WAS"] = "AHAHAHAHAHAHA, FEUER? WIRKLICH?",
