			["ART"] = "SAY",
		},
		["Text_1574"] = {
			["WAS"] = "Der Erdenwächter... er ist tot.",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["ART"] = "SAY",
		},
		["Text_300"] = {
			["WAS"] = "Wohlan denn, lasst uns beginnen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Argentumbeichtpatin Blondlocke",
			["ART"] = "YELL",
		},
		["Text_1627"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Garona die Halborcin",
			["WAS"] = "Cho''gall versteckt sich selbst in der Bastion des Zwielichts. Ich hoffe, er beschließt, zum Spielen herauszukommen.",
		},
		["Text_1448"] = {
			["WAS"] = "Noch ein verräterisches Wort und ich werde Euch zeigen, wo Euer Platz ist, Narkrall.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zaela",
			["ART"] = "SAY",
		},
		["Text_1566"] = {
			["WAS"] = "Leben ist schwach, sterblich, flüchtig... zerbrechlich.",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesschwinge",
			["ART"] = "SAY",
		},
		["Text_608"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["WAS"] = "Er ist... zu mächtig. Schnell, Helden... kommt! Wir müssen fliehen. Ich werde mein Möglichstes tun, um ihn solange es geht an Ort und Stelle zu halten.",
		},
		["Text_232"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Volkhan",
			["WAS"] = "Leben aus der Leblosigkeit... für euch den Tod.",
		},
		["Text_1563"] = {
			["WAS"] = "Lebensbinderin! Glaubst du, du könntest mich herumkommandieren? Ich habe eine Welt zu zerstören.",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesschwinge",
			["ART"] = "SAY",
		},
		["Text_1619"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Großwesir Ertan",
			["WAS"] = "Dreckiges Gesindel! Eure Anwesenheit im Himmelswall wird nicht geduldet!",
		},
		["Text_62"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochlord Tirion Fordring",
			["WAS"] = "Eure Tapferkeit, Eure Macht und Eure Raffinesse werden genau beobachtet werden. Diese Spiele werden das Beste, was Azeroth zu bieten hat, zum Vorschein bringen.",
		},
		["Text_1616"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Freifrau Alys Finnsson",
			["WAS"] = "Wir hätten uns vernünftig verhalten können, aber nein!",
		},
		["Text_74"] = {
			["WAS"] = "Kriegshäuptling, wie schön, dass Ihr es geschafft habt.",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["ART"] = "SAY",
		},
		["Text_1614"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Mia die Rose",
			["WAS"] = "Ich wusste, dass Ihr kommt. Niemand kann mir widerstehen - nicht einmal Ihr!",
		},
		["Text_1554"] = {
			["WAS"] = "Ich werde Eure Knochen zu Staub zermalmen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichterdbinder",
			["ART"] = "SAY",
		},
		["Text_1460"] = {
			["WAS"] = "Dann soll es so sein. Es ist getan.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zaela",
			["ART"] = "SAY",
		},
		["Text_469"] = {
			["WAS"] = "Reißt sie in Stücke, Korrak der Blutrünstige!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zuschauer im Amphitheater",
			["ART"] = "SAY",
		},
		["Text_612"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Lichkönig",
			["WAS"] = "Ergebt Euch der Grabeskälte!",
		},
		["Text_1471"] = {
			["WAS"] = "Ihr seid ein echter Bombenexperte, $N!",
