			["WER"] = "Brett der Bomber",
			["ART"] = "SAY",
		},
		["Text_610"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Lichkönig",
			["WAS"] = "Des Todes kalte Arme warten.",
		},
		["Text_277"] = {
