			["SPRACHE"] = "NULL",
			["WER"] = "Ingvar der Brandschatzer",
			["ART"] = "YELL",
		},
		["Text_1509"] = {
			["WAS"] = "Nur wenige verstehen wirklich die schamanische Verbindung zur Erde. Sie verbindet unsere Wunden und beschützt uns vor Unheil.",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdheiler Duarn",
			["ART"] = "SAY",
		},
		["Text_1601"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Schädelberster der Berg",
			["WAS"] = "KÄMPFT WEITER! ICH STEIGE HINAUF UND SPRECHE MIT CHO''GALL!",
		},
		["Text_1559"] = {
			["WAS"] = "Ich möchte, dass Ihr das hier mitanseht, doch zu Eurer eigenen Sicherheit: tretet zurück. Calen, du auch.",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["ART"] = "SAY",
		},
		["Text_1409"] = {
			["WAS"] = "Wer benötigt dieses große Stück Metall dringender, Rok''tar? Ihr? ...oder derjenige, der das höchste Angebot abgibt?",
			["SPRACHE"] = "NULL",
			["WER"] = "Säft Gnugat",
			["ART"] = "SAY",
		},
		["Text_813"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gescheiterter Bittsteller",
			["WAS"] = "Ich wurde auserwählt! Ich werde siegen!",
		},
		["Text_1640"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Räuber des Zin''jatar",
			["WAS"] = "Eure Mühen sssind werden eine Opfergabe für unsssere Herrin sein!",
		},
		["Text_123"] = {
