		["Text_591"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Geisterhafter Priester",
			["WAS"] = "Dies ist nicht unsere letzte Ruhe.",
		},
		["Text_1251"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Entsandter von Ramkahen",
			["WAS"] = "Mein Lehnsherr, ein Gefecht hat sich gerade nahe der Grenze von Neferset ereignet. Eine Patrouille, die von Eurem Bruder angeführt wurde, war beteiligt.",
		},
		["Text_1531"] = {
			["WAS"] = "Kniet nieder und bereut!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochprophet Barim",
			["ART"] = "YELL",
		},
		["Text_1527"] = {
			["WAS"] = "Phaaa! Ihr bekommt den Schatz nicht!!!",
			["SPRACHE"] = "NULL",
			["WER"] = "Augh",
			["ART"] = "SAY",
		},
		["Text_1234"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Caimas der Grubenmeister",
			["WAS"] = "Es tut mir leid. Euer Freund wird nicht so bald aufwachen. Ich betäube immer das Futter für meine Krokodile. Ich kann es nicht mitansehen, wenn sie mit ihrem Essen kämpfen.",
		},
		["Text_1557"] = {
			["WAS"] = "Hat doch gut geklappt, die Zusammenarbeit.",
			["SPRACHE"] = "NULL",
			["WER"] = "Flick",
			["ART"] = "SAY",
		},
		["Text_979"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hohepriesterin Azil",
			["WAS"] = "Schmiedemeister! Ich höre, der Feind hat Eure Operationen sabotiert. Wo ist das Fragment?",
		},
		["Text_14"] = {
			["ART"] = "WHISPER",
			["SPRACHE"] = "NULL",
			["WER"] = "Rubindrache",
			["WAS"] = "Willkommen, mein Freund. Behaltet den Kopf unten und haltet Euch fest!",
		},
		["Text_687"] = {
			["WAS"] = "Ich fürchte um Alysra. Fandrals Verderbnis reichte weiter als alles, was ich im Alptraum sah. Und doch können wir uns damit nicht aufhalten.",
			["SPRACHE"] = "NULL",
			["WER"] = "Ysera",
			["ART"] = "SAY",
		},
		["Text_1519"] = {
			["WAS"] = "Sie haben auf Euch gewartet, $C.",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegsfürst Krogg",
			["ART"] = "SAY",
		},
		["Text_697"] = {
			["WAS"] = "W... Was? Wo bin ich? Ich muss weg von hier!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtbediensteter",
			["ART"] = "SAY",
		},
		["Text_1571"] = {
			["WAS"] = "Lasst sie nicht aus den Augen! Schnell - kommt mit mir!",
			["SPRACHE"] = "NULL",
			["WER"] = "Calen",
			["ART"] = "SAY",
		},
		["Text_119"] = {
			["WAS"] = "Lôri hat Schmetterzehe besiegt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["ART"] = "YELL",
		},
		["Text_1285"] = {
			["WAS"] = "%s bedeutet Euch, noch einmal mit ihm zu sprechen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Herezegor Flammenhauer",
			["ART"] = "EMOTE",
		},
		["Text_1555"] = {
			["WAS"] = "Kopfschuss!",
			["SPRACHE"] = "NULL",
			["WER"] = "Volt",
			["ART"] = "SAY",
		},
		["Text_1578"] = {
			["WAS"] = "Todesschwinge - er lebt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Calen",
			["ART"] = "SAY",
		},
		["Text_1634"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Tiefenaufseher",
			["WAS"] = "Mehr Elementium für die Bastion des Zwielichts!",
		},
		["Text_423"] = {
			["WAS"] = "Im Gegensatz zu Euch verfüge ich über ein gutes Urteilsvermögen. Ich möchte einfach nicht, dass Ihr uns in den Untergang führt, Krenna!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gorgonna",
			["ART"] = "SAY",
		},
		["Text_1511"] = {
			["WAS"] = "Ihr habt das das Gebiet der Rotdrachen erreicht, $R.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lirastrasza",
			["ART"] = "SAY",
		},
		["Text_251"] = {
			["WAS"] = "Dies ist das Reich der Geißel. Nur den Toten wird Einlass gewährt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Krik''thir der Torwächter",
			["ART"] = "YELL",
		},
		["Text_306"] = {
			["WAS"] = "Was ist das, dort, in der Nähe der Sparren?",
			["SPRACHE"] = "NULL",
			["WER"] = "Jaeren Sonnenschwur",
			["ART"] = "SAY",
		},
		["Text_671"] = {
			["WAS"] = "Nein... das kann nicht sein! Unser Außenposten wurde vernichtet!",
			["SPRACHE"] = "NULL",
			["WER"] = "Aronus",
			["ART"] = "SAY",
		},
		["Text_231"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Volkhan",
			["WAS"] = "%s rennt zu seinem Amboss!",
		},
		["Text_557"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Krick",
			["WAS"] = "Warum greifst du den an? Da drüben ist der Gefährliche, Dummkopf!",
		},
		["Text_1543"] = {
			["WAS"] = "Wird gemacht Boss. Ähm... wo tu ich ihn hin?",
			["SPRACHE"] = "NULL",
			["WER"] = "Molch",
			["ART"] = "SAY",
		},
		["Text_1055"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Höllschreis Vorhut",
			["WAS"] = "Eure Worte sind weise, Bruder. Ich nehme doch etwas Essen...",
		},
		["Text_1492"] = {
			["WAS"] = "Fühlt Ihr nicht den Blick des Meisters?! Er wacht über uns alle!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtfessler",
			["ART"] = "SAY",
		},
		["Text_537"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Hordensklave",
			["WAS"] = "Ich werde zurückgehen, um zu helfen, die restlichen Sklaven zu befreien. Ich danke Euch nochmals.",
		},
		["Text_1242"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Dunkler Ritualist Zakahn",
			["WAS"] = "Kommt, meine Kinder! Verteidigt mich!",
		},
		["Text_1312"] = {
