			["SPRACHE"] = "NULL",
			["WER"] = "Großwesir Ertan",
			["WAS"] = "%s zieht sein Wirbelsturmschild zurück!",
		},
		["Text_427"] = {
			["WAS"] = "Die Geißel durchbricht die westliche Mauer!",
			["SPRACHE"] = "NULL",
			["WER"] = "Verteidiger des Argentumstützpunkts",
			["ART"] = "YELL",
		},
		["Text_1568"] = {
			["WAS"] = "Sieh mich an und sieh den leibhaftigen Tod, den Weltenzerstörer.",
			["SPRACHE"] = "NULL",
			["WER"] = "Todesschwinge",
			["ART"] = "SAY",
		},
		["Text_191"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Salramm der Fleischformer",
			["WAS"] = "Solche Stärke... muss ich haben!",
		},
		["Text_125"] = {
			["WAS"] = "Aus den unbekannten Weiten: Skra''gath! Wird Nîghtstorm es schaffen, die wütende Energie aus der Leere zu überleben?",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["ART"] = "YELL",
		},
		["Text_192"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Salramm der Fleischformer",
			["WAS"] = "Blut... Zerstörung... BERAUSCHEND!",
		},
		["Text_1221"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verpflichteter Beschützer",
			["WAS"] = "Ihr betretet geheiligten Boden! Ihr müsst gereinigt werden!",
		},
		["Text_853"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Goldrinn",
			["WAS"] = "Spüre meinen Zorn, Wurm!",
		},
		["Text_702"] = {
			["WAS"] = "Eure Aufgabe hier auf dem Hyjal ist erledigt. Kehrt dorthin zurück, wo Ihr herkamt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Das Auge des Zwielichts",
			["ART"] = "SAY",
		},
		["Text_1469"] = {
			["WAS"] = "Benutzt dieses Dichtungsband, um die fehlerhaften Ventile richtig gut zu versiegeln, Häuptling.",
			["SPRACHE"] = "NULL",
			["WER"] = "Brett der Bomber",
			["ART"] = "SAY",
		},
		["Text_1590"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Schmetterschlagflieger",
			["WAS"] = "Warum sollten wir Euch herumkutschieren? Könnt Ihr Euch nicht einfach hineinschleichen, Mann?",
		},
		["Text_249"] = {
			["WAS"] = "Habt ein Auge auf den Tunnel... wir dürfen keinen durchlassen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Krik''thir der Torwächter",
			["ART"] = "YELL",
		},
		["Text_596"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Falric",
			["WAS"] = "Heulende Made!",
		},
		["Text_1346"] = {
			["WAS"] = "Das ist ein Angriff!",
			["SPRACHE"] = "NULL",
			["WER"] = "Luftsoldat der Kor''kron",
			["ART"] = "YELL",
		},
		["Text_246"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Skadi der Skrupellose",
			["WAS"] = "Ihr räudigen Halunken! Eure Leichen werden feine Appetithappen für meinen neuen Drachen abgeben!",
		},
		["Text_1306"] = {
			["WAS"] = "Ich verdoppele die Zahl der Arbeiter pro Schicht und investiere mein eigenes Geld, damit diese Schiffe rechtzeitig seetüchtig werden. Verlasst Euch darauf!",
			["SPRACHE"] = "NULL",
			["WER"] = "Bilgewässer Großknecht",
			["ART"] = "SAY",
		},
		["Text_263"] = {
			["WAS"] = "Euer Blut gehört mir!",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Keleseth",
			["ART"] = "YELL",
		},
		["Text_821"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtinitiand",
			["WAS"] = "Wir schreiben Geschichte!",
		},
		["Text_1088"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Terrath der Beständige",
			["WAS"] = "Beeilt Euch, $N. Die Steindrachen werden nicht einfach aufgeben.",
		},
		["Text_1063"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Turgore",
			["WAS"] = "Ihr könnt beruhigt sein - sie werden Euch sicher an Euer Ziel bringen.",
		},
		["Text_42"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Leywächter Eregos",
			["WAS"] = "Zurück auf den Boden mit euch!",
		},
		["Text_619"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["WAS"] = "VERDAMMT... EINE SACKGASSE! So endet es also. Seid bereit, Helden - denn heute ist unser letztes Gefecht!",
		},
		["Text_845"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kommandant Jarod Schattensang",
			["WAS"] = "Haltet sie auf, solange Ihr könnt!",
		},
		["Text_375"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Prophet Tharon''ja",
			["WAS"] = "Euer Fleisch dient jetzt Tharon''ja!",
		},
		["Text_703"] = {
			["WAS"] = "Was ist mit mir geschehen? Ich gehe!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtbediensteter",
			["ART"] = "SAY",
		},
		["Text_406"] = {
			["WAS"] = "Ihr dürft dieses Portal nicht zerstören!",
			["SPRACHE"] = "NULL",
			["WER"] = "Portalwächter",
			["ART"] = "YELL",
		},
		["Text_577"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Geißelfürst Tyrannus",
			["WAS"] = "%s brüllt und schwillt von dunkler Macht erfüllt an!",
		},
		["Text_1253"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "König Phaoris",
			["WAS"] = "Nadun...",
		},
		["Text_682"] = {
			["WAS"] = "Ich werde meinen Standort nicht preisgeben, $C!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtentzünder",
			["ART"] = "SAY",
		},
		["Text_790"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Nemesis",
			["WAS"] = "%s steht kurz vor dem Ausbruch!",
		},
		["Text_165"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochlord Darion Mograine",
			["WAS"] = "Ich sehe Euch dann im Tal der Echos. Geleidet Euch wohl, Verbündeter.",
		},
		["Text_769"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Aessina",
			["WAS"] = "Durch Euch wird dieser Berg erneut erblühen. Es ist an Euch, ihn zu beschützen und zu verteidigen.",
		},
		["Text_820"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtinitiand",
			["WAS"] = "Ich bin davon nicht so recht überzeugt.",
		},
		["Text_128"] = {
			["WAS"] = "Zum ersten Mal in der Geschichte des Rings des Blutes hat Mogor sein Recht auf einen Kampf eingefordert! Auf diesem vom Kampf erschütterten Boden wird Nîghtstorm auf Mogor treffen, den Helden der Totschläger!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["ART"] = "YELL",
		},
		["Text_114"] = {
			["WAS"] = "Nix mehr Chancen! Nun Ihr zahlen den Oger!",
			["SPRACHE"] = "NULL",
			["WER"] = "Mogor",
			["ART"] = "YELL",
		},
		["Text_1528"] = {
			["WAS"] = "Bwagauugh!!! Augh verfüttert Euch an die Crocs!!!",
			["SPRACHE"] = "NULL",
			["WER"] = "Augh",
			["ART"] = "SAY",
		},
		["Text_711"] = {
			["WAS"] = "Wir verbrennen es, wir verbrennen! Bringen Feuer, ja!",
			["SPRACHE"] = "NULL",
			["WER"] = "Aschenmaul",
			["ART"] = "SAY",
		},
		["Text_1120"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdheilerin Norsala",
			["WAS"] = "Ihr habt genug Schaden angerichtet, Glop. Die Erde erwünscht Euch nicht länger.",
		},
		["Text_698"] = {
			["WAS"] = "Ihr könnt... das Auge nicht kontrollieren! Cho''gall wird es wissen. Ich werdet... bestraft.",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Manipulator",
			["ART"] = "SAY",
		},
		["Text_558"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Krick",
			["WAS"] = "Ich hab''s mir anders überlegt, nimm lieber den da!",
		},
		["Text_843"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Aviana",
			["WAS"] = "Es wird später noch Zeit geben, zu feiern, Kommandant. Da kommen Zwielichtdrachen!",
		},
		["Text_882"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Erster Offizier Kupfernuss",
			["WAS"] = "Fertigmachen zum Andocken!",
		},
		["Text_741"] = {
			["WAS"] = "Weg von da, Schurke!",
			["SPRACHE"] = "NULL",
			["WER"] = "Marion Wurmschwinge",
			["ART"] = "SAY",
		},
		["Text_1355"] = {
			["WAS"] = "Er hängt in der Takelage fest.",
			["SPRACHE"] = "NULL",
			["WER"] = "George Szuluh",
			["ART"] = "SAY",
		},
		["Text_505"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Jedoga Schattensucher",
			["WAS"] = "Hier, am Rande seines Reiches, werdet ihr Mächte erfahren, wie ihr sie euch nie hättet vorstellen können!",
		},
		["Text_470"] = {
			["WAS"] = "Kommt schon, Korrak der Blutrünstige! Ich habe gutes Geld auf Euch gesetzt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zuschauer im Amphitheater",
			["ART"] = "SAY",
		},
		["Text_453"] = {
			["WAS"] = "Ich bin der König des Erdreichs, die oberste Macht! Kommt, meine Diener, und helft eurem Herrn!",
			["SPRACHE"] = "NULL",
			["WER"] = "Erathius, König des Schmutzes",
			["ART"] = "YELL",
		},
		["Text_358"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "[ph] Argent Raid Spectator - FX - Gnome",
			["WAS"] = "Die Gnome aus Gnomeregan bejubeln Ambrose Bolzenfunk.",
		},
		["Text_186"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Salramm der Fleischformer",
			["WAS"] = "Ihr seid zu spät, Held von Lordaeron. Die Stunde der Toten naht.",
		},
		["Text_555"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Krick",
			["WAS"] = "Genug bewegt! Halt still, während ich sie alle in die Luft jage!",
		},
		["Text_683"] = {
			["WAS"] = "Passt auf!",
			["SPRACHE"] = "NULL",
			["WER"] = "Galrond von der Klaue",
			["ART"] = "YELL",
		},
		["Text_1438"] = {
			["WAS"] = "(Der Meister sieht Euch! Er sieht! Er sieht! Er will! Will, will...)",
			["SPRACHE"] = "NULL",
			["WER"] = "Stimme von Cho''gall",
			["ART"] = "WHISPER",
		},
		["Text_230"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "General Bjarngrim",
			["WAS"] = "Zeigt mir, was ihr könnt!",
		},
		["Text_1003"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Havanas",
			["WAS"] = "Havanas bereitet ein Fischmahl zu!",
		},
		["Text_322"] = {
			["WAS"] = "Die dunkle Leere wartet!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kel''Thuzad",
			["ART"] = "YELL",
		},
		["Text_1478"] = {
			["WAS"] = "Ein Poolpony, gerade zur rechten Zeit!",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Arbeiter der Krazzwerke",
			["ART"] = "SAY",
		},
		["Text_499"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Urahne Nadox",
			["WAS"] = "Ein Wächter der Ahn''kahar schlüpft aus!",
		},
		["Text_1132"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdenrufer Torunskar",
			["WAS"] = "Wir werden gehen. Kein Grund zu bleiben, wo man nicht willkommen ist.",
		},
		["Text_1633"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Tiefenaufseher",
			["WAS"] = "Mehr Elementium! Sofort!",
		},
		["Text_1429"] = {
			["WAS"] = "Das Ende aller Dinge steht uns bevor!",
			["SPRACHE"] = "NULL",
			["WER"] = "Schamane der Schwärze",
			["ART"] = "SAY",
		},
		["Text_855"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Aronus",
			["WAS"] = "Tötet sie jetzt, bevor Avianas Magie schwindet!",
		},
		["Text_1372"] = {
			["WAS"] = "Soll er nur kommen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegshäuptling Mor''ghor",
			["ART"] = "SAY",
		},
		["Text_442"] = {
			["WAS"] = "Kommt schon, Stinkebart! Ihr könnt es schaffen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zuschauer im Amphitheater",
			["ART"] = "SAY",
		},
		["Text_551"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Geretteter Hordensklave",
			["WAS"] = "Hier lang! Wir werden den Standort des Geißelfürsten angreifen!",
		},
		["Text_122"] = {
			["WAS"] = "Aus den Bergen des Schergrats kommt Rokdar der Zerklüftete! Nîghtstorm begibt sich in den Kampf ihres Lebens.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["ART"] = "YELL",
		},
		["Text_709"] = {
			["WAS"] = "Ich gebiete über die Luft, die Ihr atmet...",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtsturmrufer",
			["ART"] = "SAY",
		},
		["Text_394"] = {
			["WAS"] = "Ich bin... erneuert.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zuramat der Vernichter",
			["ART"] = "YELL",
		},
		["Text_1292"] = {
			["WAS"] = "Da sucht wohl jemand Streit, was, $C?",
			["SPRACHE"] = "NULL",
			["WER"] = "Fahnenflüchtiger Grunzer",
			["ART"] = "SAY",
		},
		["Text_20"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Varos Wolkenwanderer",
			["WAS"] = "%s ruft einen azurblauen Ringhauptmann!",
		},
		["Text_1201"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Nadun",
			["WAS"] = "Eure Herangehensweise ist... unorthodox. Ich denke aber, dass sie mit dem ganzen Rauch von den Feuern sowieso nur Eure Umrisse sehen werden.",
		},
		["Text_1103"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Neptulon",
			["WAS"] = "Die Reinigung des Wassers wird sicherlich einigen Schmutz aufwirbeln. Seht Euch vor!",
		},
		["Text_127"] = {
			["WAS"] = "Mogor hat Euch herausgefordert. Ihr müsst annehmen! Geht in den Ring, wenn Ihr bereit seid zu kämpfen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["ART"] = "SAY",
		},
		["Text_1304"] = {
			["WAS"] = "... Können wir das mit ein paar Goldstücken begleichen?",
			["SPRACHE"] = "NULL",
			["WER"] = "Bilgewässer Großknecht",
			["ART"] = "SAY",
		},
		["Text_1104"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Neptulon",
			["WAS"] = "Habt Geduld, Gäste. Die Wasser sind fast gereinigt.",
		},
		["Text_1075"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Legionär Nazgrim",
			["WAS"] = "Die Feinde haben gut gekämpft... für Allianzler... doch sie werden müde.",
		},
		["Text_314"] = {
			["WAS"] = "Ich brauche keine Knochen, um euch zu bezwingen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Schwarze Ritter",
			["ART"] = "YELL",
		},
		["Text_138"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kreuzfahrerin Rhydalla",
			["WAS"] = "Ich werde diesen Kristall nun mit der Macht des Lichtes erfüllen, er wird Lügen und Betrug durchschneiden, wie eine Klinge.",
		},
		["Text_1468"] = {
			["WAS"] = "$N, schafft diese Wildhämmer von meinem Flugplatz!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Krazz",
			["ART"] = "SAY",
		},
		["Text_588"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Falric",
			["WAS"] = "Wie Ihr wünscht, mein Herr.",
		},
		["Text_1127"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["WAS"] = "So klein. So zart. Ein Wunder, dass Ihr hier unten so lange überlebt habt, Fleischling.",
		},
		["Text_670"] = {
			["WAS"] = "Der Zeppelin nach Unterstadt ist soeben eingetroffen! Wer nach Tirisfal will, sollte an Bord gehen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Frezza",
			["ART"] = "YELL",
		},
		["Text_359"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "[ph] Argent Raid Spectator - FX - Horde",
			["WAS"] = "Die Hordezuschauer bejubeln Taraxa.",
		},
		["Text_465"] = {
			["WAS"] = "Von den fernen Bergen Alteracs kommt einer der wildesten Wettkämpfer, den diese Arena jemals gesehen hat: KORRAK DER BLUTRÜNSTIGE!!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["ART"] = "YELL",
		},
		["Text_1340"] = {
			["WAS"] = "Wa... Was!? Was glaubt er denn, was er da TUT? Die Träger sind ungeschützt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Kapitän Krazz",
			["ART"] = "SAY",
		},
		["Text_1136"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["WAS"] = "Versiegelt den Riss und verlasst diesen Ort.",
		},
		["Text_1572"] = {
			["WAS"] = "Neltharion! Sieh dich an. Deformiert. Entstellt. Du bist nur noch ein Schatten deiner selbst.",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["ART"] = "SAY",
		},
		["Text_1213"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Nadun",
			["WAS"] = "Ich beuge mich deiner Weisheit, Bruder. Lass uns beten, dass wir schnell zu einer Entschdeidung gelangen. Der Feind wartet nicht.",
		},
		["Text_402"] = {
			["WAS"] = "Die Schutzblase von %s zerplatzt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ichoron",
			["ART"] = "BOSS",
		},
		["Text_1451"] = {
			["WAS"] = "Narkrall! Wenn Ihr mich herausfordern wollt, so tut Ihr es hier! Ihr werdet unsere Truppen nicht auf einem närrischen Kreuzzug verschwenden.",
