		["Text_985"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Steinschuppendmatriarchin",
			["WAS"] = "Die Steinschuppenmatriarchin ist gefangen! Vermeidet Ihre Attacken, indem Ihr Euch bewegt!",
		},
		["Text_292"] = {
			["WAS"] = "Gut gekämpft! Eure nächste Herausforderung kommt aus den eigenen Reihen des Kreuzzugs. Ihr werdet Euch gegen ihre eindrucksvolle Tapferkeit beweisen müssen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochlord Tirion Fordring",
			["ART"] = "YELL",
		},
		["Text_1293"] = {
			["WAS"] = "Ihr seid nicht mein Vorgesetzter!",
			["SPRACHE"] = "NULL",
			["WER"] = "Fahnenflüchtiger Grunzer",
			["ART"] = "SAY",
		},
		["Text_694"] = {
			["WAS"] = "Was haben die mit mir gemacht? Ich muss zurück ins Lager...",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtbediensteter",
			["ART"] = "SAY",
		},
		["Text_1506"] = {
			["WAS"] = "Danke, dass Ihr mich gerettet habt! Als Ihr das Bewusstsein verloren habt, dachte ich schon, dass wir erledigt wären!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sturmruferin Mylra",
			["ART"] = "YELL",
		},
		["Text_124"] = {
			["WAS"] = "Lôri ist einmal mehr siegreich!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["ART"] = "YELL",
		},
		["Text_1031"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["WAS"] = "Ich bin froh, dass wir darüber gesprochen haben.",
		},
		["Text_1130"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdenrufer Torunskar",
			["WAS"] = "Wir wollen den Riss versiegeln, den Todesschwinge Azeroth beigebracht hat. Wir brauchen die Weltensäule, um das Loch hier zu schließen.",
		},
		["Text_1592"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Kriegsfürstin Zaela",
			["WAS"] = "Der Drachenmalklan steht stolz auf der Seite der Horde. Die Schattenzitadelle wird fallen, $N!",
		},
		["Text_939"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Steinvater Erzmantel",
			["WAS"] = "Euch gebührt mein Dank und der meines Volkes.",
