		["Text_660"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Sjonnir der Eisenformer",
			["WAS"] = "Weiche, verletzliche Hüllen. Kurze, zerbrechliche Leben. Ihr könnt dem Fluch des Fleischs nicht entkommen!",
		},
		["Text_136"] = {
			["ART"] = "WHISPER",
			["SPRACHE"] = "NULL",
			["WER"] = "Bernsteindrache",
			["WAS"] = "Benutzt Schocklanze, um bei Feinden Schaden zu verursachen. Sollten wir Probleme bekommen, so haltet die Zeit an, um alle Feinde an einem Ort festzuhalten, und schlagt dann mit Schocklanze zu, um massiven Schaden anzurichten!",
		},
		["Text_4"] = {
			["WAS"] = "Der Zeppelin zur Kriegshymnenfeste ist gerade angekommen! Alle an Bord in Richtung boreanische Tundra!",
			["SPRACHE"] = "NULL",
			["WER"] = "Grieb Rammrakete",
			["ART"] = "YELL",
		},
		["Text_179"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Bürger von Stratholme",
			["WAS"] = "Weshalb?",
		},
		["Text_1266"] = {
			["WAS"] = "Ich werde darüber nachforschen müssen, was wir hier erfahren haben, $N.",
			["SPRACHE"] = "NULL",
			["WER"] = "Harrison Jones",
			["ART"] = "SAY",
		},
		["Text_759"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Aktivierter Flammenzauberschutz",
			["WAS"] = "Sieg! Der Flammenzauberschutz wurde verteidigt.",
		},
		["Text_1269"] = {
			["WAS"] = "Brennt in der flüssigen Hitze der Feuerlande!",
			["SPRACHE"] = "NULL",
			["WER"] = "Glutnarbe der Verschlinger",
			["ART"] = "YELL",
		},
		["Text_1507"] = {
			["WAS"] = "Danke, dass Ihr mich gerettet habt, Jungchen, ich hatte eine schreckliche Vision. Ich war gefangen in einer Höhle voller Flammen, gezwungen, jahrelang Totems zu benutzen und wildgewordene Krieger zu heilen, ohne auch nur ein einziges Teil Schamanenausrüstung zu sehen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Hargoth Trübflamm",
			["ART"] = "SAY",
		},
		["Text_1110"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Generic Controller Bunny (CSA)",
			["WAS"] = "Die Steindrachenbrutmutter nähert sich.",
		},
		["Text_1186"] = {
			["WAS"] = "Zum Angriff!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sultan Oogah",
			["ART"] = "YELL",
