		["Text_1157"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zoltrik Drachenbann",
			["WAS"] = "Am Boden kommt Ihr mit. Wie ist es in der Luft?",
