		["Text_1026"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Diamant der Geduldige",
			["WAS"] = "Nicht verschwendet, Steinmutter. Es hatte bereits seinen Nutzen.",
		},
		["Text_969"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Mor''norokk der Hasserfüllte",
			["WAS"] = "Was? Was habt Ihr getan? Wisst Ihr, was mir der Zwielichtrat antun wird, wenn sie erfahren, dass ich geredet habe? Lieber sterbe ich!",
		},
		["Text_150"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gefangener Kreuzfahrer",
			["WAS"] = "Danke Euch, Held.",
