		["Text_920"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Katapultfahrer",
			["WAS"] = "Gut, machen wir uns auf den Weg.",
		},
		["Text_975"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Versklavter Minenarbeiter",
			["WAS"] = "Ich weiß nichts über irgendeinen Schmiedemeister. Nun erzählt mir aber, wo dieser sichere Ort liegt, von dem Ihr kommt!",
		},
		["Text_732"] = {
