			["SPRACHE"] = "NULL",
			["WER"] = "Tyrus Schwarzhorn",
			["ART"] = "EMOTE",
		},
		["Text_1407"] = {
			["WAS"] = "Gnugat, wenn Ihr Goblins noch mehr von den Stützplanken dieses Schiffes entfernt, wird es sinken!",
			["SPRACHE"] = "NULL",
			["WER"] = "Rok''tar",
			["ART"] = "SAY",
		},
		["Text_1163"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Hohepriesterin Lorthuna",
			["WAS"] = "Euch ist klar, dass keine Hoffnung besteht, oder? Todesschwinge ist auferstanden. Eure Welt ist verdammt.",
		},
		["Text_1109"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Terrath der Beständige",
			["WAS"] = "Ihr habt Euch zu weit von der Steinmutter entfernt, Drache. Es ist Zeit, Euch zurechtzuweisen.",
		},
		["Text_1123"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fungumant Glop",
			["WAS"] = "Warum ihr herkommen? Meine Höhle. Ich nie Eure Höhle kaputtmachen!",
		},
		["Text_620"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Der Lichkönig",
			["WAS"] = "Kein Ausweg mehr... Jetzt gehört Ihr mir!",
		},
		["Text_461"] = {
			["WAS"] = "Schnauzer! Wo bist du?! Hilf mir!",
			["SPRACHE"] = "NULL",
			["WER"] = "Orinoko Hauerbrecher",
			["ART"] = "YELL",
		},
		["Text_1065"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Turgore",
			["WAS"] = "Also gut. Alle Mann bereit? Los geht''s!",
