			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Helfer von S.I.C.H.E.R.",
			["WAS"] = "Unsere Männer haben den Weg gesichert. Konzentriert euch darauf, denen im Hauptraum zu helfen.",
