		["Text_812"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gescheiterter Bittsteller",
			["WAS"] = "Ich werde Euch töten und Euren Platz einnehmen, Abschaum!",
		},
		["Text_561"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Krick",
			["WAS"] = "Was Ihr sucht ist im Hort des Meisters, doch dafür müsst Ihr an Tyrannus vorbei. In den Hallen der Reflexion werdet Ihr Frostgram finden. Es... es birgt die Wahrheit.",
		},
		["Text_384"] = {
			["WAS"] = "Ein Portalwächter verteidigt das neue Portal!",
			["SPRACHE"] = "NULL",
			["WER"] = "Leutnant Sinclari",
			["ART"] = "BOSS",
		},
		["Text_1502"] = {
			["WAS"] = "Wir sind umzingelt! Seine Verteidigung ist zu stark. $N! Wacht auf!",
			["SPRACHE"] = "NULL",
			["WER"] = "Thrall",
			["ART"] = "SAY",
		},
		["Text_510"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Jedoga Schattensucher",
			["WAS"] = "Unsterblichkeit kann euch gehören, doch nur, wenn ihr Yogg-Saron bedingungslose Treue gelobt!",
		},
		["Text_1447"] = {
			["WAS"] = "Die Horde? Ich SPUCKE auf Eure Horde! Unsere Feinde sind schwach und zersplittert und Ihr habt vor, mit Höllschrei zu feilschen? Der Drachenmalklan steht alleine!",
			["SPRACHE"] = "NULL",
			["WER"] = "Narkrall Harkenklaue",
			["ART"] = "SAY",
		},
		["Text_1404"] = {
			["WAS"] = "Diese Welt stürzt in sich zusammen. Wenn Ihr die Gräuel sehen könntet, die ich sah...",
			["SPRACHE"] = "NULL",
			["WER"] = "Sauranok der Mystiker",
			["ART"] = "SAY",
		},
		["Text_1552"] = {
			["WAS"] = "Bis dann mal wieder!",
			["SPRACHE"] = "NULL",
			["WER"] = "Ticker",
			["ART"] = "SAY",
		},
		["Text_1141"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Yuldris Schwelwut",
			["WAS"] = "Genau das wollte ich hören. Gehen wir!",
		},
		["Text_1131"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Therazane",
			["WAS"] = "Und was dann? Werdet Ihr Tiefenheim seinen Bewohnern überlassen?",
		},
		["Text_1070"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Budd",
			["WAS"] = "Oohhh... Glitzer!",
