			["SPRACHE"] = "NULL",
			["WER"] = "Fleischhaken",
			["WAS"] = "Zeit zum Spielen!",
		},
		["Text_736"] = {
			["WAS"] = "%s erscheint mit einem ohrenbetäubenden Schrei über Euch!",
			["SPRACHE"] = "NULL",
			["WER"] = "Blaithe",
			["ART"] = "EMOTE",
		},
		["Text_953"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Geist eines erschlagenen Besatzungsmitglieds",
			["WAS"] = "Ich hörte, wie sie zu ihren dunklen Göttern beten, als alles schwarz wurde... Es ist das Werk des Schattenhammerkults!",
		},
		["Text_831"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtinitiand",
			["WAS"] = "Zerschmettern!",
		},
		["Text_794"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Brennender Bittsteller",
			["WAS"] = "Ich bekomme eine weitere Chance, zu dienen? Ich werde Euch nicht noch einmal enttäuschen.",
		},
		["Text_1481"] = {
			["WAS"] = "Wenn ich nur daran gedacht hätte, meine standardmäßige Notfallpoolpony-Weste anzuziehen.",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Arbeiter der Krazzwerke",
			["ART"] = "YELL",
		},
		["Text_1609"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Cho''gall",
			["WAS"] = "Jämmerliches Fleisch!",
		},
		["Text_1444"] = {
			["WAS"] = "Sagt mir, welche Art von Zauber benutzt Ihr?",
			["SPRACHE"] = "NULL",
			["WER"] = "Zaela",
			["ART"] = "SAY",
		},
		["Text_23"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Varos Wolkenwanderer",
			["WAS"] = "Sie sind... zu stark! Habe ihre... Kräfte... unterschätzt.",
		},
		["Text_1514"] = {
			["WAS"] = "Meine Drachen werden Euch im Auge behalten. Wählt Eure Worte und Eure Taten mit Bedacht, $R.",
			["SPRACHE"] = "NULL",
			["WER"] = "Lirastrasza",
			["ART"] = "SAY",
		},
		["Text_1114"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdheilerin Norsala",
			["WAS"] = "Schnell, hinterher!",
		},
		["Text_746"] = {
			["WAS"] = "Weg von da, $C!",
			["SPRACHE"] = "NULL",
			["WER"] = "Marion Wurmschwinge",
			["ART"] = "SAY",
		},
		["Text_420"] = {
			["WAS"] = "Nicht schlecht, Schwester? Was ist mit Eurem Haustier? Wo ist Invice?",
			["SPRACHE"] = "NULL",
			["WER"] = "Eroberin Krenna",
			["ART"] = "SAY",
		},
		["Text_1434"] = {
			["WAS"] = "(Blasphemie! Blasphemie, Abscheu, Hass, Hass...) Unwichtig. Wo sich ein Auge schließt, öffnet sich ein anderes. (Der Meister sieht alles! Der Meister weiß alles!) Wir werden die Herzen unserer Feinde kennen, denn sie sind schwach. Das Auge. Jetzt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Cho''gall",
			["ART"] = "SAY",
		},
		["Text_1500"] = {
			["WAS"] = "Muln stirbt! Und der Irdene Ring stirbt mit ihm.",
			["SPRACHE"] = "NULL",
			["WER"] = "Thrall",
			["ART"] = "SAY",
		},
		["Text_83"] = {
			["WAS"] = "Was Ihr hier getan habt, Sylvanas... geht gegen die Gesetze der Natur. Widerwärtig ist das einzige Wort, das mir dazu einfällt.",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Garrosh Höllschrei",
			["ART"] = "SAY",
		},
		["Text_348"] = {
			["WAS"] = "Niemand wird den Fluss der Seelen aufhalten! Ihr zögert das Unvermeidliche nur hinaus.",
			["SPRACHE"] = "NULL",
			["WER"] = "Verschlinger der Seelen",
			["ART"] = "YELL",
		},
		["Text_630"] = {
			["ART"] = "WHISPER",
			["SPRACHE"] = "NULL",
			["WER"] = "Bernsteindrache",
			["WAS"] = "Leywächter Eregos ist das Einzige, was nun noch zwischen uns und der Kontrolle des Oculus steht. Er schwebt über dem Ring der Abgleichung, an der Spitze des Oculus. Eregos ist unsagbar mächtig; bleibt auf meinem Rücken, wenn wir ihn angreifen, und überlasst das Kämpfen mir.",
		},
		["Text_367"] = {
			["ART"] = "EMOTE",
			["SPRACHE"] = "NULL",
			["WER"] = "Dunkelnetzeinsiedler",
			["WAS"] = "%s flieht zurück zum Bau...",
		},
		["Text_1357"] = {
			["WAS"] = "Sie bricht auseinander, Sir!",
			["SPRACHE"] = "NULL",
			["WER"] = "George Szuluh",
			["ART"] = "SAY",
		},
		["Text_369"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Novos der Beschwörer",
			["WAS"] = "Verstärkt meine Verteidigung! Schnell, verdammt!",
		},
		["Text_1167"] = {
			["WAS"] = "Lorthuna bereitet gerade einen mächtigen Zauber vor - geht in Deckung!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hohepriesterin Lorthuna",
			["ART"] = "BOSS",
		},
		["Text_1523"] = {
			["WAS"] = "%s sieht verwirrt aus.",
			["SPRACHE"] = "NULL",
			["WER"] = "Flick",
			["ART"] = "EMOTE",
		},
		["Text_496"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Keristrasza",
			["WAS"] = "Drachenkönigin... Lebensbinderin... erhaltet... mich.",
		},
		["Text_1117"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fungumant Glop",
			["WAS"] = "Fiese... Steinfeinde...",
		},
		["Text_1100"] = {
			["ART"] = "WHISPER",
			["SPRACHE"] = "NULL",
			["WER"] = "Kommandant Ulthok",
			["WAS"] = "Sie sterben nicht.",
		},
		["Text_891"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["WAS"] = "Sie zersplitterte, als Todesschwinge durch den Dom darüber brach und den Riss zwischen den beiden Welten schuf. Ganz Tiefenheim wird nach Azeroth stürzen, wenn wir die Weltensäule nicht wieder zusammensetzen.",
		},
		["Text_1105"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Neptulon",
			["WAS"] = "Die Bestie ist zurück! Das Wasser darf nicht verschmutzt werden!",
		},
		["Text_791"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Nemesis",
			["WAS"] = "Kleiner Untoter. Ihr seid nun in MEINEM Reich!",
		},
		["Text_508"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Taldaram",
			["WAS"] = "So... köstlich.",
		},
		["Text_851"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Aronus",
			["WAS"] = "Zeigt Euch, Bestie! Wir werden Euch und Eure verderbte Brut zerstören, egal, wo Ihr Euch versteckt!",
		},
		["Text_1398"] = {
			["WAS"] = "Moment, ah - Ihr habt mir die Worte quasi in den Mund gelegt! Das ist unfair!",
			["SPRACHE"] = "NULL",
			["WER"] = "Verdächtiger Peon",
			["ART"] = "SAY",
		},
		["Text_534"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Hordensklave",
			["WAS"] = "Wenn ich Euch das mit meinem Leben oder meinem Tod wiedergutmachen kann, dann werde ich es tun.",
		},
		["Text_1539"] = {
			["WAS"] = "Geht voran.",
			["SPRACHE"] = "NULL",
			["WER"] = "Flick",
			["ART"] = "SAY",
		},
		["Text_1348"] = {
			["WAS"] = "Sie sind hinter dem Kriegshäuptling her...",
			["SPRACHE"] = "NULL",
			["WER"] = "Luftsoldat der Kor''kron",
			["ART"] = "SAY",
		},
		["Text_1544"] = {
			["WAS"] = "Den steckst du in das... Moment... wo ist das Schlüsselloch? Was ist das für ein Schwindel?",
			["SPRACHE"] = "NULL",
			["WER"] = "Flick",
			["ART"] = "SAY",
		},
		["Text_448"] = {
			["WAS"] = "Kommt schon, Herzog Singen! Ich habe gutes Geld auf Euch gesetzt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zuschauer im Amphitheater",
			["ART"] = "SAY",
		},
		["Text_1604"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Truppenkommandant der Kor''kron",
			["WAS"] = "Wartet! Hört Ihr etwas?",
		},
		["Text_1220"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Verpflichteter Beschützer",
			["WAS"] = "Ich heiße Euch in Eurem ewigen Dienst willkommen, Dieb.",
		},
		["Text_722"] = {
			["WAS"] = "$N, Ihr habt den Uralten der Wölfe entfesselt und seinen Schatten besiegt. Eure Taten haben bereits Ihren Nachhall im Traum gefunden – habt Dank. Aber es bleibt noch mehr zu tun...",
			["SPRACHE"] = "NULL",
			["WER"] = "Vision von Ysera",
			["ART"] = "SAY",
		},
		["Text_1607"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Truppenkommandant der Kor''kron",
			["WAS"] = "Tötet ihn!",
		},
		["Text_1225"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Arbeiter von Ramkahen",
			["WAS"] = "Es wird aber auch Zeit, dass wir etwas unternehmen.",
		},
		["Text_421"] = {
			["WAS"] = "Es muss so nicht enden, wisst Ihr?",
			["SPRACHE"] = "NULL",
			["WER"] = "Gorgonna",
			["ART"] = "SAY",
		},
		["Text_163"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Mampf",
			["WAS"] = "Wir sind hier fertig. Ich bin raus.",
		},
		["Text_1337"] = {
			["WAS"] = "Sir! Kriegsflotte der Allianz backbord gesichtet.",
			["SPRACHE"] = "NULL",
			["WER"] = "George Szuluh",
			["ART"] = "SAY",
		},
		["Text_1623"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Asaad",
			["WAS"] = "Al''Akir, Eure Diener rufen um Hilfe!",
		},
		["Text_286"] = {
			["WAS"] = "Fangt an!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochlord Tirion Fordring",
			["ART"] = "YELL",
		},
		["Text_991"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Erdheilerin Norsala",
			["WAS"] = "Doch nur ein Elementarlord könnte so viele Elementare so schnell binden. Es scheint, als wären wir mit der Steinmutter selbst im Krieg.",
		},
		["Text_1576"] = {
			["WAS"] = "Das Blut des schwarzen Aspekts ist verflucht. Wo es fiel wird für zehntausend Jahre nichts mehr wachsen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Alexstrasza die Lebensbinderin",
			["ART"] = "SAY",
		},
		["Text_1188"] = {
			["WAS"] = "Depp! Die hätten auch fünf bezahlt, locker!",
			["SPRACHE"] = "NULL",
			["WER"] = "Pygmäenwegelagerer",
			["ART"] = "SAY",
		},
		["Text_371"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Novos der Beschwörer",
			["WAS"] = "Sicher seht ihr, dass alles vergebens ist!",
		},
		["Text_1333"] = {
			["WAS"] = "einig in unseren Werten, unübertroffen in Stärke, niemandem Rechenschaft schuldig.",
			["SPRACHE"] = "NULL",
			["WER"] = "Garrosh Höllschrei",
			["ART"] = "YELL",
		},
		["Text_1585"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Obsidia",
