		["Text_1197"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Prinz Nadun",
			["WAS"] = "Endlich... frei. Eure Belohnung wird großzügig sein, Freunde.",
