		["Text_187"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Ausrufer von Lordaeron",
			["WAS"] = "Truppen der Geißel sind in der Nähe des Marktgassentors gesehen worden!",
		},
		["Text_1273"] = {
			["WAS"] = "Seht Ihr das? Unangreifbar!",
