			["ART"] = "SAY",
		},
		["Text_1606"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Cho''gall",
			["WAS"] = "Hunde der Horde! Einst war ich wie Ihr. (Unsere alten Meister, klein und hungrig.) Ihr hängt an Euren sterblichen Hüllen... (Säcke voll Blut und Knochen und Tränen.) ... und versucht Eure Bedeutungslosigkeit zu leugnen.",
		},
		["Text_1433"] = {
			["WAS"] = "Unsere Agenten wurden enttarnt und getötet, Meister.",
			["SPRACHE"] = "NULL",
			["WER"] = "Zwielichtdiener",
			["ART"] = "SAY",
		},
		["Text_528"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Geißelfürst Tyrannus",
			["WAS"] = "Quälender Schmerz wird das letzte sein, woran Ihr Euch erinnert.",
		},
		["Text_1613"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Garona die Halborcin",
			["WAS"] = "Ihr verratet Euren nächsten Schlag mit Euren Augen.",
		},
		["Text_567"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Geißelfürst Tyrannus",
			["WAS"] = "Penetrante Wichte! Ihr erreicht den Hort meines Meisters niemals! Soldaten, vernichtet Sie!",
		},
		["Text_1625"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Asaad",
			["WAS"] = "Winde, tragt mich fort!",
		},
		["Text_1532"] = {
			["WAS"] = "Der Himmel nehme Euch auf!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hochprophet Barim",
			["ART"] = "YELL",
		},
		["Text_1624"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Asaad",
			["WAS"] = "%s beschwört ein temporäres Erdungsfeld!",
		},
		["Text_1664"] = {
			["WAS"] = "%s spürt die Feigheit von Kahlkopf und entfesselt einen Blitzschlag!",
			["SPRACHE"] = "NULL",
			["WER"] = "Altairus",
