			["SPRACHE"] = "Orcisch",
			["WER"] = "Garona die Halborcin",
			["WAS"] = "Das hat großen Spaß gemacht.",
		},
		["Text_1093"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Lady Naz''jar",
			["WAS"] = "Ihr habt Euch zum letzten Mal in unsere Pläne eingemischt, Sterbliche!",
