		["Text_1630"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Tiefenaufseher",
			["WAS"] = "Lasst diese Spinnen nicht das Elementium essen!",
		},
		["Text_437"] = {
			["WAS"] = "Die Schlacht steht kurz bevor! Lese ich diese Karte richtig? Es... es ist der schändliche Gigantaurlord STINKEBART! Ja, Leute, STINKEBART! Kahlkopf hat keine Chance!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gurgthock",
			["ART"] = "YELL",
		},
		["Text_560"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Fürstin Sylvanas Windläufer",
			["WAS"] = "Warum sollte ich dein elendes Leben verschonen?",
