		["Text_1639"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Räuber des Zin''jatar",
			["WAS"] = "Ihr dient, oder Ihr sterbt, Weichhaut!",
		},
		["Text_90"] = {
			["WAS"] = "Wie Ihr befehlt, Kriegshäuptling!",
