			["ART"] = "SAY",
		},
		["Text_824"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Svala Grabesleid",
			["WAS"] = "Euer Ende ist unvermeidlich.",
		},
		["Text_439"] = {
			["WAS"] = "Ich brauche ein wenig Zeit, diese Proben zu untersuchen, Mythe. Ich spreche wieder mit Euch, wenn ich mit meiner Analyse fertig bin.",
