			["WER"] = "Zen''Kiki",
			["ART"] = "SAY",
		},
		["Text_303"] = {
			["ART"] = "BOSS",
			["SPRACHE"] = "NULL",
			["WER"] = "Unsichtbarer Pirscher",
			["WAS"] = "Die Allianz hat die Tausendwinterfestung verteidigt!",
