			["WER"] = "Lehrling von Herdweiler",
			["ART"] = "SAY",
		},
		["Text_133"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Botschafter Schlackenhammer",
			["WAS"] = "Macht mit mir, was Ihr wollt. Ich habe keine Angst. Jenen Halbblutwicht werde ich niemals als meinen Herrscher anerkennen. Lang lebe der Schattenhammer!",
		},
		["Text_380"] = {
			["WAS"] = "Ihr habt mein Wort darauf, dass ich für Euren Körper eine Verwendung finden werde, nachdem ich Euch getötet habe, $R.",
			["SPRACHE"] = "Gemeinsprache",
			["WER"] = "Apotheker Jorell",
			["ART"] = "SAY",
		},
		["Text_440"] = {
			["WAS"] = "Gestaltwandel! Zeit für die Bärengestalt!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zen''Kiki",
			["ART"] = "SAY",
		},
		["Text_53"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Geheimagent",
			["WAS"] = "Delber und seine Männer machen Überstunden, Hauptmann. Er hat einen Plan entwickelt, wie wir ein Überfallkommando zur hinteren Flanke des Schlachtgetümmels bringen können.",
		},
		["Text_225"] = {
			["WAS"] = "Zum Angriff, meine Brüder! Lasst ihn den Zorn des Rudels spüren!",
