			["WER"] = "Rudelführer Ivar Blutfang",
			["ART"] = "YELL",
		},
		["Text_228"] = {
			["WAS"] = "Wir werden nicht länger stillstehen! Die Zeit zum Handeln ist jetzt gekommen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Rudelführer Ivar Blutfang",
			["ART"] = "SAY",
		},
		["Text_409"] = {
			["WAS"] = "Ihr  $R? Ihr werdet für Eure Einmischung bezahlen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zurückgezogene Seele",
			["ART"] = "YELL",
		},
		["Text_625"] = {
