			["WER"] = "Sassy Hartzang",
			["ART"] = "YELL",
		},
		["Text_319"] = {
			["WAS"] = "Ich kann nicht glauben, dass Ihr mir so etwas antut!",
			["SPRACHE"] = "NULL",
			["WER"] = "Chip Endale",
			["ART"] = "SAY",
		},
		["Text_363"] = {
			["WAS"] = "Lok-tar ogar! Dieser junge $R, Jäger noch dazu, hat Echeyakee getötet! Lasst seine Taten die Schlagkraft der neuen Horde zeigen!",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Sergra Dunkeldorn",
			["ART"] = "YELL",
		},
		["Text_367"] = {
			["WAS"] = "$N, die Geheimnisse dieser Halsbänder zu entschlüsseln, übersteigt meine Fertigkeiten...",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Margoz",
			["ART"] = "SAY",
		},
		["Text_51"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Kaja''Colaballon",
			["WAS"] = "Genießt den erfrischenden, intelligenten Geschmack der ganz neuen Kaja''Cola!",
