			["SPRACHE"] = "NULL",
			["WER"] = "Margoz",
			["ART"] = "EMOTE",
		},
		["Text_364"] = {
			["WAS"] = "%s fällt in Trance...",
			["SPRACHE"] = "NULL",
			["WER"] = "Margoz",
			["ART"] = "EMOTE",
		},
		["Text_332"] = {
			["WAS"] = "$N, zieht Euch die ultimative Fußbombenuniform über und geht herunter zu den Docks. Helft Thrall dem Handelsprinzen eine gehörige Ladung zu verpassen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Sassy Hartzang",
			["ART"] = "SAY",
		},
		["Text_8"] = {
			["WAS"] = "Exzellent. Und nun tretet bitte von der ultrakonkaven, spaltbaren Testplattform zurück. Ganz langsam, bitte.",
			["SPRACHE"] = "NULL",
			["WER"] = "Hobart Wurfhammer",
			["ART"] = "SAY",
		},
		["Text_362"] = {
			["WAS"] = "Unglaubliche Schießerei! Ich werde versuchen, die Tiere zu beruhigen. Erstattet Thork Bericht, er wird von diesem Angriff wissen wollen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Balgor Peitschschwinger",
			["ART"] = "SAY",
		},
		["Text_239"] = {
			["WAS"] = "Ihr werdet den Kampf zu ihnen tragen müssen, $N. Haltet nach Izzy Ausschau, gleich außerhalb ihres Dorfes.",
			["SPRACHE"] = "NULL",
			["WER"] = "Sassy Hartzang",
			["ART"] = "SAY",
		},
		["Text_323"] = {
			["WAS"] = "Ähm... Euch ist klar, dass dieser Käfig auch eine Unterseite hat!?",
			["SPRACHE"] = "NULL",
			["WER"] = "Gefangener $R",
			["ART"] = "SAY",
		},
		["Text_308"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Brutaler Aufseher",
			["WAS"] = "Zurück an Arbeit!",
		},
		["Text_359"] = {
			["WAS"] = "Dort ist sie. Steigt auf!",
			["SPRACHE"] = "NULL",
			["WER"] = "Rocco Peitschschwinger",
			["ART"] = "SAY",
		},
		["Text_358"] = {
			["WAS"] = "Ausgezeichnete Arbeit! Ich werde die Waren abladen. Ihr solltet Euch bei Kranal Fiss melden.",
			["SPRACHE"] = "NULL",
			["WER"] = "Balgor Peitschschwinger",
			["ART"] = "SAY",
		},
		["Text_357"] = {
			["WAS"] = "Führt sie an! Fahrt ab!",
			["SPRACHE"] = "NULL",
			["WER"] = "Halga Blutauge",
			["ART"] = "SAY",
		},
		["Text_29"] = {
			["WAS"] = "Ja, wir sind noch am Leben, Doktor Wurfhammer, trotz all Eurem Bemühen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Assistentin Greely",
			["ART"] = "SAY",
		},
		["Text_156"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Vani LeHörnchen",
			["WAS"] = "Das mit uns ist vorbei, $N! Ich bin jetzt mit Chip zusammen.",
		},
		["Text_169"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Überlebender $R",
			["WAS"] = "$N? Ich hörte Ihr seid tot.",
		},
		["Text_354"] = {
			["WAS"] = "Macht schneller, Ihr Peons! ...Zwingt mich nicht, zum Stock zu greifen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Halga Blutauge",
			["ART"] = "SAY",
		},
		["Text_16"] = {
			["WAS"] = "Ganz genau, Greely. Ihr habt den heutigen Test des Tages bestanden.",
			["SPRACHE"] = "NULL",
			["WER"] = "Hobart Wurfhammer",
			["ART"] = "SAY",
		},
		["Text_234"] = {
			["WAS"] = "Weder Eure Drohungen, noch diese Naga kümmern mich. Hier findet Eure Existenz ein Ende.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gesichtsloser aus den Tiefen",
			["ART"] = "YELL",
		},
		["Text_4"] = {
			["WAS"] = "Da, bitte. Ein Mikromechahuhn. Ich werde nie verstehen, wie Ihr auf diese Namen kommt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Assistentin Greely",
			["ART"] = "SAY",
		},
		["Text_351"] = {
			["WAS"] = "Der Zeppelin nach Grom''gol ist soeben eingetroffen! Wer in das Schlingendorntal will, sollte an Bord gehen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Snurk Zasterwill",
			["ART"] = "YELL",
