		["Text_171"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Lawinus Maximus",
			["WAS"] = "$N, Ihr müsst diese Teraptorjungen kriegen, bevor sie uns kriegen!",
		},
		["Text_350"] = {
			["WAS"] = "Der Zeppelin nach Unterstadt ist soeben eingetroffen! Wer nach Tirisfal will, sollte an Bord gehen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Frezza",
			["ART"] = "YELL",
		},
		["Text_349"] = {
			["WAS"] = "Der Zeppelin zur Kriegshymnenfeste ist gerade angekommen! Alle an Bord in Richtung boreanische Tundra!",
