			["WER"] = "Grieb Rammrakete",
			["ART"] = "YELL",
		},
		["Text_348"] = {
			["WAS"] = "Der Zeppelin nach Donnerfels ist angekommen! Alles an Bord für eine geschmeidige Fahrt über das Brachland!",
			["SPRACHE"] = "NULL",
			["WER"] = "Zelli Heißdüse",
			["ART"] = "YELL",
		},
		["Text_263"] = {
			["WAS"] = "Doktor!",
			["SPRACHE"] = "NULL",
			["WER"] = "Bürger von Kezan",
			["ART"] = "YELL",
		},
		["Text_240"] = {
			["WAS"] = "$N, Ihr müsst da rein und unsere Leute retten!",
			["SPRACHE"] = "NULL",
			["WER"] = "Izzy",
			["ART"] = "SAY",
		},
		["Text_399"] = {
			["WAS"] = "Ziel erfasst. Ernteautomatik eingeschaltet.",
			["SPRACHE"] = "NULL",
			["WER"] = "Feindschnitter 5000",
			["ART"] = "YELL",
		},
		["Text_344"] = {
			["WAS"] = "Gnade! Gnade! Ich gebe auf! Ihr macht mich fertig.",
			["SPRACHE"] = "NULL",
			["WER"] = "Handelsprinz Gallywix",
			["ART"] = "YELL",
