		["Text_343"] = {
			["WAS"] = "Da habt Ihr!",
			["SPRACHE"] = "NULL",
			["WER"] = "Handelsprinz Gallywix",
			["ART"] = "YELL",
		},
		["Text_25"] = {
			["WAS"] = "Alles oder nichts. Ich habe Euch immer geliebt, Greely!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hobart Wurfhammer",
			["ART"] = "YELL",
		},
		["Text_341"] = {
			["WAS"] = "Ich muss das Kartell verkleinern - und ich fange bei Euch an!",
			["SPRACHE"] = "NULL",
			["WER"] = "Handelsprinz Gallywix",
			["ART"] = "YELL",
		},
		["Text_200"] = {
			["WAS"] = "Ich sehe Euch oben, $N. Habt noch einmal Dank für meine Befreiung.",
			["SPRACHE"] = "NULL",
			["WER"] = "Thrall",
			["ART"] = "SAY",
		},
		["Text_340"] = {
			["WAS"] = "Hier ist ein wenig von der Kohle, die ich Euch weggenommen habe!",
			["SPRACHE"] = "NULL",
			["WER"] = "Handelsprinz Gallywix",
			["ART"] = "YELL",
		},
		["Text_22"] = {
			["WAS"] = "Glaubt Ihr? Hobart, das Mikromechahuhn destabilisiert sich. Es dehnt sich aus!",
			["SPRACHE"] = "NULL",
			["WER"] = "Assistentin Greely",
			["ART"] = "SAY",
		},
		["Text_335"] = {
			["WAS"] = "Ich werde einen Vertreter Eures Volkes zum neuen Kriegshäuptling entsenden, Garrosh Höllschrei in Orgrimmar.",
			["SPRACHE"] = "NULL",
			["WER"] = "Thrall",
			["ART"] = "YELL",
		},
		["Text_149"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Rebellischer Troll",
			["WAS"] = "Vielleicht hol'' ich mir die Bomben von Euch und dann seh''n wir ja, wer hier in die Luft fliegt!",
		},
		["Text_131"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Vorarbeiter Feuchtlunte",
			["WAS"] = "Ich kann einfach nicht glauben, wie dreist diese Trolle sind. Die rebellieren einfach, nach allem, was ich für sie getan habe!",
		},
		["Text_339"] = {
			["WAS"] = "Ihr habt mein Hauptquartier zerstört und jetzt werde ich Euch zerstören!",
			["SPRACHE"] = "NULL",
			["WER"] = "Handelsprinz Gallywix",
			["ART"] = "YELL",
		},
		["Text_165"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Gizmo Gangzwinger",
			["WAS"] = "Ja, da ist noch ein Haufen Leute in den Fluchtkapseln gefangen, Boss. Oh, wartet. Ich vermute, Ihr seid nicht mehr der Boss. Wie dem auch sei, sie werden wohl alle sterben, wenn Ihr sie nicht herausholt.",
		},
		["Text_175"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Sassy Hartzang",
			["WAS"] = "Feuchtlunte befindet sich am Höhleneingang gleich im Südosten.",
		},
		["Text_338"] = {
			["WAS"] = "Ich bin pures Geld!",
			["SPRACHE"] = "NULL",
			["WER"] = "Handelsprinz Gallywix",
			["ART"] = "YELL",
		},
		["Text_128"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Assistentin Greely",
			["WAS"] = "Sofort. Ich kennzeichne das Instalabor für den Einsatz in Azshara. Ich lege auch noch ihr kleines Kissen mit rein. Sie ist so süß!",
		},
		["Text_337"] = {
			["WAS"] = "Wie Ihr wünscht! Lang lebe das Bilgewasserkartell! Für die Horde!",
			["SPRACHE"] = "NULL",
			["WER"] = "Handelsprinz Gallywix",
			["ART"] = "YELL",
		},
		["Text_333"] = {
			["WAS"] = "Die Rampe hinauf, $N! Helft Thrall, den Handelsprinzen zu besiegen!",
			["SPRACHE"] = "NULL",
			["WER"] = "Kilag Blutmaul",
			["ART"] = "YELL",
		},
		["Text_220"] = {
			["WAS"] = "In Ordnung, es ist drin. Es sollte nur einen Moment dauern...",
			["SPRACHE"] = "NULL",
			["WER"] = "Assistentin Greely",
			["ART"] = "YELL",
		},
		["Text_331"] = {
			["WAS"] = "DER VERRÄTER IST ALSO HIER, UM EUCH ZU RETTEN, KRIEGSHÄUPTLING. WIE PRAKTISCH. IHR WERDET MIR BEIDE DIENEN ODER GEMEINSAM FALLEN!",
			["SPRACHE"] = "NULL",
			["WER"] = "Handelsprinz Gallywix",
			["ART"] = "YELL",
		},
		["Text_321"] = {
			["WAS"] = "Erst verlässt sie Euch für Chip, und jetzt für den Handelsprinzen! Sie war nie gut genug für Euch, $N.",
			["SPRACHE"] = "NULL",
			["WER"] = "Sassy Hartzang",
			["ART"] = "SAY",
		},
		["Text_330"] = {
			["WAS"] = "Aber, Schätzchen...?",
			["SPRACHE"] = "NULL",
			["WER"] = "Vani LeHörnchen",
			["ART"] = "SAY",
		},
		["Text_143"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Kaja''Colaballon",
			["WAS"] = "Kaja''Cola! Wenn Eure Tüftelei unübertroffen sein soll!",
		},
		["Text_301"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Überlebender $R",
			["WAS"] = "Vanille mit Schokoladengeschmack!",
		},
		["Text_224"] = {
			["WAS"] = "Hört Ihr das, Naga? $N ist auf dem Weg hierher, um unsere „Verhandlungen“ zu beenden!",
			["SPRACHE"] = "NULL",
			["WER"] = "Megs Schredderschreck",
			["ART"] = "YELL",
		},
		["Text_285"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Slinky Scharfklinge",
			["WAS"] = "Okay. Wir versuchen, uns von dem explodieren Vulkan abzusetzen und uns mit den Orcs für den finalen Schlag gegen den Handelsprinzen zu vereinen. Wir sehen uns auf der anderen Seite... Hoffe ich zumindest.",
		},
		["Text_329"] = {
