			["SPRACHE"] = "NULL",
			["WER"] = "Gefangener $R",
			["ART"] = "SAY",
		},
		["Text_328"] = {
			["WAS"] = "$N, Ihr und Hobart seid irgendwann noch einmal mein Tod!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gefangener $R",
			["ART"] = "SAY",
		},
		["Text_314"] = {
