		["Text_298"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Bürger von Kezan",
			["WAS"] = "Schuhe mit Rädern. Und Handschuhe mit Rädern - falls man hinfällt.",
		},
		["Text_326"] = {
			["WAS"] = "Du hast dich nie richtig um deine Karriere gekümmert. Ich bin so froh, dass ich endlich einen echten $R gefunden habe - der auch noch meine Einkaufsträume erfüllt.",
			["SPRACHE"] = "NULL",
