		["Text_325"] = {
			["WAS"] = "Die Piraten haben Schlüssel!",
			["SPRACHE"] = "NULL",
			["WER"] = "Gefangener $R",
			["ART"] = "SAY",
		},
		["Text_192"] = {
			["WAS"] = "Meine Rippen sind gebrochen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Orcischer Späher",
			["ART"] = "SAY",
		},
		["Text_62"] = {
			["ART"] = "SAY",
			["SPRACHE"] = "NULL",
			["WER"] = "Bürgerin von Kezan",
			["WAS"] = "Aua!",
		},
		["Text_125"] = {
			["ART"] = "YELL",
			["SPRACHE"] = "NULL",
			["WER"] = "Hobart Wurfhammer",
			["WAS"] = "Eine Party? Könnt Ihr das glauben? Eine Party und die ganze Insel steht kurz vor der Explosion?! Was denken die sich eigentlich?!!!",
		},
		["Text_361"] = {
			["WAS"] = "Die Brennende Klinge? Was tun die hier? Legt zum Töten an!",
			["SPRACHE"] = "NULL",
			["WER"] = "Balgor Peitschschwinger",
			["ART"] = "SAY",
		},
		["Text_75"] = {
