			["SPRACHE"] = "NULL",
			["WER"] = "Izzy",
			["WAS"] = "Warum bebt die Erde, $N?!",
		},
		["Text_322"] = {
			["WAS"] = "Trägerraketen für Käfige. Was wird mir noch alles einfallen? Ich bin ein Genie!",
			["SPRACHE"] = "NULL",
			["WER"] = "Hobart Wurfhammer",
			["ART"] = "SAY",
		},
		["Text_194"] = {
