			["SPRACHE"] = "NULL",
			["WER"] = "Sudsy Magee",
			["WAS"] = "Nicht ins Gesicht, nicht ins Gesicht!",
		},
		["Text_279"] = {
			["WAS"] = "Zeigt diesen Feiglingen, was Krieg wirklich bedeutet!",
			["SPRACHE"] = "Orcisch",
			["WER"] = "Kilag Blutmaul",
			["ART"] = "YELL",
		},
		["Text_278"] = {
			["WAS"] = "Übt Gerechtigkeit für unsere Toten, $N.",
			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["ART"] = "SAY",
		},
		["Text_196"] = {
			["WAS"] = "Vergesst nicht, Eure Schutzbrille aufzulassen, $N. Nur so können wir sie ausfindig machen, bevor sie uns anfallen.",
			["SPRACHE"] = "NULL",
			["WER"] = "Orcischer Späher",
			["ART"] = "SAY",
		},
		["Text_280"] = {
