			["SPRACHE"] = "NULL",
			["WER"] = "Aggra",
			["ART"] = "SAY",
		},
		["Text_266"] = {
			["WAS"] = "Ich habe die Schuhzooka so eingestellt, dass sie mehrere Raketen pro Schuss abfeuert. Ich bin mir recht sicher, dass ich das Zielsystem perfekt kalibriert habe.",
			["SPRACHE"] = "NULL",
			["WER"] = "Hobart Wurfhammer",
			["ART"] = "SAY",
		},
		["Text_265"] = {
			["WAS"] = "Helft mir, helft mir!",
			["SPRACHE"] = "NULL",
			["WER"] = "Bürger von Kezan",
			["ART"] = "YELL",
		},
		["Text_248"] = {
			["WAS"] = "Ich konnte spüren, wie mir das Leben entglitt.",
			["SPRACHE"] = "NULL",
			["WER"] = "Gefangener $R",
			["ART"] = "SAY",
